var tipuesearch = {"pages":[{"title":"P4248 [AHOI2013]差异","url":"/Blog/p4248/","text":"题目描述 给定一个字符串，求两两后缀的 lcplcplcp 之和。 题目正解 后缀数组 SASASA / 后缀自动机 SAMSAMSAM →\\to→ 后缀树 题目思路 - SASASA 这个题对于 SASASA 来说略有思维难度。首先考虑任意两个后缀 i,ji, ji,j 的 lcplcplcp 是不是就是 min⁡k=i+1jheighti\\min_{k = i + 1}^j height_imink=i+1j​heighti​ 那么要求任意两个的话，直接枚举复杂度肯定是过不去的。可以考虑每个点作为最小值对答案造成贡献的区间。这个东西是可以用单调栈来求的，或者说叫笛卡尔树。 时间复杂度：O(n)O(n)O(n) 相对比较优秀。 题目代码 - SASASA 代码 12345678910111213141516171819202122232425262728293031323334353637383940414243444546474849505152535455565758596061626364656667686970// Code By CloudySky#include &lt;bits/stdc++.h&gt;// #define int long longnamespace IO &#123;inline int read() &#123; int x = 0, f = 1; char c = getchar(); while (c &lt; &#x27;0&#x27; || c &gt; &#x27;9&#x27;) &#123;if (c == &#x27;-&#x27;) f = -1; c = getchar();&#125; while (c &gt;= &#x27;0&#x27; &amp;&amp; c &lt;= &#x27;9&#x27;) &#123;x = x * 10 + (c ^ 48); c = getchar();&#125; return x * f;&#125;void print_n(long long x) &#123; if (x &gt; 9) print_n(x / 10); putchar(x % 10 + &#x27;0&#x27;);&#125;inline void print(long long x, char s = &#x27;\\n&#x27;) &#123; if (x &lt; 0) putchar(&#x27;-&#x27;), x = -x; print_n(x), putchar(s);&#125;&#125; // namespace IOusing namespace IO;const int Maxn = 2e6 + 10;using namespace std;char s[Maxn];int sa[Maxn], h[Maxn], rk[Maxn &lt;&lt; 1], trk[Maxn &lt;&lt; 1];bool cmp(int x, int y, int w) &#123;return trk[x] == trk[y] &amp;&amp; trk[x + w] == trk[y + w];&#125;void SA(int n) &#123; static int cnt[Maxn], id[Maxn]; int m = 300, p; // for (int i = 1; i &lt;= n; ++i) ++cnt[rk[i] = s[i]]; // for (int i = 1; i &lt;= m; ++i) cnt[i] += cnt[i - 1]; for (int i = n; i; --i) sa[cnt[rk[i]]--] = i; for (int w = 1; p != n; w &lt;&lt;= 1, m = p) &#123; p = 0; for (int i = n; i &gt; n - w; --i) id[++p] = i; for (int i = 1; i &lt;= n; ++i) if (sa[i] &gt; w) id[++p] = sa[i] - w; memset(cnt, 0, sizeof(cnt)); for (int i = 1; i &lt;= n; ++i) ++cnt[rk[id[i]]]; // for (int i = 1; i &lt;= m; ++i) cnt[i] += cnt[i - 1]; for (int i = n; i; --i) sa[cnt[rk[id[i]]]--] = id[i]; memcpy(trk, rk, sizeof(trk)); p = 0; // for (int i = 1; i &lt;= n; ++i) rk[sa[i]] = cmp(sa[i], sa[i - 1], w) ? p : ++p; if (p == n) for (int i = 1; i &lt;= n; ++i) sa[rk[i]] = i; &#125; for (int i = 1, k = 0; i &lt;= n; ++i) &#123; if (k) --k; while (s[i + k] == s[sa[rk[i] - 1] + k]) ++k; // h[rk[i]] = k; &#125;&#125;int stc[Maxn], top, l[Maxn], r[Maxn];signed main() &#123; scanf(&quot;%s&quot;, s + 1); int n = strlen(s + 1); SA(n); stc[top = 1] = 1; for (int i = 2; i &lt;= n; ++i) &#123; while (top &amp;&amp; h[stc[top]] &gt; h[i]) r[stc[top--]] = i; l[i] = stc[top], stc[++top] = i; &#125; while (top) r[stc[top--]] = n + 1; long long ans = 1ll * (n - 1) * n * (n + 1) / 2; for (int i = 2; i &lt;= n; ++i) ans -= 2ll * (r[i] - i) * (i - l[i]) * h[i]; print(ans); return 0;&#125; 题目思路 - SAMSAMSAM 这个知道后缀树的直接无脑冲就完事了。 同样是求两两后缀之间的 lcplcplcp，在后缀树上体现为两个叶子节点的 lcalcalca。直接跑个树形 DPDPDP 在 lcalcalca 处数点就行。 至于如何用 SAMSAMSAM 去构建后缀树，倒着把字符串插进去得到的 failfailfail 树就是了。 题目代码 - SAMSAMSAM 代码 12345678910111213141516171819202122232425262728293031323334353637383940414243444546474849505152535455565758596061626364656667686970717273// Code By CloudySky#include &lt;bits/stdc++.h&gt;// #define int long longnamespace IO &#123;inline int read() &#123; int x = 0, f = 1; char c = getchar(); while (c &lt; &#x27;0&#x27; || c &gt; &#x27;9&#x27;) &#123;if (c == &#x27;-&#x27;) f = -1; c = getchar();&#125; while (c &gt;= &#x27;0&#x27; &amp;&amp; c &lt;= &#x27;9&#x27;) x = x * 10 + (c ^ 48), c = getchar(); return x * f;&#125;void print_n(int x) &#123; if (x &gt; 9) print_n(x / 10); putchar(x % 10 + &#x27;0&#x27;);&#125;inline void print(int x, char s = &#x27;\\n&#x27;) &#123; if (x &lt; 0) putchar(&#x27;-&#x27;), x = -x; print_n(x), putchar(s);&#125;&#125; // namespace IOusing namespace IO;void openfile();const int Maxn = 1e6 + 10;using namespace std;int sam[Maxn][26], siz[Maxn], fail[Maxn], len[Maxn], lst, tot;void insert(char c) &#123; int p = lst, np = ++tot, ch = c - &#x27;a&#x27;; lst = np, len[np] = len[p] + 1, siz[np] = 1; for (; p != -1 &amp;&amp; !sam[p][ch]; p = fail[p]) sam[p][ch] = np; if (p == -1) return fail[np] = 0, void(); int q = sam[p][ch]; if (len[q] == len[p] + 1) return fail[np] = q, void(); int nq = ++tot; fail[nq] = fail[q], fail[q] = fail[np] = nq; memcpy(sam[nq], sam[q], sizeof(sam[nq])); len[nq] = len[p] + 1; for (; p != -1 &amp;&amp; sam[p][ch] == q; p = fail[p]) sam[p][ch] = nq;&#125;char s[Maxn];void SAM() &#123; fail[0] = -1, lst = tot = 0; int n = strlen(s); for (int i = n - 1; i &gt;= 0; --i) insert(s[i]);&#125;long long ans;vector &lt;int&gt; g[Maxn];void dfs(int x) &#123; int st = siz[x]; for (int y : g[x]) dfs(y), siz[x] += siz[y]; for (int y : g[x]) ans += 1ll * siz[y] * (siz[x] - siz[y]) * len[x]; ans += 1ll * st * (siz[x] - st) * len[x];&#125;signed main() &#123; openfile(); scanf(&quot;%s&quot;, s), SAM(); int n = strlen(s); for (int i = 1; i &lt;= tot; ++i) g[fail[i]].push_back(i); dfs(0); printf(&quot;%lld\\n&quot;, 1ll * (n - 1) * n * (n + 1) / 2 - ans); return 0;&#125;void openfile() &#123; #ifndef ONLINE_JUDGE freopen(&quot;in.in&quot;, &quot;r&quot;, stdin); freopen(&quot;out.out&quot;, &quot;w&quot;, stdout); #endif&#125; 总结 难得一见的好题，一道题牵扯了 333 个后缀数据结构。 加深了对笛卡尔树的印象（笛卡尔树的作用以及建树过程）。对 SAMSAMSAM 有了更深入的了解（反串 failfailfail 树为后缀树），初识了后缀树（两个叶子节点 lcalcalca 即为两个后缀 lcplcplcp）。 本文作者：CloudySky 写作时间： 2022-03-12 最后更新时间： 2022-03-12 遵循协议： BY-NC-SA","tags":"数据结构 字符串 题解"},{"title":"CF235C Cyclical Quest","url":"/Blog/cf235c/","text":"题目描述 给定一个文本串，和 nnn 个模式串。求每个模式串和它的循环同构串在文本串中出现的总次数。 题目正解 后缀自动机 SAMSAMSAM 题目思路 就这个题思考一下把 SAMSAMSAM 当成文本匹配工具的做法。 首先回忆一条性质 “从初始节点 t0t_0t0​ 开始的任意一条路径都与 sss 的子串构成对应关系”。 这就注定 SAMSAMSAM 可以作为一种字符串匹配工具。且在空间复杂度以外比 ACACAC 自动机更加优秀。 设匹配长度为 kkk，对于文本串 TTT 只需要暴力跳 samsamsam 转移边同时将 k++k++k++。失配之后直接跳 failfailfail 同时 k=len[p]k = len[p]k=len[p] 然后继续匹配即可。因为当前点的匹配值一定是大于 maxlenfailpmaxlen_{fail_p}maxlenfailp​​ 的，否则它不会跳到当前节点，所以失配后长度一定是 failpfail_pfailp​ 等价类中最长的。 对于这道题来讲。先把整个串完整匹配出来。然后开始在前面逐个删字符的同时在后面加字符继续匹配，当匹配长度达到串长直接将当前节点的 sizsizsiz 统计到答案里。 对于在前面删字符，不需要进行任何实质上的删除，只需要将匹配长度 −1-1−1，直到匹配长度不在 [minlenp,maxlenp][minlen_p, maxlen_p][minlenp​,maxlenp​] 这个区间跳 failfailfail 即可。 但是你发现直接这样做是不对的。如果这个字符串的两个循环子串完全相等的话答案将被重复统计，如 abababababab 当起始位置为 111 和 333 时这个字符串时完全一样的，所以在用过的节点上需要打上标记。然后char vis[Maxn];活活气死自己 题目代码 代码 1234567891011121314151617181920212223242526272829303132333435363738394041424344454647484950515253545556575859606162636465// Code By CloudySky#include &lt;bits/stdc++.h&gt;// #define int long longnamespace IO // namespace IOusing namespace IO;const int Maxn = 2e6 + 10;using namespace std; char s[Maxn];int sam[Maxn][26], siz[Maxn], len[Maxn], fail[Maxn], lst, tot; void insert(char c) &#123; int p = lst, np = ++tot, ch = c - &#x27;a&#x27;; lst = np, len[np] = len[p] + 1, siz[np] = 1; for (; p != -1 &amp;&amp; !sam[p][ch]; p = fail[p]) sam[p][ch] = np; if (p == -1) return fail[np] = 0, void(); int q = sam[p][ch]; if (len[q] == len[p] + 1) return fail[np] = q, void(); int nq = ++tot; fail[nq] = fail[q], fail[q] = fail[np] = nq; memcpy(sam[nq], sam[q], sizeof(sam[nq])); len[nq] = len[p] + 1; for (; p != -1 &amp;&amp; sam[p][ch] == q; p = fail[p]) sam[p][ch] = nq;&#125; void SAM() &#123; fail[0] = -1, lst = tot = 0; int n = strlen(s); for (int i = 0; i &lt; n; ++i) insert(s[i]); static int cnt[Maxn], id[Maxn]; for (int i = 0; i &lt;= tot; ++i) ++cnt[len[i]]; for (int i = 0; i &lt;= tot; ++i) cnt[i] += cnt[i - 1]; for (int i = 0; i &lt;= tot; ++i) id[--cnt[len[i]]] = i; for (int i = tot; i; --i) siz[fail[id[i]]] += siz[id[i]]; print(tot + 1);&#125;char t[Maxn]; int vis[Maxn]; void solve(int tim) &#123; scanf(&quot;%s&quot;, t + 1); int n = strlen(t + 1), k = 0, p = 0; long long ans = 0; for (int i = 1; i &lt;= n; ++i) &#123; int ch = t[i] - &#x27;a&#x27;; while (p != 0 &amp;&amp; !sam[p][ch]) k = len[p = fail[p]]; if (sam[p][ch]) p = sam[p][ch], ++k; &#125; for (int i = 1; i &lt;= n; ++i) &#123; int ch = t[i] - &#x27;a&#x27;; if (k == n) &#123; if (vis[p] != tim) ans += siz[p], vis[p] = tim; if (--k == len[fail[p]]) p = fail[p]; &#125; while (p != 0 &amp;&amp; !sam[p][ch]) k = len[p = fail[p]]; if (sam[p][ch]) p = sam[p][ch], ++k; &#125; print(ans);&#125; signed main() &#123; scanf(&quot;%s&quot;, s), SAM(); int m = read(); for (int i = 1; i &lt;= m; ++i) solve(i); return 0;&#125; 本文作者：CloudySky 写作时间： 2022-03-12 最后更新时间： 2022-03-12 遵循协议： BY-NC-SA","tags":"数据结构 字符串 题解"},{"title":"2022-03-11 题解","url":"/Blog/solution-2022-03-11/","text":" 输入密码来证明你不是卷王","tags":"test life"},{"title":"2022寒假高一有基础模拟赛","url":"/Blog/solution-2022Winter/","text":" 输入密码来证明你不是卷王","tags":"题解 test"},{"title":"P3975 [TJOI2015]弦论","url":"/Blog/p3975/","text":"P3975 [TJOI2015]弦论 后缀数组与后缀自动机的拓展应用（磕了一天的题） 题目描述 给定一个字符串 sss ，求排名为 kkk 的子串，分两种情况： 本质相同，位置不同算 111 种。 本质相同，位置不同算 多 种。 题目正解 SA/SAMSA/SAMSA/SAM 题目思路 - SASASA 对于 SASASA 来讲， 111 类相对来将好解一些。对于一个后缀 xxx，比他小的所有子串的个数为： ∑i=1x−1n−sa[i]+1−height[i]\\sum_{i = 1}^{x - 1} n - sa[i] + 1 - height[i] i=1∑x−1​n−sa[i]+1−height[i] 这个东西理解起来就是，你把所有的后缀按照 rkrkrk 排成一列，那么对于每个后缀，他能进行的贡献即为 s[sa[i]∼sa[i]+height[i]],s[sa[i]∼sa[i]+height[i]+1],⋯ ,s[sa[i]∼n]s[sa[i]\\sim sa[i] + height[i]], s[sa[i]\\sim sa[i] + height[i] + 1], \\cdots, s[sa[i]\\sim n]s[sa[i]∼sa[i]+height[i]],s[sa[i]∼sa[i]+height[i]+1],⋯,s[sa[i]∼n] 。原因就是对于它和上一段的 lcplcplcp ，一定已经在上一段或更早的时候被统计到了。所以可以直接线性扫一遍直到排名刚好为 kkk。 时间复杂度：O(n)O(n)O(n) 222 类相对来说困难一些。因为对于它和后面的后缀的 lcplcplcp，没有办法当前串统计到。 但是，正难可以反，我们可以发现，给定一个知道起始位置为 ppp 和长度 www 的串，求他的排名相对来讲简单一些。rkrkrk 在它前面的后缀，对答案的贡献为 ∑n−sa[i]+1\\sum n - sa[i] + 1∑n−sa[i]+1 （因为本质不同算多个，所以不去要减 heightheightheight）。对于它后面的串，对答案的贡献为 ∑min⁡(w,lcp(p,i))\\sum\\min(w, lcp(p, i))∑min(w,lcp(p,i)) 后面的 lcplcplcp 只需要对 heightheightheight 预处理 STSTST 表就能做到 O(1)O(1)O(1) 查询。最终的式子为： ∑i=1p−1(n−sa[i]+1)+min⁡(w,n−sa[p]+1)+∑i=p+1nmin⁡(w,min⁡j=i+1pheight[j])\\sum_{i = 1}^{p - 1} (n - sa[i] + 1) + \\min(w, n - sa[p] + 1) + \\sum_{i = p + 1}^n\\min(w, \\min_{j = i + 1}^p height[j]) i=1∑p−1​(n−sa[i]+1)+min(w,n−sa[p]+1)+i=p+1∑n​min(w,j=i+1minp​height[j]) 现在的关键就是如何求 ppp 和 www ，做法就是二分情况 111 下的排名。单调性显然。 所以整个过程就是 二分排名（情况 111） →\\to→ 求出对应的子串 →\\to→ 求出排名（情况 222），比对。 最终答案要的是 rk≥krk \\ge krk≥k 的最小子串。 时间复杂度：O(nlogn)O(nlogn)O(nlogn) 表现略差，洛谷数据跑了 7.3s+7.3s^+7.3s+ 。（可能与我常数大有密切联系） 题目代码 - SASASA 代码 123456789101112131415161718192021222324252627282930313233343536373839404142434445464748495051525354555657585960616263646566676869707172737475767778798081828384858687888990919293949596979899// Code By CloudySky#include &lt;bits/stdc++.h&gt;// #define int long longnamespace IO // namespace IOusing namespace IO;const int Maxn = 5e5 + 10;using namespace std;char s[Maxn];int sa[Maxn], rk[Maxn], h[Maxn], trk[Maxn &lt;&lt; 1];bool cmp(int x, int y, int w) &#123;return trk[x] == trk[y] &amp;&amp; trk[x + w] == trk[y + w];&#125;void SA(int n) &#123; static int cnt[Maxn], id[Maxn]; int m = 300, p = 0; for (int i = 1; i &lt;= n; ++i) cnt[rk[i] = s[i]]++; for (int i = 1; i &lt;= m; ++i) cnt[i] += cnt[i - 1]; for (int i = n; i; --i) sa[cnt[rk[i]]--] = i; for (int w = 1; p != n; w &lt;&lt;= 1, m = p) &#123; p = 0; for (int i = n; i &gt; n - w; --i) id[++p] = i; for (int i = 1; i &lt;= n; ++i) if (sa[i] &gt; w) id[++p] = sa[i] - w; memset(cnt, 0, sizeof(cnt)); for (int i = 1; i &lt;= n; ++i) cnt[rk[id[i]]]++; for (int i = 1; i &lt;= m; ++i) cnt[i] += cnt[i - 1]; for (int i = n; i; --i) sa[cnt[rk[id[i]]]--] = id[i]; memcpy(trk, rk, sizeof(rk)); p = 0; for (int i = 1; i &lt;= n; ++i) rk[sa[i]] = cmp(sa[i], sa[i - 1], w) ? p : ++p; if (p == n) for (int i = 1; i &lt;= n; ++i) sa[rk[i]] = i; &#125; for (int i = 1, k = 0; i &lt;= n; ++i) &#123; if (k) --k; while (s[i + k] == s[sa[rk[i] - 1] + k]) ++k; h[rk[i]] = k; &#125;&#125;pair &lt;int, int&gt; kth (int n, int k) &#123; for (int i = 1, x; i &lt;= n; ++i) &#123; x = n - sa[i] + 1 - h[i]; if (x &gt;= k) return &#123;i, k&#125;; else k -= x; &#125; return &#123;0, -1&#125;;&#125;namespace ST&#123; int st[Maxn][33], lg[Maxn]; void init(int n) &#123; for (int i = 1; i &lt;= n; ++i) st[i][0] = h[i]; for (int k = 1; k &lt;= log2(n); ++k) &#123; for (int i = 1; i + (1 &lt;&lt; k) - 1 &lt;= n; ++i) st[i][k] = min(st[i][k - 1], st[i + (1 &lt;&lt; (k - 1))][k - 1]); &#125; &#125; int query(int l, int r, int n) &#123; int k = log2(r - l); return min(st[l + 1][k], st[r - (1 &lt;&lt; k) + 1][k]); &#125;&#125;signed main() &#123; scanf(&quot;%s&quot;, s + 1); int n = strlen(s + 1), t = read(), k = read(), p, w; SA(n); if (t == 0)&#123; auto ans = kth(n, k); if (ans.second == -1) return print(-1), 0; p = ans.first, w = ans.second; for (int i = sa[p]; i &lt;= sa[p] + h[p] + w - 1; ++i) putchar(s[i]); return 0; &#125; else &#123; if (k &gt; 1ll * n * (n + 1) / 2) return print(-1), 0; int l = 0, r = k; ST::init(n); while (l &lt; r) &#123; int mid = (l + r) &gt;&gt; 1, tot = 0, p, w; auto tmp = kth(n, mid); p = tmp.first, w = tmp.second; for (int i = 1; i &lt; p; ++i) tot += n - sa[i] + 1; tot += min(w, n - sa[p] + 1); for (int i = p + 1; i &lt;= n; ++i) tot += min(w, ST::query(p, i, n)); if (tot &gt;= k) r = mid; else l = mid + 1; &#125; auto ans = kth(n, l); p = ans.first, w = ans.second; for (int i = sa[p]; i &lt;= sa[p] + w - 1; ++i) putchar(s[i]); &#125; return 0;&#125; 题目思路 - SAMSAMSAM 对于 SAMSAMSAM 来讲，只要思路对了两种情况差不多。 构建出 SAMSAMSAM，对于每个点 xxx ，统计出以它结尾的子串个数，记为 siz[x]siz[x]siz[x] ，利用 sizsizsiz 统计出经过它的所有子串个数，记为 sum[x]sum[x]sum[x] 。 至于如何去求 sizsizsiz 和 minminmin ，大概有两种方法，一种是常规的倒着连 failfailfail 然后跑 dfsdfsdfs 或 bfsbfsbfs ，而另一种则是对 lenlenlen 从小到大进行排序，倒着扫更新（当然不能直接对 lenlenlen 排序，而是要建立一个映射关系。） 这样就能保证更新 fail[x]fail[x]fail[x] 时已经更新过 xxx 了。对于条件 111 在求 sumsumsum 之前将每个点的 sizsizsiz 赋成 111 即可。 递归进行输出，每到一个点 a∼za\\sim za∼z 枚举转移边，比较 kkk 和 sum[sam[p][i]]sum[sam[p][i]]sum[sam[p][i]] 的大小关系。 k&gt;sum[sam[p][i]]k &gt; sum[sam[p][i]]k&gt;sum[sam[p][i]] 说明要找的点不经过这个转移边，k=k−sum[sam[p][i]]k = k - sum[sam[p][i]]k=k−sum[sam[p][i]]。 k≤sum[sam[p][i]]k \\le sum[sam[p][i]]k≤sum[sam[p][i]] 说明要找的点需要经过这个转移边。输出 iii 并递归。结束后直接回溯防止重复输出。 类似 01trie01trie01trie 二分，只不过多了几个边。 时间复杂度： O(n)O(n)O(n) 洛谷数据 4.3s+4.3s^+4.3s+ 表现还可以。关键是它代码还短。\\huge\\text{关键是它代码还短}。关键是它代码还短。 所以为什么我要写 SASASA a? 题目代码 - SAMSAMSAM 代码 123456789101112131415161718192021222324252627282930313233343536373839404142434445464748495051525354555657585960616263// Code By CloudySky#include &lt;bits/stdc++.h&gt;#define int long longnamespace IO // namespace IOusing namespace IO;const int Maxn = 2e6 + 10;using namespace std;int sam[Maxn][26], fail[Maxn], len[Maxn], lst, tot;int siz[Maxn], sum[Maxn];void SAM() &#123;len[0] = 0, fail[0] = -1, lst = tot = 0;&#125;void insert(char c) &#123; int p = lst, np = ++tot, ch = c - &#x27;a&#x27;; lst = np, len[np] = len[p] + 1, siz[np] = 1; for (; p != -1 &amp;&amp; !sam[p][ch]; p = fail[p]) sam[p][ch] = np; if (p == -1) return fail[np] = 0, void(); int q = sam[p][ch]; if (len[q] == len[p] + 1) return fail[np] = q, void(); int nq = ++tot; fail[nq] = fail[q], fail[np] = fail[q] = nq; memcpy(sam[nq], sam[q], sizeof(sam[nq])); len[nq] = len[p] + 1, siz[nq] = 0; for (; p != -1 &amp;&amp; sam[p][ch] == q; p = fail[p]) sam[p][ch] = nq;&#125;void print_kth(int p, int k) &#123; if (k &lt;= siz[p]) return; k -= siz[p]; for (int i = 0; i &lt; 26; ++i) &#123; if (!sam[p][i]) continue; if (sum[sam[p][i]] &gt;= k) return putchar(i + &#x27;a&#x27;), print_kth(sam[p][i], k); else k -= sum[sam[p][i]]; &#125;&#125;signed main() &#123; static char s[Maxn]; static int cnt[Maxn], id[Maxn]; scanf(&quot;%s&quot;, s); SAM(); int n = strlen(s), t = read(), k = read(); for (int i = 0; i &lt; n; ++i) insert(s[i]); // 基数排序建立 len 从小到大映射关系 for (int i = 0; i &lt;= tot; ++i) ++cnt[len[i]]; for (int i = 0; i &lt;= tot; ++i) cnt[i] += cnt[i - 1]; for (int i = 0; i &lt;= tot; ++i) id[--cnt[len[i]]] = i; // end // 求 siz 和 sum for (int i = tot; i &gt;= 0; --i) siz[fail[id[i]]] += siz[id[i]]; for (int i = 0; i &lt;= tot; ++i) sum[i] = (t == 0 ? (siz[i] = 1) : siz[i]); // 注意这里 siz[0] = sum[0] = 0; for (int i = tot; i &gt;= 0; --i) for (int j = 0; j &lt; 26; ++j) if (sam[id[i]][j]) sum[id[i]] += sum[sam[id[i]][j]]; // end if (sum[0] &lt; k) return print(-1), 0; print_kth(0, k); return 0;&#125; 总结 通过写这道题收获不小，大概掌握了后缀数据结构处理第 kkk 大子串的方法。 主要为 SASASA 找第 kkk 大（本质不同）子串，SASASA 求一个子串的排名，SASASA 二分找第 kkk 大子串。 SAMSAMSAM 求一个串的第 kkk 小子串。 本文作者：CloudySky 写作时间： 2022-03-08 最后更新时间： 2022-03-08 遵循协议： BY-NC-SA","tags":"字符串"},{"title":"2022 冲刺省选每日总结","url":"/Blog/PE-everyday/","text":" 输入密码来证明你不是卷王","tags":"生活"},{"title":"常中游记","url":"/Blog/SCZ-youji/","text":" 输入密码来证明你不是卷王","tags":"生活"},{"title":"SCZ 模拟赛总结","url":"/Blog/solution-SCZ/","text":" 输入密码来证明你不是卷王","tags":"题解 test"},{"title":"LCT 学习笔记","url":"/Blog/Link-Cut-Tree/","text":"Link-Cut-Tree 是一种用来解决动态树问题的数据结构，自由度极高。 所谓动态树，就是指支持动态删边，加边，但保证操作后仍是一棵树。 由于这棵树本身是没有什么很好的方法动态维护的，所以考虑用一些本身支持动态且可以与对应回原树的数据结构来维护。注意是单射，一棵树可能对应多个合法的辅助树，这也是自由度高的一个原因。 于是就诞生了 LCTLCTLCT ，它是一个 SplaySplaySplay 森林。每一颗 SplaySplaySplay 的中序遍历对应原树上的一条链。除此以外，自由度非常的高。每颗 SplaySplaySplay 之间以虚边连接，即所谓的认父不认子，只将 faxfa_xfax​ 指向 yyy 而不将 lsy,rsyls_y , rs_ylsy​,rsy​ 指向 xxx 。这么做是由于会产生链的变化以及辅助树本身的变化，不能彻底与原树上父亲节点断绝联系，但必须保证 SplaySplaySplay 之间互不干扰。 具体实现： 每颗 SplaySplaySplay 需要维护的信息： ch0/1ch_{0/1}ch0/1​ 分别表示左右子节点。 fafafa 表示当前节点的父亲节点。 revrevrev 子树翻转标记。 valvalval 表示当前节点的权值。 sz/sum/max/min⋯sz/sum/max/min\\cdotssz/sum/max/min⋯ 表示当前子树的各类权值。 要实现的操作： 首先是对 SplaySplaySplay 的一些引用和拓展。 isrootisrootisroot 这个操作是由于认父不认子，所以需要对 SplaySplaySplay 根进行的特殊判断。 pushuppushuppushup 正常的 SplaySplaySplay 操作 reversereversereverse 在 SplaySplaySplay 上翻转子树，同时打上翻转标记。 spreadspreadspread 下传操作，类似线段树。 rotaterotaterotate, splaysplaysplay 均为正常的 SplaySplaySplay 操作。 接下来的几个就是新的操作了。 accessaccessaccess 把 xxx 到根的路径全部变成实链。 实现方法： 从 xxx 一直跳 fafafa 跳到原树根，每跳一次将当前节点旋转到当前 SplaySplaySplay 的根。并将上一次的节点接到当前节点的右子节点。并 pushuppushuppushup 信息。 makerootmakerootmakeroot 把当前节点变成原树的根。 实现方法：先在辅助树上把 xxx accessaccessaccess 一下，然后将 xxx splaysplaysplay 到根，最后翻转 xxx 的子树（因为性质中序遍历对应原树链）。 findrootfindrootfindroot 找到当前原树的根节点。 实现方法：同样先将 xxx accessaccessaccess 接 splaysplaysplay ，然后只需要一直跳左子节点即可。 接下来是两点之间的操作。 split(x,y)split(x, y)split(x,y) 把 x,yx, yx,y 之间的链单拎出来变成实链，断开 x→yx\\to yx→y 与其他点之间的实链。 实现方法： 先把 xxx 变成根，然后 accessaccessaccess yyy ，拎出来链，最后 splaysplaysplay xxx 或 yyy 来达到将链上的信息传到某端点。 link(x,y)link(x, y)link(x,y) 把 x,yx, yx,y 在原树上连一条边。仍然是先将 xxx 变成根，然后 findroot(y)findroot(y)findroot(y) 来检查一下之前有没有连边（数据不保证合法的情况下，防止出环），没有的话直接将 fa(x)fa(x)fa(x) 设为 yyy。 cut(x,y)cut(x, y)cut(x,y) 断掉 x,yx, yx,y 在原树上的边。如果没有保证数据合法，就要先将 xxx 变成根，然后 accessaccessaccess yyy 并进行一系列的检查，保证 fa(y) == x &amp;&amp; findroot(y) &amp;&amp; !ls(y) 都符合的情况下，将 xxx 的右儿子和 fayfa_yfay​ 同时断掉。保证合法的话直接 splitsplitsplit ，再断掉即可。 总之，LCTLCTLCT 所做的就是利用极高的灵活性把树特殊化，来达到快速求值的目的，如链之间的操作直接把某端点变成根。 代码实现： 12345678910111213141516171819202122232425262728293031323334353637383940414243444546474849505152535455// LCT 学习笔记 || LCT 具体实现struct node &#123; int rev, fa, ch[2]; #define r(x) Sp[x].rev #define fa(x) Sp[x].fa #define ls(x) Sp[x].ch[0] #define rs(x) Sp[x].ch[1] #define ch(x, y) Sp[x].ch[y]&#125; Sp[Maxn];bool isroot(int x) &#123;return ls(fa(x)) != x &amp;&amp; rs(fa(x)) != x;&#125;void reverse(int x) &#123;swap(ls(x), rs(x)); r(x) ^= 1;&#125;void spread(int x) &#123; if (r(x)) &#123; if (ls(x)) reverse(ls(x)); if (rs(x)) reverse(rs(x)); r(x) = 0; &#125;&#125;void rotate(int x) &#123; int y = fa(x), z = fa(y), c = rs(y) == x, w = ch(x, !c); if (!isroot(y)) ch(z, rs(z) == y) = x; ch(x, !c) = y, ch(y, c) = w; if (w) fa(w) = y; fa(y) = x, fa(x) = z;&#125;void splay(int x) &#123; static int stc[Maxn], top, y, z; top = 0, y = x, stc[++top] = y; while (!isroot(y)) stc[++top] = y = fa(y); while (top) spread(stc[top--]); while (!isroot(x)) &#123; y = fa(x), z = fa(y); if (!isroot(y)) rotate((rs(y) == x) ^ (rs(z) == y) ? x : y); rotate(x); &#125;&#125;void access(int x) &#123;for (int y = 0; x; x = fa(y = x)) splay(x), rs(x) = y;&#125;void makeroot(int x) &#123;access(x), splay(x), reverse(x);&#125;int findroot(int x) &#123; access(x), splay(x); while (ls(x)) spread(ls(x)), x = ls(x); splay(x); return x;&#125;void split(int x, int y) &#123;makeroot(x), access(y), splay(y);&#125;void link(int x, int y) &#123;makeroot(x); if (findroot(y) != x) fa(x) = y;&#125;void cut(int x, int y) &#123; makeroot(x); if (findroot(y) != x || fa(y) != x || ls(y)) return; fa(y) = rs(x) = 0;&#125; 一些小的 TrickTrickTrick || 应用： LCTLCTLCT 不能维护边权，所以对于每条边，要新建一个节点，连在原树上连个点之间，并将这个点的权值赋成原树上的边权。 LCTLCTLCT 可以通过维护第二个权值来单独维护虚子树信息。只需要在 access,link,cutaccess, link, cutaccess,link,cut 等涉及实虚边转化的函数中进行修改即可。 本文作者：CloudySky 写作时间： 2022-02-18 最后更新时间： 2022-02-27 遵循协议： BY-NC-SA","tags":"数据结构"},{"title":"左偏树 学习笔记","url":"/Blog/Leftist-Heap/","text":"注：由于这东西既满足树的性质，又满足堆的性质，所以可能两个概念的名词都会使用。 左偏树，是一种可并堆。可以实现两个堆的 O(logn)O(logn)O(logn) 合并。（本文以大根堆为例） 形态上来讲是一颗二叉树。 性质上定义一个点的 disdisdis 值为当前点距离最近的叶子结点的距离，根据它的名字就可以知道，左儿子的 disdisdis 值应该大于右儿子。同时作为一个堆，他应该满足父节点权值大于子节点的性质。 写法上有点像 FHQFHQFHQ 和并查集的结合体，因为要进行合并操作和路径压缩。（可能我技能加点顺序不太对？） 具体实现： 可并堆要维护的信息： ls,rsls, rsls,rs 分别表示一个点的左儿子和右儿子。 fafafa 表示一个点所在堆的堆顶。 也就是说，一个点的 ls,rsls, rsls,rs 一定是它的直接儿子，而他的 fafafa 不一定是它的父亲。 disdisdis 值含义如上文。 valvalval 表示一个点的权值。 要实现的操作： buildbuildbuild 操作，将一个独立的值建成一个堆，并进行一些初始化操作。 mergemergemerge 合并两个点所在的堆。其实就是 FHQFHQFHQ 合并操作的阉割版。 默认两个堆中较大的根节点为当前新堆的根节点，然后递归合并右子树和另一个堆。检查左右子树 disdisdis 值进行交换来满足左偏性质。 注意将左右子树的 fafafa 值设为新的根节点，以及更新当前根节点的 disdisdis 值。 toptoptop 取出当前点的堆顶节点，同时进行路径压缩 poppoppop 弹出当前点的堆顶节点。 直接将堆顶节点的左右儿子的 fafafa 值设为自身，将左右子树合并，再将之前根节点的左右儿子设为 0。 同时，由于进行过路径压缩操作，所以要将之前的堆顶的 fafafa 值设为合并后的新堆的根节点。这样既满足了从堆中删除了堆顶，也不会使子树节点迷失。 总结：注意更新 fafafa，同时，该更新左右儿子的时候得更新，否则后面可能会引起冲突。 代码实现： 维护的信息 12345678910// 左偏树 学习笔记// 要维护的信息具体实现struct heap &#123; int ls, rs, val, dis, fa; #define ls(x) T[x].ls #define rs(x) T[x].rs #define v(x) T[x].val #define d(x) T[x].dis #define f(x) T[x].fa&#125; T[Maxn]; buildbuildbuild 操作： 12345678// 左偏树 学习笔记// build 操作具体实现int build (int x) &#123; int p = ++tot; v(p) = x, d(p) = 0, f(p) = p; ls(p) = rs(p) = 0; return p;&#125; 有的题要求按照编号进行操作，也可以改成这样： 1234567// 左偏树 学习笔记// build 操作具体实现int build (int x, int p) &#123; v(p) = x, d(p) = 0, f(p) = p; ls(p) = rs(p) = 0; return p;&#125; mergemergemerge 操作： 递归部分代码实现： 12345678910111213// 左偏树 学习笔记// merge 操作递归部分的具体实现int merge (int x, int y) &#123; if (!x || !y) return x | y; if (v(x) &lt; v(y)) swap (x, y); rs(x) = merge (rs(x), y); if (d(ls(x)) &lt; d(rs(x))) swap (ls(x), rs(x)); // 后面的两个更新一定不能忘，不更新 dis 会 TLE，不更新 fa 会 WA d(x) = d(rs(x)) + 1; f(ls(x)) = f(rs(x)) = x; return x;&#125; 非递归部分代码实现： 123456789// 左偏树 学习笔记// merge 操作非递归部分的具体实现int m (int x, int y) &#123; if (!x || !y || v(x) == -1 || v(y) == -1) return x | y; int fx = top(x), fy = top(y); if (fx == fy) return fx; return merge (fx, fy);&#125; toptoptop 操作： 12345// 左偏树 学习笔记// top 操作的具体实现int top (int x) &#123; return x == f(x) ? x : f(x) = top (f(x));&#125; poppoppop 操作： 123456789101112// 左偏树 学习笔记// pop 操作的具体实现int pop (int x) &#123; if (v(x) == -1) return; v(x) = -1; int fx = top (x); f(rs(fx)) = rs(fx); f(ls(fx)) = ls(fx); int root = m (ls(fx), rs(fx)); ls(fx) = rs(fx) = 0; return root;&#125; P1456 Monkey King 代码实现： 1234567891011121314151617181920212223242526272829303132333435363738394041424344454647484950515253545556575859606162636465666768697071727374757677787980// 左偏树 学习笔记// 模板左偏树 || Monkey King// Code By CloudySky#include &lt;bits/stdc++.h&gt;namespace IO // namespace IOusing namespace IO;const int Maxn = 1e5 + 10;using namespace std;struct heap &#123; int ls, rs, val, dis, fa; #define ls(x) T[x].ls #define rs(x) T[x].rs #define v(x) T[x].val #define d(x) T[x].dis #define f(x) T[x].fa&#125; T[Maxn];int tot;int merge (int x, int y) &#123; if (!x || !y) return x | y; if (v(x) &lt; v(y)) swap (x, y); rs(x) = merge (rs(x), y); if (d(ls(x)) &lt; d(rs(x))) swap (ls(x), rs(x)); d(x) = d(rs(x)) + 1; f(ls(x)) = f(rs(x)) = x; return x;&#125;int build (int x) &#123; int p = ++tot; v(p) = x, d(p) = 0, f(p) = p; ls(p) = rs(p) = 0; return p;&#125;int top (int x) &#123; return x == f(x) ? x : f(x) = top (f(x));&#125;int m (int x, int y) &#123; if (!x || !y) return x | y; int fx = top(x), fy = top(y); if (fx == fy) return fx; int root = merge (fx, fy); f(fx) = f(fy) = root; return root;&#125;int pop (int x) &#123; int fx = top (x); f(rs(fx)) = rs(fx); f(ls(fx)) = ls(fx); int root = m (ls(fx), rs(fx)); ls(fx) = rs(fx) = 0; return root;&#125;signed main() &#123; v(0) = -1e9; int n; while (cin &gt;&gt; n) &#123; tot = 0; for (int i = 1; i &lt;= n; ++i) build (read ()); int k = read (); for (int i = 1; i &lt;= k; ++i) &#123; int x = read (), y = read (); if (top (x) == top (y)) print (-1); else &#123; int r1 = top (x), r2 = top(y); v(r1) &gt;&gt;= 1, v(r2) &gt;&gt;= 1; int r3 = pop (r1), r4 = pop (r2); print (v(m ((r3 ? m (r1, r3) : r1), (r4 ? m (r2, r4) : r2)))); &#125; &#125; &#125; return 0;&#125; 本文作者：CloudySky 写作时间： 2022-01-28 最后更新时间： 2022-01-28 遵循协议： BY-NC-SA","tags":"数据结构"},{"title":"生成函数 学习笔记","url":"/Blog/Generating-Function/","text":"简单的瞅了几眼生成函数，口胡了这个学习笔记。 生成函数的概念 生成函数，又称形式幂级数。大概分成三种： 普通形式幂级数 F(x)=∑iaixiF(x) = \\sum_ia_ix^iF(x)=∑i​ai​xi 指数级形式幂级数 F^(x)=∑iaixii!\\hat{F}(x) = \\sum_ia_i\\dfrac{x^i}{i!}F^(x)=∑i​ai​i!xi​ 迪利克雷生成函数。仅仅是听说过，听机房的大佬说不用学。 对于它的概念，理解成用来表示某个序列的函数就行。 关于 xxx 的实际含义：没有实际含义，不然为什么叫形式幂级数呢？ 生成函数的封闭形式 可能会很好奇，指数生成函数哪里和指数有关了？ 生成函数的封闭形式大概就是换了一种更加直观的书写方式。 如常数列 ⟨1,1,1,⋯ ⟩\\langle 1, 1, 1, \\cdots \\rangle⟨1,1,1,⋯⟩ 。它的普通生成函数为 F(x)=1+x+x2+⋯F(x) = 1 + x + x^2 + \\cdotsF(x)=1+x+x2+⋯ 然后把他乘上 xxx 得 xF(x)=x+x2+⋯xF(x) = x + x^2 + \\cdotsxF(x)=x+x2+⋯ 然后相减得 F(x)−xF(x)=1F(x) - xF(x) = 1F(x)−xF(x)=1 。这里可能就有问题，他都取到到无穷了还能这么减？我也不知道为什么，反正他就是能这么减。 指数生成函数的原因就是还是对于刚才那个常数数列，它的指数生成函数的封闭形式为 exe^xex 。 生成函数封闭形式小练习 （题目来自 OI-wiki） 求下面函数的生成函数封闭形式： ⟨0,1,1,1,⋯ ⟩\\langle 0, 1, 1, 1, \\cdots \\rangle⟨0,1,1,1,⋯⟩ 推导过程 挺套路的，生成函数为F(x)=0+x+x2+…上来直接xF(x)=0+x2+x3+⋯发现需要补个x才能取等xF(x)+x=F(x)(1−x)F(x)=xF(x)=x1−x挺套路的，生成函数为 \\\\ F(x) = 0 + x + x^2 + \\dots \\\\ 上来直接 xF(x) = 0 + x^2 + x^3 + \\cdots \\\\ 发现需要补个 x 才能取等 \\\\ xF(x) + x = F(x) \\\\ (1 - x)F(x) = x \\\\ F(x) = \\dfrac{x}{1 - x} 挺套路的，生成函数为F(x)=0+x+x2+…上来直接xF(x)=0+x2+x3+⋯发现需要补个x才能取等xF(x)+x=F(x)(1−x)F(x)=xF(x)=1−xx​ ⟨0,1,0,1,⋯ ⟩\\langle 0, 1, 0, 1, \\cdots \\rangle⟨0,1,0,1,⋯⟩ 推导过程 F(x)=1+x2+x4+⋯x2F(x)=x2+x4+x6+⋯x2F(x)+1=F(x)F(x)=11−x2F(x) = 1 + x^2 + x^4 + \\cdots \\\\ x^2F(x) = x^2 + x^4 + x^6 + \\cdots \\\\ x^2F(x) + 1 = F(x) \\\\ F(x) = \\dfrac{1}{1 - x^2} F(x)=1+x2+x4+⋯x2F(x)=x2+x4+x6+⋯x2F(x)+1=F(x)F(x)=1−x21​ ⟨1,2,3,4,⋯ ⟩\\langle 1, 2, 3, 4, \\cdots \\rangle⟨1,2,3,4,⋯⟩ 推导过程 可能是靠数感吧F(x)=1+2x+3x2+⋯xF(x)=x+2x2+3x3+⋯发现系数缺点东西。随便试试1xF(x)=1x+2+3x+4x2+5x3+⋯(x+1x)F(x)=1x+2+2⋅2x+2⋅3x2+⋯再稍微整理一下F(x)=1(x−1)2可能是靠数感吧 F(x) = 1 + 2x + 3x^2 + \\cdots \\\\ xF(x) = x + 2x^2 + 3x^3 + \\cdots \\\\ 发现系数缺点东西。随便试试 \\\\ \\dfrac{1}{x}F(x) = \\dfrac{1}{x} + 2 + 3x + 4x^2 + 5x^3 + \\cdots \\\\ (x + \\dfrac{1}{x})F(x) = \\dfrac{1}{x} + 2 + 2\\cdot2x + 2\\cdot3x^2 + \\cdots \\\\ 再稍微整理一下 F(x) = \\dfrac{1}{(x - 1)^2} 可能是靠数感吧F(x)=1+2x+3x2+⋯xF(x)=x+2x2+3x3+⋯发现系数缺点东西。随便试试x1​F(x)=x1​+2+3x+4x2+5x3+⋯(x+x1​)F(x)=x1​+2+2⋅2x+2⋅3x2+⋯再稍微整理一下F(x)=(x−1)21​ 就推出来了这几个剩下的太菜了推不出来 qwq 小学数学没过关。 广义二项式定理 广义组合数： (rk)=rk‾k!(r∈C,k∈N){r\\choose k} = \\frac{r^{\\underline{k}}}{k!} (r\\in \\mathbf{C},k\\in \\mathbf{N}) (kr​)=k!rk​​(r∈C,k∈N) 广义二项式定理： (1+x)α=∑n(αn)xn(1 + x)^{\\alpha} = \\sum_n{\\alpha\\choose n}x^n (1+x)α=n∑​(nα​)xn 本文作者：CloudySky 写作时间： 2022-01-26 最后更新时间： 2022-01-26 遵循协议： BY-NC-SA","tags":"数学"},{"title":"2022寒假集训做题总结","url":"/Blog/solution-2022WinterTrain/","text":" 输入密码来证明你不是卷王","tags":"题解 test"},{"title":"容斥原理 学习笔记","url":"/Blog/IEP/","text":"容斥原理是组合数学中一种非常重要的思想。 容斥通式： 设全集为 UUU 共包含 nnn 种不同的属性，第 iii 种属性为 PiP_iPi​ ，拥有 PiP_iPi​ 的元素组成的集合为 SiS_iSi​ 。 集合的并集： ∣⋃i=1nSi∣=∑m=1n(−1)m−1∑ai&lt;ai+1∣⋂i=1mSai∣|\\bigcup_{i = 1}^nS_i| = \\sum_{m = 1}^n (-1)^{m - 1}\\sum_{a_i &lt; a_{i + 1}}|\\bigcap_{i = 1}^mS_{a_i}| ∣i=1⋃n​Si​∣=m=1∑n​(−1)m−1ai​&lt;ai+1​∑​∣i=1⋂m​Sai​​∣ 集合的交集： ∣⋂i=1nSi∣=∣U∣−∣⋃i=1nSi‾∣=∣U∣−∑m=1n(−1)m−1∑ai&lt;ai+1∣⋂i=1nSai‾∣|\\bigcap_{i = 1}^nS_i| = |U| - |\\bigcup_{i = 1}^n \\overline{S_i}| \\\\ = |U| - \\sum_{m = 1}^n(-1)^{m - 1}\\sum_{a_i &lt; a_{i + 1}}|\\bigcap_{i = 1}^n \\overline{S_{a_{i}}}| ∣i=1⋂n​Si​∣=∣U∣−∣i=1⋃n​Si​​∣=∣U∣−m=1∑n​(−1)m−1ai​&lt;ai+1​∑​∣i=1⋂n​Sai​​​∣ 其中 Si‾\\overline{S_i}Si​​ 表示 SiS_iSi​ 的补集。 容斥的性质 简单来说，容斥一共有几个要素 物品 q(S)q(S)q(S) 表示至少满足属性集合 SSS 的物品个数。 贡献函数 g(k)g(k)g(k) 表示对于一个有 kkk 个属性的物品，对答案的贡献。 容斥系数 f(x)f(x)f(x) 表示大小为 xxx 的集合对答案的贡献。 一般来讲，一个有 nnn 个属性的物品对答案的贡献为： g(n)=∑i=1n(ni)f(i)g(n) = \\sum_{i = 1}^n \\binom{n}{i}f(i) g(n)=i=1∑n​(in​)f(i) 大多数情况下，g(n)=1g(n) = 1g(n)=1 ，即一个物品对答案的贡献一般为 1 。这个时候容斥系数 f(i)=(−1)i+1f(i) = (-1)^{i + 1}f(i)=(−1)i+1 。 总的答案为 Ans=∑S⊆U=q(S)f(∣S∣)Ans = \\sum_{S\\subseteq U} = q(S)f(|S|) Ans=S⊆U∑​=q(S)f(∣S∣) 求容斥系数 已知g(n)=∑i=0n(ni)f(i),g(n) = \\sum_{i = 0}^n \\dbinom{n}{i} f(i),g(n)=∑i=0n​(in​)f(i),求 f(x)f(x)f(x) 。 首先可以递推求，假设已知 f(1)f(1)f(1) 到 f(n)f(n)f(n) ，求 f(n+1)f(n + 1)f(n+1) 。整个过程下来时间复杂度 O(n2)O(n^2)O(n2) 。 g(n+1=)=∑i=0n+1(n+1i)f(i)f(n+1)=g(n+1)−∑i=0n(n+1i)f(i)g(n + 1=) = \\sum_{i = 0}^{n + 1}{n + 1\\choose i} f(i) \\\\ f(n + 1) = g(n + 1) - \\sum_{i = 0}^n {n + 1\\choose i} f(i) g(n+1=)=i=0∑n+1​(in+1​)f(i)f(n+1)=g(n+1)−i=0∑n​(in+1​)f(i) 也可以用多项式去求，时间复杂度 O(nlogn)O(nlogn)O(nlogn) 。 g(n)=∑i=0nn!(n−i)!f(i)i!=n!∑i=0n1(n−i)!f(i)i!g(n)n!=∑i=0n1(n−i)!f(i)i!g(n) = \\sum_{i = 0}^n \\frac{n!}{(n-i)!}\\frac{f(i)}{i!} = n!\\sum_{i = 0}^n\\frac{1}{(n - i)!}\\frac{f(i)}{i!} \\\\ \\frac{g(n)}{n!} = \\sum_{i = 0}^n\\frac{1}{(n - i)!}\\frac{f(i)}{i!} g(n)=i=0∑n​(n−i)!n!​i!f(i)​=n!i=0∑n​(n−i)!1​i!f(i)​n!g(n)​=i=0∑n​(n−i)!1​i!f(i)​ 接下来生成函数， g(n)n!\\frac{g(n)}{n!}n!g(n)​ 的生成函数 G(x)=∑i=0∞xig(i)i!,G(x) = \\sum_{i = 0}^{\\infty}x^i\\frac{g(i)}{i!},G(x)=∑i=0∞​xii!g(i)​, 1(n−i)!\\frac{1}{(n - i)!}(n−i)!1​ 即 1i!\\frac{1}{i!}i!1​ （因为 ∑i=1n1(n−i)!\\sum_{i = 1}^n \\dfrac{1}{(n - i)!}∑i=1n​(n−i)!1​ 所以可以直接替换）的生成函数H(x)=∑i=0∞xi1i!=exH(x) = \\sum_{i = 0}^{\\infty} x^i\\frac{1}{i!} = e^xH(x)=∑i=0∞​xii!1​=ex, f(i)i!\\frac{f(i)}{i!}i!f(i)​ 的生成函数 F(x)=∑i=0∞xif(i)i!F(x) = \\sum_{i = 0}^{\\infty}x^i\\frac{f(i)}{i!}F(x)=∑i=0∞​xii!f(i)​ 。 则 G(x)=H(x)F(x)G(x) = H(x)F(x)G(x)=H(x)F(x) 。 所以 F(x)=e−xG(x)F(x) = e^{-x}G(x)F(x)=e−xG(x) 。套个多项式求逆就行。 容斥原理常见问题模型 不定方程非负整数解计数 简单版：给定 kkk 个未知数 x1,x2,⋯ ,xkx_1, x_2, \\cdots, x_kx1​,x2​,⋯,xk​ 和一个方程 x1+x2+⋯+xk=rx_1 + x_2 + \\cdots + x_k = rx1​+x2​+⋯+xk​=r ，求方程非负整数解的个数。 对于这个问题可以直接转换成向 kkk 个盒子里放 rrr 个球，可空的方案数。然后在每个盒子里先补上一个球，变成 kkk 个盒子里放 r+kr + kr+k 个球，不可空的方案数。 然后插板法，在 r+k−1r + k - 1r+k−1 个球之间的空隙里插入 k−1k - 1k−1 个板。总的答案 (r+k−1k−1)\\dbinom{r + k - 1}{k - 1}(k−1r+k−1​) 。 升级版：给定 kkk 个未知数 x1,x2,⋯ ,xkx_1, x_2, \\cdots, x_kx1​,x2​,⋯,xk​ ，kkk 个约束条件分别为 xk≤nkx_k \\le n_kxk​≤nk​ 和一个方程 x1+x2+⋯+xk=rx_1 + x_2 + \\cdots + x_k = rx1​+x2​+⋯+xk​=r ，求方程非负整数解的个数。 这是一个求交集的问题，容斥是用来求并集的，所以可以转化为先求所有不满足条件的情况，再用上面算出来的总情况做差。 对于每个未知数 xix_ixi​ ，保证 xix_ixi​ 不满足要求的办法就是用 xi′=xi+ni+1x_i&#x27; = x_i + n_i + 1xi′​=xi​+ni​+1 替换 xix_ixi​ 。所以对于任意一个集合 SSS 表示集合中的元素全部不符合条件，则 q(S)=(r+k−1−∑i∈s(ni+1)k−1)q(S) = \\dbinom{r + k - 1 - \\sum_{i \\in s}(n_i + 1)}{k - 1} q(S)=(k−1r+k−1−∑i∈s​(ni​+1)​) 容斥系数 f(∣S∣)f(|S|)f(∣S∣) 很简单，就是 (−1)∣S∣(-1)^{|S|}(−1)∣S∣ 。 所以答案为 ans=∑S⊆Uf(∣S∣)q(S)=∑s⊆U(−1)∣S∣(r+k−1−∑i∈s(ni+1)k−1)ans = \\sum_{S \\subseteq U}f(|S|)q(S) = \\sum_{s \\subseteq U}(-1)^{|S|}{r + k - 1 - \\sum_{i \\in s}(n_i + 1) \\choose k - 1} ans=S⊆U∑​f(∣S∣)q(S)=s⊆U∑​(−1)∣S∣(k−1r+k−1−∑i∈s​(ni​+1)​) 注意这里虽然没有用全集相减，但由于 ∅⊆U\\varnothing \\subseteq U∅⊆U 即所有数都至少有零个不合法也算在内，所以计算出来的答案是正确的。 错排计数 求一个长度为 nnn 的排列中，满足 ai≠ia_i \\ne iai​=i 的方案数 可以通过枚举哪些位置冲突，即 ai=ia_i = iai​=i 来进行容斥。对于每个大小为 ∣S∣|S|∣S∣ 集合 SiS_iSi​ 表示至少有 ∣S∣|S|∣S∣ 个位置满足 ai=ia_i = iai​=i ，即 ∀i∈S, ai=i\\forall i \\in S,\\ a_i = i∀i∈S, ai​=i。对于每个集合 SiS_iSi​ 可以发现统计答案时只关心它的大小，而不关心它的具体情况，所以可以设 i=∣S∣i = |S|i=∣S∣ ，将所有满足这个条件的集合合并。满足 SSS 的方案数共有 q(S)=(n∣S∣)q(S) = \\dbinom{n}{|S|}q(S)=(∣S∣n​) 个，这些位置选定后剩下位置的方案数为 (n−∣S∣)!(n - |S|)!(n−∣S∣)! ，容斥系数为 (−1)∣S∣(-1)^{|S|}(−1)∣S∣ ,答案则为 F(n)=∑S⊆U(−1)∣S∣(n−∣S∣)!=∑i=0n(−1)i(n−i)!(ni)=(−1)n+n⋅F(n−1)F(n) = \\sum_{S \\subseteq U}(-1)^{|S|}(n - |S|) ! \\\\ = \\sum_{i = 0}^n (-1)^i(n - i)! \\dbinom{n}{i} = (-1)^n + n\\cdot F(n - 1) F(n)=S⊆U∑​(−1)∣S∣(n−∣S∣)!=i=0∑n​(−1)i(n−i)!(in​)=(−1)n+n⋅F(n−1) 求一个长度为 nnn 的排列中，满足恰好 mmm 个 ai≠ia_i \\ne iai​=i 的方案数 F(n,m)=∑i=0m(−1)i(n−i)!(mi)F(n, m) = \\sum_{i = 0}^m (-1)^i(n - i)!\\dbinom{m}{i} \\\\ F(n,m)=i=0∑m​(−1)i(n−i)!(im​) 1To Be Continued 本文作者：CloudySky 写作时间： 2022-01-21 最后更新时间： 2022-01-21 遵循协议： BY-NC-SA","tags":"数学"},{"title":"排列组合 学习笔记","url":"/Blog/PC/","text":"组合数学是 OI 数学中的一个重要分支。在 OI 中有很多用途。具体包含排列，组合，以及衍生出来的特殊排列组合，和一些特殊的依托于组合数数列，如：卡特兰数，斯特林数等以及一些计数问题。 警告⚠：这篇博客里包含了大量的概念性用语，请注意梳理大脑信息。这里的证明有一些不是很严谨的地方和感性理解（换句话说，写了证明两个字并不一定真的在证明）。 加法原理与乘法原理 比较容易理解，完成一件事，有 nnn 类方法互不干扰，每类有 aia_iai​ 种，方案数即为 ∑ai\\sum a_i∑ai​ ；有 nnn 个步骤互不干扰，每个步骤有 aia_iai​ 种，方案数为 ∏ai\\prod a_i∏ai​ 。 排列组合公式 组合 CnmC^m_nCnm​ 代表从 n 个数中选出 m 个元素组成集合。 Cnm(也可以写作(nm))=n!(n−m)!m!C_n^m(\\text{也可以写作}\\dbinom{n}{m})=\\dfrac{n!}{(n-m)!m!} Cnm​(也可以写作(mn​))=(n−m)!m!n!​ 组合数的性质（二项式推论）以及证明和应用 有些东西可能和后面有交叉。 (nm)=(nn−m)(1)\\dbinom{n}{m} = \\dbinom{n}{n - m} \\tag{1} (mn​)=(n−mn​)(1) (1) 又称对称恒等式，感性理解即可，从 nnn 个里面选 mmm 个组成集合，那么剩下 n−mn - mn−m 个自然构成另一个集合。 (nk)=nk(n−1k−1)(2)\\dbinom{n}{k} = \\dfrac{n}{k}\\dbinom{n - 1}{k - 1} \\tag{2} (kn​)=kn​(k−1n−1​)(2) (2) 由定义式直接推导出即可。 (nm)=(n−1m)+(n−1m−1)(3)\\dbinom{n}{m} = \\dbinom{n - 1}{m} + \\dbinom{n - 1}{m - 1} \\tag{3} (mn​)=(mn−1​)+(m−1n−1​)(3) (3) 增量法。从 nnn 个数里选 mmm 个，可以分成两种方法， 选第 mmm 个，在剩下的 n−1n - 1n−1 个数中选 m−1m - 1m−1 个。 不选第 mmm 个，在剩下的 n−1n - 1n−1 个数中选 mmm 个。 组合数的递推式，可以 O(n2)O(n^2)O(n2) 求组合数。 ∑i=0k(ni)(mk−i)=(m+nk)(n,m≥k)(4)\\sum_{i = 0}^k \\dbinom{n}{i}\\dbinom{m}{k - i} = \\dbinom{m + n}{k} (n, m \\ge k)\\tag{4} i=0∑k​(in​)(k−im​)=(km+n​)(n,m≥k)(4) (4) 范德蒙公式。可以感性理解，从 n+mn + mn+m 个方案中选 mmm 个，可以分成两组，大小分别为 nnn 和 mmm ，从两组里共选 mmm 个。可以分别从两组里选 xxx 个和 yyy 个，使得 x+y=mx + y = mx+y=m 。 可以用来合并组合数，降低复杂度。也可以反向使用，方便数据结构维护。 拓展式： ∑i=0m(ni)(mi)=∑(ni)(mm−i)=(n+mm)\\sum_{i = 0}^m \\dbinom{n}{i} \\dbinom{m}{i} = \\sum\\dbinom{n}{i}\\dbinom{m}{m - i} = \\dbinom{n + m}{m} i=0∑m​(in​)(im​)=∑(in​)(m−im​)=(mn+m​) (nr)(rk)=(nk)(n−kr−k)(5)\\dbinom{n}{r}\\dbinom{r}{k} = \\dbinom{n}{k}\\dbinom{n - k}{r - k} \\tag{5} (rn​)(kr​)=(kn​)(r−kn−k​)(5) (5) **重要！**根据定义求，暴力推阶乘即可。 (nr)(rk)=n!(n−r)!⋅(r−k)!⋅k!=n!k!⋅(n−k)!(n−k)!(n−r)!(r−k)!=(nk)(n−kr−k)\\dbinom{n}{r}\\dbinom{r}{k} = \\dfrac{n!}{(n - r)!\\cdot (r - k)! \\cdot k!} \\\\ = \\dfrac{n!}{k!\\cdot (n - k)!} \\dfrac{(n - k)!}{(n - r)! (r - k)!} = \\dbinom{n}{k} \\dbinom{n - k}{r - k} (rn​)(kr​)=(n−r)!⋅(r−k)!⋅k!n!​=k!⋅(n−k)!n!​(n−r)!(r−k)!(n−k)!​=(kn​)(r−kn−k​) 经典的应用：交换求和顺序，化简来降低复杂度： ∑k=0∑i=0f(i)⋅(nk)(ki)=∑if(i)(ni)∑k(n−ik−i)=∑if(i)(ni)⋅2n−i\\sum_{k = 0}\\sum_{i = 0} f(i)\\cdot \\dbinom{n}{k} \\dbinom{k}{i} = \\sum_{i} f(i) \\dbinom{n}{i} \\sum_{k} \\dbinom{n - i}{k - i} = \\sum_{i} f(i) \\dbinom{n}{i} \\cdot 2^{n - i} k=0∑​i=0∑​f(i)⋅(kn​)(ik​)=i∑​f(i)(in​)k∑​(k−in−i​)=i∑​f(i)(in​)⋅2n−i ∑i=0n(lk)=(n+1k+1)(6)\\sum_{i = 0}^n \\dbinom{l}{k} = \\dbinom{n + 1}{k + 1} \\tag{6} i=0∑n​(kl​)=(k+1n+1​)(6) (6) **重要！**可以通过组合意义证明。实质上是 (3) 的变形。首先 ∑i=0k−1\\sum_{i = 0}^{k - 1}∑i=0k−1​ 是无效的。 考虑从 n+1n + 1n+1 个数选择 k+1k + 1k+1 个，相当于枚举第一个被选择的数是第几个。 ∑i=0k(ni)=2⋅∑i=0k(n−1i)−(nk)(7)\\sum_{i = 0}^k \\dbinom{n}{i} = 2\\cdot \\sum_{i = 0}^k \\dbinom{n - 1}{i} - \\dbinom{n}{k} \\tag{7} i=0∑k​(in​)=2⋅i=0∑k​(in−1​)−(kn​)(7) (7) 同样是一个非常重要的公式，可以根据 (3) 推导出来 ∑i=0n(−1)i(ni)=0 (n≠0)(8)\\sum_{i = 0}^n(-1)^i\\dbinom{n}{i} = 0\\ (n \\ne 0)\\tag{8} i=0∑n​(−1)i(in​)=0 (n=0)(8) (8) 反演公式。二项式定理的特殊形式，令 a=1,b=−1a = 1, b = -1a=1,b=−1 套公式即可。 ∑i=1n(ni)=2n(9)\\sum_{i = 1}^n \\dbinom{n}{i} = 2^n \\tag{9} i=1∑n​(in​)=2n(9) (9) 同样可以用二项式定理来证： 2n=(1+1)n=∑(ni)2^n = (1 + 1) ^ n = \\sum \\dbinom{n}{i}2n=(1+1)n=∑(in​) ∑i=0ni(ni)=n⋅2n−1(10)\\sum_{i = 0}^n i \\dbinom{n}{i} = n\\cdot 2^{n - 1} \\tag{10} i=0∑n​i(in​)=n⋅2n−1(10) (10) 对 (9) 求导可得。 警告⚠：以下过程为大佬讲解但一懂半懂的内容，可能会有错误： 对(ni)求生成函数得∑(ni)⋅xi则i⋅(ni)生成函数的积分为x∑(ni)⋅xi后面的部分化简一下为x(1+x)n对上面的东西求导，则为n⋅x⋅(1+x)n−1求和就相当于代入x=1则为n⋅2n−1对 \\dbinom{n}{i} 求生成函数得 \\sum\\dbinom{n}{i}\\cdot x^i \\\\ 则 i\\cdot\\dbinom{n}{i} 生成函数的积分为 x\\sum\\dbinom{n}{i}\\cdot x^i \\\\ 后面的部分化简一下为 x(1 + x)^n \\\\ 对上面的东西求导，则为 n\\cdot x \\cdot (1 + x)^{n - 1} \\\\ 求和就相当于代入 x = 1 则为 n\\cdot2^{n - 1} 对(in​)求生成函数得∑(in​)⋅xi则i⋅(in​)生成函数的积分为x∑(in​)⋅xi后面的部分化简一下为x(1+x)n对上面的东西求导，则为n⋅x⋅(1+x)n−1求和就相当于代入x=1则为n⋅2n−1 或者： ∑i=0ni⋅(ni)=i⋅n!i!⋅(n−i)!=n⋅(n−1)!(i−1)!⋅(n−i)!=∑i=0nn⋅(n−1i−1)=n⋅2n−1\\sum_{i = 0}^ni \\cdot \\dbinom{n}{i} = \\dfrac{i\\cdot n!}{i!\\cdot (n - i)!} = \\dfrac{n\\cdot (n - 1)!}{(i - 1)! \\cdot (n - i)!} = \\sum_{i = 0}^n n \\cdot \\dbinom{n - 1}{i - 1} = n\\cdot 2^{n - 1} i=0∑n​i⋅(in​)=i!⋅(n−i)!i⋅n!​=(i−1)!⋅(n−i)!n⋅(n−1)!​=i=0∑n​n⋅(i−1n−1​)=n⋅2n−1 ∑i=0ni2⋅(ni)=n⋅(n+1)⋅2n−2(11)\\sum_{i = 0}^n i^2\\cdot \\dbinom{n}{i} = n\\cdot (n + 1)\\cdot2^{n - 2} \\tag{11} i=0∑n​i2⋅(in​)=n⋅(n+1)⋅2n−2(11) (11) 在 (10) 的基础上再求一个导。 ∑i=0n(n−ii)=Fn+1(12)\\sum_{i = 0}^n \\dbinom{n - i}{i} = F_{n + 1} \\tag{12} i=0∑n​(in−i​)=Fn+1​(12) (12) 组合数和斐波那契数列的联系，证明不会。 不相邻组合 从 nnn 个数里面选 kkk 个，任意两个数不相邻的方案数 (n−k+1k)\\dbinom{n - k + 1}{k}(kn−k+1​) 。 证明： 设 d1,d2,⋯ ,dkd_1, d_2, \\cdots, d_kd1​,d2​,⋯,dk​ 是一组不相邻组合，令 d1&lt;d2&lt;⋯&lt;dk,c1=d1,c2=d2−1,⋯ ,ck=dk−k+1d_1 &lt; d_2 &lt;\\cdots &lt; d_k, c_1 = d_1, c_2 = d_2 - 1, \\cdots, c_k = d_k - k + 1d1​&lt;d2​&lt;⋯&lt;dk​,c1​=d1​,c2​=d2​−1,⋯,ck​=dk​−k+1 ，易知 c1&lt;c2&lt;⋯&lt;ck&lt;n−k+1c_1 &lt; c_2 &lt; \\cdots &lt; c_k &lt; n - k + 1c1​&lt;c2​&lt;⋯&lt;ck​&lt;n−k+1 。反之亦然。则 ddd 与 ccc 构成充要条件。所以选择 ddd 的方案数和选择 ccc 的方案数等价。 多重集的组合数 设广义集合 S=n1⋅ai,n2⋅a2,⋯ ,nk⋅akS = {n_1\\cdot a_i, n_2\\cdot a_2, \\cdots, n_k\\cdot a_k}S=n1​⋅ai​,n2​⋅a2​,⋯,nk​⋅ak​ 由 n1n_1n1​ 个 a1a_1a1​ ，n2n_2n2​ 个 a2a_2a2​ ，⋯\\cdots⋯ ， nkn_knk​ 个 aka_kak​ 构成。则从 SSS 里选 rrr 个数的方案数常表示为: ∑r1+r2+⋯+rk=r(nr1,r2,⋯ ,rk)\\sum_{r_1 + r_2 + \\cdots + r_k = r}\\dbinom{n}{r_1, r_2, \\cdots, r_k} r1​+r2​+⋯+rk​=r∑​(r1​,r2​,⋯,rk​n​) 具体情况有两种： r≤min⁡i=1knir \\le \\min_{i = 1}^k n_ir≤mini=1k​ni​ ，方案数为 (r+k−1k−1)\\dbinom{r + k - 1}{k - 1}(k−1r+k−1​) 。 证明用隔板法即可。考虑这个东西可以理解成 kkk 个盒子放 rrr 个球，可空。令 n1′=n1+1,n2′=n2+1,⋯ ,nk′=nk=1n_1&#x27; = n_1 + 1, n_2&#x27; = n_2 + 1, \\cdots, n_k&#x27; = n_k = 1n1′​=n1​+1,n2′​=n2​+1,⋯,nk′​=nk​=1 ，方程就变成了 x1′+x2′+⋯+xk′=r+kx_1&#x27; + x_2&#x27; + \\cdots + x_k&#x27; = r + kx1′​+x2′​+⋯+xk′​=r+k ，相当于在 kkk 个盒子放 r+kr + kr+k 个球，不可空，这样就可以隔板了。方案数为在 r+k−1r + k - 1r+k−1 个空隙中插入 k−1k - 1k−1 个板的方案数，即为 (r+k−1k−1)\\dbinom{r + k - 1}{k - 1}(k−1r+k−1​) 。 r&gt;min⁡i=1knir &gt; \\min_{i = 1}^k n_ir&gt;mini=1k​ni​ ，要用到容斥。可以转换成不定方程非负整数解计数问题。因为这是一个求交集的问题，所以可以转化成求补集的并集。 Ans=∑S⊆Uk(−1)∣S∣(k+r−1−∑i∈S(ni+1)k−1)Ans =\\sum_{S \\subseteq U}^k(-1)^{|S|}\\dbinom{k + r - 1 -\\sum_{i\\in S} (n_i + 1)}{k - 1} Ans=S⊆U∑k​(−1)∣S∣(k−1k+r−1−∑i∈S​(ni​+1)​) 排列 PnmP^m_nPnm​ 代表从 n 个数中选出 m 个元素组成排列（排列是有序的）。 Pnm=n!(n−m)!P^m_n=\\dfrac{n!}{(n-m)!} Pnm​=(n−m)!n!​ 圆排列 圆排列就是增加了循环同构的性质，即 1 2 3 和 2 3 1 是一样的。结论 Pnm′=PnmmP_n^{m&#x27;}=\\dfrac{P_n^m}{m}Pnm′​=mPnm​​ ,即 pnm=n!(n−m)!mp_n^m=\\dfrac{n!}{(n-m)!m}pnm​=(n−m)!mn!​ 全错位排列 满足 ∀i∈[1,n],pi≠i\\forall i \\in [1,n], p_i \\ne i∀i∈[1,n],pi​=i 的排列叫做全错位排列。 Pn={0n=11n=2(n−1)(Pn−1+Pn−2)n≥3P_n=\\begin{cases} 0&amp;n=1\\\\ 1&amp;n=2\\\\ (n-1)(P_{n-1}+P_{n-2})&amp;n\\ge 3\\end{cases} Pn​=⎩⎨⎧​01(n−1)(Pn−1​+Pn−2​)​n=1n=2n≥3​ 证明：增量法。 设已经排好了 n−1n - 1n−1 个数，现在要加入第 nnn 个数，能对当前排列数造成贡献的有两类情况。 前面全错位，这个时候和前面任意一项交换即可。共有 n−1n - 1n−1 种转移方法。 前面有一项 xxx 没有错位，这个时候相当于有 n−2n - 2n−2 项满足条件，第 nnn 项必须和 xxx 交换。xxx 一共有 n−1n - 1n−1 种情况，每种情况只有 1 种转移方法。 综上所述 Pn=(n−1)(Pn−1+Pn−2)P_n = (n - 1)(P_{n - 1} + P_{n - 2})Pn​=(n−1)(Pn−1​+Pn−2​) 错位排列 P(n,m)=(n−m)P(n−1,m)+mP(n−1,m−1)P(n , m) = (n - m)P(n - 1, m) + mP(n - 1, m - 1) P(n,m)=(n−m)P(n−1,m)+mP(n−1,m−1) 证明和上面类似 多重集的排列数 设广义集合 S=n1⋅ai,n2⋅a2,⋯ ,nk⋅akS = {n_1\\cdot a_i, n_2\\cdot a_2, \\cdots, n_k\\cdot a_k}S=n1​⋅ai​,n2​⋅a2​,⋯,nk​⋅ak​ 由 n1n_1n1​ 个 a1a_1a1​ ，n2n_2n2​ 个 a2a_2a2​ ，⋯\\cdots⋯ ， nkn_knk​ 个 aka_kak​ 构成。则它的排列数为： n!∏i=1kni!\\dfrac{n!}{\\prod_{i = 1}^k n_i !} ∏i=1k​ni​!n!​ 类似容斥？把重复的地方扣掉了。 二项式定理 (a+b)=∑k=0nCnkakbn−k(a + b) = \\sum ^n_{k=0}C_n^k a^k b^{n-k} (a+b)=k=0∑n​Cnk​akbn−k 证明： 考虑数学归纳法： 当 n=1n = 1n=1 时，(a+b)1=Cn0a0b1+Cn1a1b0=a+b(a + b)^1 = C_n^0 a^0 b^1 + C_n^1 a^1 b^ 0 = a + b(a+b)1=Cn0​a0b1+Cn1​a1b0=a+b 是显然成立的。 假设当 n=kn = kn=k 时成立，那么当 n=k+1n = k + 1n=k+1 时： (a+b)(a+b)k=(a+b)∑i=0k(ki)aibk−i=∑i=0k(ki)ai+1bk−i+∑i=0k(ki)aibk−i+1=∑i=1k+1(ki−1)aibk−i+1+∑i=0k(ki)aibk−i+1=∑i=0k+1(k+1i)aibk+1−i(a + b)(a + b)^k = (a + b)\\sum_{i = 0} ^ k \\dbinom{k}{i} a^i b^{k - i} \\\\ = \\sum_{i = 0}^k \\dbinom{k}{i} a^{i + 1} b^{k - i} + \\sum_{i = 0} ^ k \\dbinom{k}{i} a^i b^{k - i + 1} \\\\ = \\sum_{i = 1}^{k + 1}\\dbinom{k}{i - 1} a^i b^{k - i + 1} + \\sum_{i = 0} ^ k \\dbinom{k}{i} a^i b^{k - i + 1} \\\\ = \\sum_{i = 0}^{k + 1}\\dbinom{k + 1}{i} a^i b^{k + 1 - i} (a+b)(a+b)k=(a+b)i=0∑k​(ik​)aibk−i=i=0∑k​(ik​)ai+1bk−i+i=0∑k​(ik​)aibk−i+1=i=1∑k+1​(i−1k​)aibk−i+1+i=0∑k​(ik​)aibk−i+1=i=0∑k+1​(ik+1​)aibk+1−i 证毕。 多项式形式： (x1+x2+⋯+xk)n=∑n1+n2+⋯+nk=n(nn1,n2,⋯ ,nk)x1n1x2n2⋯xknk(x_1 + x_2 + \\cdots + x_k)^n = \\sum_{n_1 + n_2 + \\cdots + n_k = n}\\dbinom{n}{n_1, n_2, \\cdots, n_k} x_1^{n_1} x_2^{n_2}\\cdots x_k^{n_k} (x1​+x2​+⋯+xk​)n=n1​+n2​+⋯+nk​=n∑​(n1​,n2​,⋯,nk​n​)x1n1​​x2n2​​⋯xknk​​ Lucas 定理 Cnm mod p=Cn/pm/p×Cn mod pm mod p mod pC_n^m \\bmod p=C_{n/p}^{m/p}\\times C_{n\\ \\bmod p}^{m\\ \\bmod p} \\bmod p Cnm​modp=Cn/pm/p​×Cn modpm modp​modp 一般用来化简项数过高的组合数。 线性求组合数 求组合数可以用 (3) 来进行 n2n^2n2 递推，但是复杂度不够优秀，所以需要线性求阶乘以及阶乘逆元用定义式来求组合数。 代码实现： 1234567891011121314151617181920long long jc[Maxn], jc_inv[Maxn], inv[Maxn], P;void init (long long n) &#123; jc[0] = jc[1] = 1, jc_inv[0] = jc_inv[1] = 1, inv[1] = 1; for (long long i = 2; i &lt;= n; ++i) &#123; jc[i] = jc[i - 1] * i % P; inv[i] = (P - P / i) * inv[P % i] % P; jc_inv[i] = jc_inv[i - 1] * inv[i] % P; &#125;&#125;long long C (long long n, long long m) &#123; if (n &lt; m) return 0; return jc[n] * jc_inv[m] % P * jc_inv[n - m] % P;&#125;long long Lucas (long long n, long long m) &#123; if (m == 0) return 1; return C(n % P, m % P) * Lucas (n / P, m / P) % P;&#125; 本文作者：CloudySky 写作时间： 2022-01-20 最后更新时间： 2022-01-20 遵循协议： BY-NC-SA","tags":"数学"},{"title":"树分治 学习笔记","url":"/Blog/TDC/","text":"点分治 点分治是用来解决树上路径问题的一种思想。 和序列上的分治思想类似，只不过是向下递归时把序列的中点换成了子树的重心。一般要搭配双指针或者树状数组。 考虑这样的问题 求树上是否存在距离恰好为 kkk 的路径。 求树上距离小于等于 kkk 的路径有几条。 这个时候就可以用点分治解决问题。 具体实现： 考虑选定一个点 xxx，那么树上的所有路径就可以分成两类： 经过 xxx，即两个端点分别位于 xxx 的两个子树上。 不经过 xxx，即两个端点在 xxx 的同一个子树上。 对于第二类点，直接递归处理就好，对于第一类点，分别求出 xxx 子树上所有点距离 xxx 的 disdisdis 值，那么任意两个点 y,zy, zy,z 之间的路径长一定为 len=disy+diszlen = dis_y + dis_zlen=disy​+disz​ 。那么就可以边求距离边将所有的距离放入一个数组里，排一遍序，双指针扫一下即可。或者开一个桶树状数组维护一下。 但这样会出现重复，有两种解决方案： 对树进行染色，不同的子树染上不同的颜色。 这种方法对于只找特殊点的 1 类问题比较适用，常数较小。 进行容斥，对于每个点先计算答案，再分别计算只有一棵子树上的点时的答案，将同子树贡献剪掉。 这种方法可以较好地处理范围性 2 类问题，缺点就是常数很大。 还要注意每次递归子树时，都要再找一遍重心，而不是直接选择与当前节点相连的点。 代码实现（1 类问题）： 123456789101112131415161718192021222324252627282930// 点分治 学习笔记int rt, siz[Maxn], mx[Maxn], vis[Maxn];vector &lt;pair&lt;int, int&gt; &gt; id;// 计算距离并染色void dfs(int x, int f, int d, int c) &#123; id.push_back(&#123;d, c&#125;); for (int i = hd[x]; i; i = e[i].nxt) &#123; int y = e[i].v; if (y == f || vis[y]) continue; dfs(y, x, d + e[i].t, c); &#125;&#125;nt y = e[i].v; if (y == f || vis[y]) continue; getrt(y, x, s), siz[x] += siz[y]; mx[x] = max(mx[x], siz[y]); &#125; mx[x] = max(mx[x], s - siz[x]); if (!rt || mx[x] &lt; mx[rt]) rt = x;&#125;// 分治void solve(int x) &#123; vis[x] = 1, calc(x); for (int i = hd[x]; i; i = e[i].nxt) &#123; int y = e[i].v, s = siz[y]; if (vis[y]) continue; rt = 0, getrt(y, x, s), getrt(y = rt, x, s), solve(y); &#125;&#125; 点分树 点分树是点分治的升级版，支持动态进行点分治可进行的操作。 具体实现： 原理是将点分治每次的分治重心相连，构建成一颗辅助树，把点分治需要用的东西用数据结构动态维护起来。在这棵树上进行的一些看似复杂度不对的东西因为有了层数的限制都可以被接受。同时还需要配一个快速求出两点在原树上的距离的数据结构，大多数情况下树剖就行了。 P6329 【模板】点分树 | 震波 代码实现： 123456789101112131415161718192021222324252627282930313233343536373839404142434445464748495051525354555657585960616263646566676869707172737475767778798081828384858687888990919293949596979899100101102103104105106107108109110111112113114115116117118119120121122123124125126127128129130131// 树分治 学习笔记 || 点分树的具体实现// Code By CloudySky#include &lt;bits/stdc++.h&gt;// #define int long longnamespace IO &#123;inline int read() &#123; int x = 0, f = 1; char c = getchar(); while (c &lt; &#x27;0&#x27; || c &gt; &#x27;9&#x27;) &#123; if (c == &#x27;-&#x27;) f = -1; c = getchar(); &#125; while (c &gt;= &#x27;0&#x27; &amp;&amp; c &lt;= &#x27;9&#x27;) &#123; x = x * 10 + (c ^ 48); c = getchar(); &#125; return x * f;&#125;void print_n(int x) &#123; if (x &gt; 9) print_n(x / 10); putchar(x % 10 + &#x27;0&#x27;);&#125;inline void print(int x, char s = &#x27;\\n&#x27;) &#123; if (x &lt; 0) putchar(&#x27;-&#x27;), x = -x; print_n(x), putchar(s);&#125;&#125; // namespace IOusing namespace IO;const int Maxn = 1e5 + 10;using namespace std;struct BIT &#123; int N; vector &lt;int&gt; v; void init(int n) &#123;N = n + 1, v.resize (N + 1);&#125; void add(int x, int y) &#123;for (x = x + 1; x &lt;= N; x += x &amp; -x) v[x] += y;&#125; int ask(int x, int ans = 0) &#123; for (x = min (x + 1, N); x; x -= x &amp; -x) &#123;ans += v[x];&#125; return ans; &#125;&#125; T1[Maxn], T2[Maxn];struct edge &#123;int v, nxt;&#125; e[Maxn &lt;&lt; 1];int hd[Maxn], cnt;void add(int u, int v) &#123;e[++cnt] = (edge) &#123;v, hd[u]&#125;; hd[u] = cnt;&#125;int dep[Maxn], fa[Maxn], siz[Maxn], son[Maxn];void dfs1(int x, int f) &#123; dep[x] = dep[f] + 1, fa[x] = f, siz[x] = 1; for (int i = hd[x]; i; i = e[i].nxt) &#123; int y = e[i].v; if (y == fa[x]) continue; dfs1(y, x), siz[x] += siz[y]; if (siz[y] &gt; siz[son[x]]) son[x] = y; &#125;&#125;int top[Maxn];void dfs2(int x, int f) &#123; top[x] = f; if (son[x]) dfs2(son[x], f); for (int i = hd[x]; i; i = e[i].nxt) &#123; int y = e[i].v; if (y != fa[x] &amp;&amp; y != son[x]) dfs2(y, y); &#125;&#125;int lca(int x, int y) &#123; while (top[x] != top[y]) &#123; if (dep[top[x]] &lt; dep[top[y]]) swap(x, y); x = fa[top[x]]; &#125; return dep[x] &lt; dep[y] ? x : y;&#125;int dis(int x, int y) &#123;return dep[x] + dep[y] - 2 * dep[lca(x, y)];&#125;void calc(int x) &#123; siz[fa[x]] -= siz[x], siz[x] += siz[fa[x]];&#125;int mx[Maxn], vis[Maxn], rt;void getrt(int x, int f, int Sz) &#123; siz[x] = 1, mx[x] = 0; for (int i = hd[x]; i; i = e[i].nxt) &#123; int y = e[i].v; if (y == f || vis[y]) continue; getrt(y, x, Sz); siz[x] += siz[y], mx[x] = max(mx[x], siz[y]); &#125; mx[x] = max(mx[x], Sz - siz[x]); if (!rt || mx[x] &lt; mx[rt]) rt = x;&#125;int p[Maxn];void build(int x, int f, int Sz) &#123; p[x] = f, vis[x] = 1; T1[x].init(Sz), T2[x].init(Sz); for (int i = hd[x]; i; i = e[i].nxt) &#123; int y = e[i].v, s = siz[y]; if (vis[y]) continue; rt = 0, getrt(y, x, s), getrt(rt, x, s), build(rt, x, s); &#125;&#125;void change(int x, int k) &#123; T1[x].add(0, k); for (int y = x; p[y]; y = p[y]) &#123; int d = dis(x, p[y]); T1[p[y]].add(d, k), T2[y].add(d, k); &#125;&#125;int ask(int x, int k) &#123; int ans = T1[x].ask(k); for (int y = x; p[y]; y = p[y]) &#123; int d = k - dis(x, p[y]); if (d &lt; 0) continue; ans += T1[p[y]].ask(d) - T2[y].ask(d); &#125; return ans;&#125;int a[Maxn];signed main() &#123; int n = read(), m = read(); for (int i = 1; i &lt;= n; ++i) a[i] = read(); for (int i = 1, u, v; i &lt; n; ++i) &#123;u = read(), v = read(), add(u, v), add(v, u);&#125; dfs1(1, 1), dfs2(1, 1); getrt(1, 0, n), getrt(rt, 0, n), build(rt, 0, n); for (int i = 1; i &lt;= n; ++i) change(i, a[i]); for (int i = 1, lst = 0; i &lt;= m; ++i) &#123; int op = read(), x = read() ^ lst, y = read() ^ lst; if (op == 0) print(lst = ask(x, y)); if (op == 1) change(x, y - a[x]), a[x] = y; &#125; return 0;&#125; 本文作者：CloudySky 写作时间： 2022-01-20 最后更新时间： 2022-01-20 遵循协议： BY-NC-SA","tags":"数据结构 分治"},{"title":"Prufer 序列 学习笔记","url":"/Blog/Prufer/","text":"注：这是一个散片笔记，内容较少。 PruferPruferPrufer 序列是一种可以方便的进行图上计数的序列。最早被拿来证明凯莱定理。 PruferPruferPrufer 序列必须在无根树上构造，构造方法： 每次选择一个编号最小的叶子节点，将它从树上删除，同时将与它相连的点（由于是无根树，所以这样表示，也就是它的父亲）加入序列。 重复这一过程直到序列长度为 n−2n - 2n−2 。 简单性质： 一个点在 PruferPruferPrufer 序列中出现的次数等价于它的度数 −1-1−1 。 最后剩下的 222 个点中，必然包括 nnn 号节点。 每个无根树与它的 PruferPruferPrufer 序列成双射关系。 所以这个东西也可以被用来对拍，因为 PruferPruferPrufer 序列一定合法且可以对应一棵树。 PruferPruferPrufer 序列的线性构造 用上面的定义进行构造，用堆维护最小值显然是可以的，但复杂度不够优。 因为 PruferPruferPrufer 序列是按照特殊的权值编号来构造的，所以就会有的特殊性质。 具体实现： 顺序遍历数组，找到叶子节点 yyy。 找到之后将它的父亲加进 PruferPruferPrufer 序列，将父亲节点度数 −1-1−1 。如果父亲节点变成了叶子节点，设父亲的父亲的编号为 xxx ，按照 xxx 和 yyy 的大小关系进行分类讨论： x&gt;yx &gt; yx&gt;y 之后一定会扫到 xxx ，所以不用进行任何操作。 并且也不能进行任何操作，因为 [x+1,y−1][x + 1, y - 1][x+1,y−1] 可能有叶子节点 zzz，这时候显然是先要处理 zzz ，再处理 yyy 的。 x&lt;yx &lt; yx&lt;y 这个时候需要直接将 xxx 设为 yyy 并直接重复进行 2.22.22.2 （如果满足条件的话）。 注：为了保证复杂度，不能直接将 yyy 改变，而是应该采用别的方法，如利用 py=xp_y = xpy​=x 不断地利用 ppp 数组进行更新。 这样整个算法下来，每个点只会被删除一次，并且已经被删除的点不会被重复扫到，所以时间复杂度是线性的。 代码实现： 123456789101112// Prufer 序列 学习笔记// Prufer 序列的线性构造void build (int n) &#123; memset (p, 0, sizeof (p)); for (int i = 1, j = 1; i &lt;= n - 2; ++i, ++j) &#123; while (d[j]) ++j; p[i] = f[j]; // 一定要先修改 d[] 再进行编号判断 while (i &lt;= n - 2 &amp;&amp; --d[p[i]] == 0 &amp;&amp; p[i] &lt; j) p[i + 1] = f[p[i]], ++i; &#125;&#125; PruferPruferPrufer 重构树与线性实现 因为 PruferPruferPrufer 序列与树双射，所以可以将它映射回树。 首先要把 p[n−1]p[n - 1]p[n−1] 赋成 nnn ，因为考虑正着求 PruferPruferPrufer 序列第 n−1n - 1n−1 项一定是 nnn ，只是因为它没有用所以跳过了而已。 然后直接跑一边，把所有赋值语句都左右交换。 代码实现： 12345678910111213// Prufer 序列 学习笔记// Prufer 重构树与线性实现void rebuild (int n) &#123; memset (f, 0, sizeof (f)); p[n - 1] = n; for (int i = 1, j = 1; i &lt;= n - 1; ++i, ++j) &#123; while (d[j]) ++j; f[j] = p[i]; // 一定要先修改 d[] 再进行编号判断 while (i &lt;= n - 1 &amp;&amp; --d[p[i]] &lt;= 0 &amp;&amp; p[i] &lt; j) f[p[i]] = p[i + 1], ++i; &#125;&#125; 性质： 首先是用来被证明的凯莱公式：完全图 KnKnKn 有 nn−2n^{n - 2}nn−2 个生成树。 一个 pruferpruferprufer 对应一棵树，长度为 n−2n - 2n−2 值域为 [1,n][1, n][1,n] 因此有 nn−2n^{n - 2}nn−2 个生成树。 一个 nnn 个点 mmm 条边的无向图，有 kkk 个连通块，想通过 k−1k - 1k−1 条边将他连成连通图。设每个连通块的大小为 sis_isi​ ，方案数为 nk−2⋅∏i=1ksin^{k - 2}\\cdot \\prod_{i = 1}^k s_ink−2⋅∏i=1k​si​ 。 首先，感性理解是很好理解的，每个连通块向外连边的方案数为点数，内部联通情况为 nk−2n^{k - 2}nk−2 ,证明： 设 did_idi​ 表示第 iii 个连通块的度数。很容易发现： ∑i=1kdi=2k−2\\sum_{i = 1}^k d_i = 2k - 2 i=1∑k​di​=2k−2 那么方案数为 ∑∑i=1kdi(k−2d1−1,d2−1,⋯ ,dk−1)⋅∏i=1ksidi化简为∑2k−2(k−2d1−1,d2−1,⋯ ,dk−1)⋅∏i=1ksidi换元，设ei=di−1,∑k−2(k−2e1,e2,⋯ ,ek)⋅∏i=1ksiei+1带入二项式定理(s1+s2+⋯+sk)k−2⋅∏i−1ksink−2⋅∏i=1ksi\\sum_{\\sum_{i = 1}^k d_i}\\binom{k - 2}{d_1 - 1, d_2 - 1, \\cdots, d_k - 1}\\cdot\\prod_{i = 1}^k s_i^{d_i} \\\\ \\text{化简为} \\sum_{2k - 2}\\binom{k - 2}{d_1 - 1, d_2 - 1, \\cdots, d_k - 1}\\cdot\\prod_{i = 1}^k s_i^{d_i} \\\\ \\text{换元，设} e_i = d_i - 1, \\\\ \\sum_{k - 2}\\binom{k - 2}{e_1, e_2, \\cdots, e_k}\\cdot\\prod_{i = 1}^ks_i^{e_i + 1} \\\\ \\text{带入二项式定理} (s_1 + s_2 + \\cdots + s_k)^{k - 2}\\cdot\\prod_{i - 1}^ks_i \\\\ n^{k - 2}\\cdot\\prod_{i = 1}^ks_i ∑i=1k​di​∑​(d1​−1,d2​−1,⋯,dk​−1k−2​)⋅i=1∏k​sidi​​化简为2k−2∑​(d1​−1,d2​−1,⋯,dk​−1k−2​)⋅i=1∏k​sidi​​换元，设ei​=di​−1,k−2∑​(e1​,e2​,⋯,ek​k−2​)⋅i=1∏k​siei​+1​带入二项式定理(s1​+s2​+⋯+sk​)k−2⋅i−1∏k​si​nk−2⋅i=1∏k​si​ 本文作者：CloudySky 写作时间： 2022-01-18 最后更新时间： 2022-01-18 遵循协议： BY-NC-SA","tags":"数学"},{"title":"口胡题解-模拟赛 2022-01-17","url":"/Blog/solution-2022-01-17/","text":" 输入密码来证明你不是卷王","tags":"图论 数据结构 数学 题解 test 二分 计算几何"},{"title":"自动机 学习笔记","url":"/Blog/Automaton/","text":"自动机，全称有限状态自动机（DFADFADFA）是信息学中一类常用的算法。 它包括 5 个要素： 状态集合 QQQ 字符集 Σ\\SigmaΣ 状态转移函数 δ\\deltaδ 使得 δ(q,σ)=q′(q,q′∈Q,σ∈Σ)\\delta(q, \\sigma) = q&#x27;(q, q&#x27;\\in Q, \\sigma\\in \\Sigma)δ(q,σ)=q′(q,q′∈Q,σ∈Σ) 开始状态 s∈Qs \\in Qs∈Q 接收的状态集合 F⊆QF\\subseteq QF⊆Q 可以把这个东西看成一张有向图，图中的所有顶点所组成的集合为 QQQ ，图中的边为 δ\\deltaδ ，边权只能为 Σ\\SigmaΣ 中的一种。sss 为起点。 值得一提的是，并不是所有的自动机都是一棵树，但必然是一个 DAGDAGDAG 。 ACACAC 自动机 ACACAC 自动机是一类以 TrieTrieTrie 为基础，结合了 KMPKMPKMP 思想，用来在线性时间内解决多串同时匹配问题的算法。它通过维护 failfailfail 指针来保证复杂度，类似与 KMPKMPKMP 的 nxtnxtnxt 数组，不同的是，它维护的是全局失配转移路径，即有可能在 AAA 串匹配完成或失败后直接开始进行对 BBB 串的匹配。 具体实现： failfailfail 指针的含义：设字符串 rootABrootABrootAB 在 TrieTrieTrie 上路径末尾对应的节点 aaa ，则 failafail_afaila​ 指向的便是路径 rootBrootBrootB 的末尾 bbb，且满足 BBB 最大，但并不一定是这条链的结尾。如：一个 TrieTrieTrie 中顺序插入了 ABCABCABC , BCDBCDBCD 和 CCC 则他们的节点编号为 123 456 7 那么 fail3=5fail_3 = 5fail3​=5 . 同时可以得出一个节点 failfailfail 指向的节点深度一定小于当前节点。 ACACAC 自动机的构建： 先把 TrieTrieTrie 树构建出来，然后通过广搜构建 failfailfail 指针。 将第一层所有节点的 failfailfail 指针指向 rootrootroot ，并将它们入队。 令某个节点父亲节点 failfailfail 指针的相同转移子节点为失配节点。 如果当前节点存在，将它的 failfailfail 指向失配节点。 如果当前节点不存在，将它指向失配节点。 通过这样的操作，根据广搜的特性，深度小于它的节点一定比它先搜到，所以无论失配节点存不存在，这个操作都是有意义的。 通过上面的构造，就打通了一条从当前节点到 rootrootroot 的路径。也就是说不同于 KMPKMPKMP ，无需判断是否失配直接跳子节点即可。 经典的操作： 查询每个模式串在文本串中出现的次数。 查询出现最多的模式串和出现次数。 查询时每到一个节点将它的标记 +1+1+1 ，最后将每个点的 failfailfail 向它连边（注意方向），然后跑一边类似树形 DP 的操作，向上统计答案即可，因为如果某个串成功匹配，一定会对它 failfailfail 边指向的节点造成贡献。 一定要反向连边的原因是所有的节点最终都会 failfailfail 到 rootrootroot ，反向连边方便进行 dfsdfsdfs ，当然也可以进行拓扑排序正向连边，同时统计答案。 代码实现： 12345678910111213141516171819202122232425262728293031// 自动机 学习笔记// AC 自动机的构建void build() &#123; for (int i = 0; i &lt; 26; i++) &#123; if (trie[0][i]) &#123; fail[trie[0][i]] = 0; q.push(trie[0][i]); &#125; &#125; queue&lt;int&gt; q; while (!q.empty()) &#123; int x = q.front(); q.pop(); for (int i = 0; i &lt; 26; ++i) &#123; int y = trie[x][i]; if (y) &#123; fail[y] = trie[fail[x]][i]; q.push(y); &#125; else trie[x][i] = trie[fail[x]][i]; &#125; &#125;&#125;int vis[Maxn];void search(char* s) &#123; int n = strlen(s), p = 0; for (int i = 0; i &lt; n; ++i) &#123; p = trie[p][s[i] - &#x27;a&#x27;]; vis[p]++; &#125;&#125; P5357 【模板】AC自动机（二次加强版） 代码实现： 123456789101112131415161718192021222324252627282930313233343536373839404142434445464748495051525354555657585960616263646566676869707172737475767778798081828384858687888990919293949596979899100101102// 自动机 学习笔记// AC自动机二次加强版 || AC自动机模板// Code By CloudySky#include &lt;bits/stdc++.h&gt;// #define int long longnamespace IOconst int Maxn = 2e6 + 10;using namespace std;int trie[Maxn][26], tot;int v[Maxn], id[Maxn];void insert(char* s, int cur) &#123; int p = 0, n = strlen(s); for (int k = 0; k &lt; n; ++k) &#123; int ch = s[k] - &#x27;a&#x27;; if (!trie[p][ch]) trie[p][ch] = ++tot; p = trie[p][ch]; &#125; v[p] = cur, id[cur] = p; &#125;int fail[Maxn];void build() &#123; queue&lt;int&gt; q; for (int i = 0; i &lt; 26; i++) &#123; if (trie[0][i]) &#123; fail[trie[0][i]] = 0; q.push(trie[0][i]); &#125; &#125; while (!q.empty()) &#123; int x = q.front(); q.pop(); for (int i = 0; i &lt; 26; ++i) &#123; int y = trie[x][i]; if (y) &#123; fail[y] = trie[fail[x]][i]; q.push(y); &#125; else trie[x][i] = trie[fail[x]][i]; &#125; &#125;&#125;int vis[Maxn];void search (char* s) &#123; int n = strlen (s), p = 0; for (int i = 0; i &lt; n; ++i) &#123; p = trie[p][s[i] - &#x27;a&#x27;]; vis[p] ++; &#125;&#125;struct edge &#123; int v, nxt;&#125; e[Maxn &lt;&lt; 1];int hd[Maxn], cnt;void add (int u, int v) &#123; e[++cnt] = (edge) &#123;v, hd[u]&#125;; hd[u] = cnt;&#125;void dfs (int x) &#123; for (int i = hd[x]; i; i = e[i].nxt) &#123; int y = e[i].v; dfs (y); vis[x] += vis[y]; &#125;&#125;signed main() &#123; static char s[Maxn], s1[Maxn]; int n = read (); // clear for (int i = 0; i &lt;= tot; ++i) fail[i] = v[i] = 0; memset (trie, 0, sizeof (trie)); memset (vis, 0, sizeof (vis)); tot = 0; // read for (int i = 1; i &lt;= n; ++i) &#123; scanf (&quot;%s&quot;, s); insert (s, i); &#125; // build build (); // query scanf (&quot;%s&quot;, s1); search (s1); // count for (int i = 1; i &lt;= tot; ++i) &#123; add (fail[i], i); &#125; dfs (0); // print for (int i = 1; i &lt;= n; ++i) &#123; print (vis[id[i]]); &#125; return 0;&#125; 后缀自动机 SAMSAMSAM 后缀自动机是一个用途广泛的字符串处理算法。SAMSAMSAM 最重要的，也是它建立的初衷，是它维护了所有子串的信息。具体来说从初始节点 t0t_0t0​ 开始的任意一条路径都与 sss 的子串构成对应关系。但这并不能唯一确定一个自动机，因此它还具有一些其他的性质。 令 endpos(x)endpos(x)endpos(x) 为子串 xxx 在自动机中的所有出现位置。 那么相对于 endpos(x)endpos(x)endpos(x) 只会出现 3 种情况： endpos(y)⊆endpos(x),当且仅当 x 为 y 的后缀endpos(y)⊇endpos(x),当且仅当 y 为 x 的后缀endpos(y)∩endpos(x)=∅,当且仅当 x 和 y 不构成后缀关系endpos(y) \\subseteq endpos(x), \\text{当且仅当}\\ x \\ \\text{为}\\ y \\ \\text{的后缀} \\\\ endpos(y) \\supseteq endpos(x), \\text{当且仅当}\\ y \\ \\text{为}\\ x \\ \\text{的后缀} \\\\ endpos(y) \\cap endpos(x) = \\varnothing, \\text{当且仅当}\\ x \\ \\text{和}\\ y \\ \\text{不构成后缀关系} endpos(y)⊆endpos(x),当且仅当 x 为 y 的后缀endpos(y)⊇endpos(x),当且仅当 y 为 x 的后缀endpos(y)∩endpos(x)=∅,当且仅当 x 和 y 不构成后缀关系 （要注意后缀关系与子集关系是反向的） 也有一些子串他们虽然长度不同，但是 endposendposendpos 集合是完全相同的，称他们为等价类，这些子串最终会被合并为一个节点。也就是说后缀自动机上每个节点对应的字符串长度是一个区间。 同时维护后缀链接 fafafa 指向 endposendposendpos 真包含当前节点 endposendposendpos 集的最长的后缀，即 longest(fax),endpos(fax)⫌endpos(x)longest(fa_x), endpos(fa_x) \\supsetneqq endpos(x)longest(fax​),endpos(fax​)⫌endpos(x)。 有了这两个性质辅助，就可以唯一确定一个后缀自动机了。 后缀自动机每个节点维护的基本信息： lenlenlen 表示最长等价类长度 failfailfail 表示后缀链接 sam[σ]sam[\\sigma]sam[σ] 表示状态转移边 sizsizsiz 表示每个节点出现的次数 跳 samsamsam 边相当于在后面加字符， 跳 failfailfail 边相当于在前面删字符。 后缀自动机的线性构建： 因为 SAMSAMSAM 结构较为复杂，且不确定性因素较多，所以构建分为两步 逐个插入字符，构建 samsamsam 转移边，长度 lenlenlen 和 failfailfail 指针。 在搭好结构的 SAMSAMSAM 上求 sizsizsiz。 设上次插入的点为 ppp, 这次要插入的点为 npnpnp，令 lennp=lenp+1len_{np} = len_p + 1lennp​=lenp​+1 ，接下来要进行的操作是给 npnpnp 找 failfailfail 值。 令 ppp 重复跳 fafafa 指针直到找到有相同转移的点或虚拟节点。 如果为虚拟节点， failnp=0fail_{np} = 0failnp​=0 并退出。 否则令当前节点 ppp 的对应转移为 qqq. 可以发现如果当前节点 lenq=lenp+1len_q = len_p + 1lenq​=lenp​+1 ，直接链 failfailfail 并退出。 因为根据上面的定义，这条边不会被后面操作拆开。 否则： 新建节点 nqnqnq ，并复制 qqq 除 lenlenlen 以外的信息。令 lennq=lenp+1len_{nq} = len_p + 1lennq​=lenp​+1. 相当于强行把 qqq 删了点东西。 将 failqfail_qfailq​ 和 fanpfa_{np}fanp​ 同时指向 nqnqnq 。 将所有 failfailfail 链接着 qqq 的点的图边全部替换成 nqnqnq 。 这里面最长的串是 npnpnp, 最短的串是 nqnqnq （如果有的话），从 npnpnp 到 qqq 再到 nqnqnq 依次删除了一些前缀。 构建 sizsizsiz 有两种常见的方法。一种是像 ACACAC 自动机一样反着连 failfailfail 边建出 failfailfail 树，然后跑树形 dpdpdp ，另一种是通过特殊性质：lenfailp&lt;lenplen_{fail_p} &lt; len_plenfailp​​&lt;lenp​ ，对映射数组进行时间复杂度为线性的排序来转移。第二种常数较小，且代码相对短。 代码实现： 1234567891011121314151617181920212223242526// 自动机 学习笔记// 后缀自动机的线性构造void insert(char c) &#123; int p = lst, np = ++tot, ch = c - &#x27;a&#x27;; lst = np, len[np] = len[p] + 1, siz[np] = 1; for (; p != -1 &amp;&amp; !sam[p][ch]; p = fail[p]) sam[p][ch] = np; if (p == -1) return fail[np] = 0, void(); int q = sam[p][ch]; if (len[q] == len[p] + 1) return fail[np] = q, void(); int nq = ++tot; fail[nq] = fail[q], fail[q] = fail[np] = nq; memcpy(sam[nq], sam[q], sizeof(sam[nq])); len[nq] = len[p] + 1; for (; p != -1 &amp;&amp; sam[p][ch] == q; p = fail[p]) sam[p][ch] = nq;&#125;void SAM(char *s) &#123; fail[0] = -1, lst = tot = 0; int n = strlen(s); for (int i = 0; i &lt; n; ++i) insert(s[i]); static int cnt[Maxn], id[Maxn]; for (int i = 0; i &lt;= tot; ++i) ++cnt[len[i]]; for (int i = 0; i &lt;= tot; ++i) cnt[i] += cnt[i - 1]; for (int i = 0; i &lt;= tot; ++i) id[--cnt[len[i]]] = i; for (int i = tot; i; --i) siz[fail[id[i]]] += siz[id[i]];&#125; P3804 【模板】后缀自动机 (SAM) 代码实现： 123456789101112131415161718192021222324252627282930313233343536373839404142434445// 自动机 学习笔记// Code By CloudySky#include &lt;bits/stdc++.h&gt;namespace IO // namespace IOusing namespace IO;const int Maxn = 2e6 + 10;using namespace std;int sam[Maxn][26], siz[Maxn], fail[Maxn], len[Maxn], lst, tot;void insert(char c) &#123; int p = lst, np = ++tot, ch = c - &#x27;a&#x27;; lst = np, len[np] = len[p] + 1, siz[np] = 1; for (; p != -1 &amp;&amp; !sam[p][ch]; p = fail[p]) sam[p][ch] = np; if (p == -1) return fail[np] = 0, void(); int q = sam[p][ch]; if (len[q] == len[p] + 1) return fail[np] = q, void(); int nq = ++tot; fail[nq] = fail[q], fail[q] = fail[np] = nq; memcpy(sam[nq], sam[q], sizeof(sam[nq])); len[nq] = len[p] + 1; for (; p != -1 &amp;&amp; sam[p][ch] == q; p = fail[p]) sam[p][ch] = nq;&#125;char s[Maxn];void SAM() &#123; fail[0] = -1, lst = tot = 0; int n = strlen(s); for (int i = 0; i &lt; n; ++i) insert(s[i]); static int cnt[Maxn], id[Maxn]; for (int i = 0; i &lt;= tot; ++i) ++cnt[len[i]]; for (int i = 0; i &lt;= tot; ++i) cnt[i] += cnt[i - 1]; for (int i = 0; i &lt;= tot; ++i) id[--cnt[len[i]]] = i; for (int i = tot; i; --i) siz[fail[id[i]]] += siz[id[i]];&#125;signed main() &#123; scanf(&quot;%s&quot;, s), SAM(); long long ans = 0; for (int i = 1; i &lt;= tot; ++i) ans = max(ans, siz[i] &gt; 1 ? 1ll * siz[i] * len[i] : 0); print(ans); return 0;&#125; 后缀自动机的应用大概要等后续学习了。 回文自动机 PAMPAMPAM 回文自动机是一种可以存储一个串中所有回文子串的高效数据结构。同样是一个节点表示一个子串。建出来的形态是两颗树，一颗表示长度为奇数的回文串， 需要维护的东西： lenlenlen 字符串长度。 pam[σ]pam[\\sigma]pam[σ] 字符边。不同于其他自动机，跳 pampampam 边的含义是在前面和后面都插入当前字符。 failfailfail 失配边。仍然是指向当前子串的最长后缀。 PAMPAMPAM 的线性构造： 首先构建两个点 000 和 111 分别代表偶根和奇根，并将 111 号点的长度初始化为 −1-1−1 。 令 ppp 为上一次操作后的节点， qqq 为当前要放入的节点。每插入一个字符不断地令 ppp 跳 failfailfail 直到可以匹配上回文。显然你的 qqq 是要接在 ppp 上的，但是不能着急。先设 np=failpnp = fail_pnp=failp​ ，令 npnpnp 不断跳 failfailfail 直到匹配上回文，将 failqfail_qfailq​ 指向此时的 npnpnp ，然后再将 pamp[σ]pam_p[\\sigma]pamp​[σ] 指向 qqq ，同时 lenq=lenp+2len_q = len_p + 2lenq​=lenp​+2。 原因就是 ∃np=p\\exists np = p∃np=p ，如果先 pamp[σ]=qpam_p[\\sigma] = qpamp​[σ]=q 的话，可能会出现 failq=qfail_q = qfailq​=q 的情况，使程序陷入死循环。 代码实现： 123456789101112131415161718192021222324252627// 自动机 学习笔记// PAM 的线性构造int pam[Maxn][26], fail[Maxn], len[Maxn], tot，vis[Maxn];void pam_init () &#123; fail[0] = 1, len[1] = -1, tot = 1;&#125;void insert (char* s) &#123; int n = strlen (s); for (int i = 0, x = 0; i &lt; n; ++i) &#123; int p = x, q = ++tot; while (i - len[p] - 1 &lt; 0 || s[i - len[p] - 1] != s[i]) p = fail[p]; if (pam[p][s[i] - &#x27;a&#x27;] == 0) &#123; int np = fail[p]; while (i - len[np] - 1 &lt; 0 || s[i - len[np] - 1] != s[i]) np = fail[np]; fail[q] = pam[np][s[i] - &#x27;a&#x27;]; // 更新节点信息一定要放到 fail 指针之后，否则可能会把 fail 指向自己 pam[p][s[i] - &#x27;a&#x27;] = q, len[q] = len[p] + 2; vis[q] = vis[fail[q]] + 1; &#125; x = pam[p][s[i] - &#x27;a&#x27;]; &#125;&#125; 本文作者：CloudySky 写作时间： 2022-01-16 最后更新时间： 2022-01-20 遵循协议： BY-NC-SA","tags":"数据结构 字符串"},{"title":"后缀数组 学习笔记","url":"/Blog/SA/","text":"注：仅仅是为了以后的学习预习一下。应该会很草。大部分参考的 OI Wiki 在计算机科学里，后缀数组是一个通过对字符串的所有后缀经过排序后得到的数组。–百度百科 约定以 iii 为起始位置的后缀称为后缀 iii ，S(i)S(i)S(i) 表示后缀 iii 对应的字符串。 一般记后缀数组为 saisa_isai​ 表示的排名为 iii 的后缀所对应的起始位置（显然不能直接把字符串存起来）。同时记 rkirk_irki​ 表示后缀 iii 的排名。可知 sasasa 和 rkrkrk 互为逆操作，构成双射关系，因此可知 sa[rk[i]]=isa[rk[i]] = isa[rk[i]]=i 。 还有一个 heightheightheight 数组，表示 saisa_isai​ 对应后缀和 sai−1sa_{i - 1}sai−1​ 对应后缀的最长公共前缀（ lcplcplcp ）。即 heighti=lcp(sai,sai−1)height_i = lcp(sa_{i}, sa_{i - 1})heighti​=lcp(sai​,sai−1​) 它的性质： height[rk[i]]≥height[rk[i−1]]−1height[rk[i]] \\ge height[rk[i - 1]] - 1height[rk[i]]≥height[rk[i−1]]−1 利用这个性质可以 O(n)O(n)O(n) 求 heightheightheight 数组。 证明： 令 aaa 为一个字符，不同的大写字母表示不同的字符串。 当 height[rk[i−1]]&gt;1height[rk[i - 1]] &gt; 1height[rk[i−1]]&gt;1 时： 设后缀 i−1i - 1i−1 为 aABaABaAB （A 为长度为 height[rk[i−1]]−1height[rk[i - 1]] - 1height[rk[i−1]]−1 的字符串），则后缀 iii 为 ABABAB 。 令 rk[i−1]=xrk[i - 1] = xrk[i−1]=x ，heightx=lcp(sax,sax−1)height_x = lcp(sa_x, sa_{x - 1})heightx​=lcp(sax​,sax−1​) 即 height[rk[i−1]]=lcp((sa[rk[i−1]]→i−1),sa[rk[i−1]−1])=aAheight[rk[i - 1]] = lcp((sa[rk[i - 1]] \\to i - 1), sa[rk[i - 1] - 1]) = aAheight[rk[i−1]]=lcp((sa[rk[i−1]]→i−1),sa[rk[i−1]−1])=aA 。 且非常显然 (S(sa[rk[i−1]−1])→aAC)≤S(i−1)(S(sa[rk[i - 1] - 1]) \\to aAC) \\le S(i - 1)(S(sa[rk[i−1]−1])→aAC)≤S(i−1) . 可以得出 (S(sa[rk[i−1]−1]+1)→AC)≤AB(S(sa[rk[i - 1] - 1] + 1) \\to AC) \\le AB(S(sa[rk[i−1]−1]+1)→AC)≤AB . (height[rk[i]]=lcp(sa[rk[i]],sa[rk[i−1]]))≥height[rk[i−1]]−1(height[rk[i]] = lcp(sa[rk[i]], sa[rk[i - 1]])) \\ge height[rk[i - 1]] - 1(height[rk[i]]=lcp(sa[rk[i]],sa[rk[i−1]]))≥height[rk[i−1]]−1 . 证毕。 ∀x,y∈[1,∣S∣]&amp;&amp;x&lt;y,lcp(x,y)=min⁡k=x+1y(hegihtk)\\forall x, y \\in[1, |S|]\\&amp;\\&amp; x &lt; y, lcp(x, y) = \\min_{k = x + 1} ^ y(hegiht_k)∀x,y∈[1,∣S∣]&amp;&amp;x&lt;y,lcp(x,y)=mink=x+1y​(hegihtk​) 利用这个性质可以将 lcplcplcp 问题转化为 RMQRMQRMQ 问题。 不同子串的个数=n(n+1)2−∑i=2heighti\\text{不同子串的个数} = \\dfrac{n(n + 1)}{2} - \\sum_{i = 2} height_i不同子串的个数=2n(n+1)​−∑i=2​heighti​ 具体实现： 倍增求 sasasa 数组，同时求 rkrkrk 数组。考虑类似 STSTST 表的区间合并。 设 saw[i]sa_w[i]saw​[i] 表示，长度为 www 的所有子串中，以 iii 为起始位置的子串对应的排名。 对每个字符进行排序，求 sa1sa_1sa1​ 数组。 设当前倍增长度为 www ，根据字符串排序规则，直接以 saw[i+w]sa_w[i + w]saw​[i+w] 为第二关键字，以 saw[i]sa_w[i]saw​[i] 为第一关键字进行排序，即可求出 sa2w[i]sa_{2w}[i]sa2w​[i]。 注：因为倍增本身复杂度为 O(logn)O(logn)O(logn) ，如果使用普通的 sortsortsort 复杂度无法通过，因此采用时间复杂度 O(n)O(n)O(n) 计数排序。 一些优化： 第二关键字无需真正排序。只需要先将 n→n−wn \\to n - wn→n−w 依次记录（空串字典序必然小），然后再从头开始扫，把 sa&gt;wsa &gt; wsa&gt;w 的值依次记录。 因为当前扫描以 iii 为起始位置的串要接在以 i−wi - wi−w 为起始位置的串之后，所以只有这些串有意义，且在上一轮均已排好。 可以根据上次的 rkrkrk 修改值域。 利用 heightheightheight 数组的性质 111 线性求 heightheightheight 数组。 代码实现： 1234567891011121314151617181920212223242526272829303132333435363738394041424344454647// 后缀数组 学习笔记bool cmp (int x, int y, int w) &#123; return trk[x] == trk[y] &amp;&amp; trk[x + w] == trk[y + w];&#125;void SA (int n) &#123; // 计数排序数组，cnt 为当前值所对应的个数， id 为按照第二关键字排号的序列。 static int cnt[Maxn], id[Maxn]; int m = 300, p; // 对字符的排序 for (int i = 1; i &lt;= n; ++i) ++cnt[rk[i] = s[i]]; for (int i = 1; i &lt;= m; ++i) cnt[i] += cnt[i - 1]; for (int i = n; i &gt;= 1; --i) sa[cnt[rk[i]]--] = i; for (int w = 1; ; w &lt;&lt;= 1, m = p) &#123; // 将第二关键字排序（已优化） p = 0; for (int i = n; i &gt; n - w; --i) id[++p] = i; for (int k = 1; k &lt;= n; ++k) if (sa[k] &gt; w) id[++p] = sa[k] - w; // 第一关键字排序 memset (cnt, 0, sizeof (cnt)); for (int i = 1; i &lt;= n; ++i) ++cnt[rk[id[i]]]; for (int i = 1; i &lt;= m; ++i) cnt[i] += cnt[i - 1]; for (int i = n; i &gt;= 1; --i) sa[cnt[rk[id[i]]]--] = id[i]; // 处理求 RK 数组，处理值域。 memcpy (trk, rk, sizeof (rk)); p = 0; for (int i = 1; i &lt;= n; ++i) rk[sa[i]] = cmp (sa[i], sa[i - 1], w) ? p : ++p; // 收尾 if (p == n) &#123; for (int i = 1; i &lt;= n; ++i) sa[rk[i]] = i; break; &#125; &#125; for (int i = 1, k = 0; i &lt;= n; ++i) &#123; if (k) --k; while (s[i + k] == s[sa[rk[i] - 1] + k]) ++k; h[rk[i]] = k; &#125;&#125; 本文作者：CloudySky 写作时间： 2022-01-14 最后更新时间： 2022-01-14 遵循协议： BY-NC-SA","tags":"字符串"},{"title":"多项式 学习笔记","url":"/Blog/Polynomial/","text":"我是真的没想到，有很多地方不是独立完成的，但这篇博客仍写了 1 天。 还有它貌似是 22 年的第一篇博客。 多项式的定义与数学中的定义相同，这里指的多项式均为一元多项式。 多项式基本知识 多项式的表达 在计算机中， 多项式有两种常见的表达方式，点值表达和系数表达。 系数表达：指用 n+1n + 1n+1 个数来表示一个 nnn 次多项式。其中 ak,k∈[0,n]a_k,k\\in[0, n]ak​,k∈[0,n] 分别表示该多项式的 kkk 次项系数。 点值表达：代数基本定理中说明：nnn 个不同点可以表示一个唯一确定的 n−1n - 1n−1 次多项式。这里只讨论用一些有特性的点来表示一个多项式，所以横坐标是可以根据下标推出来的，a0,…ana_0, \\dots a_na0​,…an​ 分别表示第 kkk 个点的纵坐标。 多项式的界 大多数情况下我们只需要在意低次项，一个多项式的界就代表最高有用位。 多项式的四则运算 加减法运算： 系数表达下：直接系数相加减即可 点值表达下：直接纵坐标相加减即可。 乘法运算： 系数表达下：本质上是加法卷积，令 f[k]f[k]f[k] 表示多项式 fff 的 kkk 次项系数。式子是： C[k]=∑i+j=kA[i]×b[j]C[k] = \\sum_{i + j = k} A[i] \\times b[j] C[k]=i+j=k∑​A[i]×b[j] 点值表达下：直接 ck=ak×bkc_k = a_k \\times b_kck​=ak​×bk​ 即可。 求逆运算： 较为复杂，待会分析。 多项式半家桶 从 FFTFFTFFT 到 NTTNTTNTT ，点值表达与系数表达的转换。 引入 从多项式的乘法就可以看出，某些情况下点值表达比系数表达要方便，但有些情况下又必须用系数表达。所以如何将这两种表达方式串联起来，做到快速转化便是主要问题。 考虑到点值表达和系数表达都可以看作 1 行 n 列的矩阵，转化相当于对他们进行线性变换。如果可以找到一些特殊的点，那么就可以用分治来代替暴力以降低复杂度。 数学界某知名大佬 Fourier 找到了一类符合条件的数：单位根（ω\\omegaω）。 单位根 单位根是指复数域单位圆上的点。nnn 次单位根 ωn1\\omega_n^1ωn1​ 本质上是 ωn1=1n\\omega_n^1 = \\sqrt[n]{1}ωn1​=n1​ 。 这个东西的某些性质和三角函数很像。（毕竟都是圆上的东西） 具体来说： ωnm=(ωn1)m%n\\omega_n^m = (\\omega_n^1)^{m\\%n}ωnm​=(ωn1​)m%n ωnj×ωnk=wj+k\\omega_n^j \\times \\omega_n^k = w^{j + k}ωnj​×ωnk​=wj+k ω2n2m=wnm\\omega_{2n}^{2m} = w_n^mω2n2m​=wnm​ ωnk+n/2=−ωnk\\omega_n^{k+n/2} = -\\omega_n^kωnk+n/2​=−ωnk​ 有了上面的性质，就可以暴力推式子了。 DFT 的推导 设 F(x)F(x)F(x) 的项数是 222 的整次幂（不是的暴力补高位为 0 就行） 将 F(x)F(x)F(x) 按照奇偶性劈成两半：F(x)=(F[0]+F[2]x2+F[n−2]xn−2)+(F[1]x+f[3]x3+f[n−1]xn−1)F(x) = (F[0] + F[2]x^2 + F[n - 2]x^{n - 2}) + (F[1]x + f[3]x^3 + f[n - 1]x^{n - 1})F(x)=(F[0]+F[2]x2+F[n−2]xn−2)+(F[1]x+f[3]x3+f[n−1]xn−1) 。 设： Fl(x)=∑F[2k]xk,Fr(x)=∑F[2k+1]xk,k∈[0,n/2−1]Fl(x) = \\sum F[2k]x^{k}, Fr(x) = \\sum F[2k + 1]x^k ,k \\in [0, n / 2 - 1] Fl(x)=∑F[2k]xk,Fr(x)=∑F[2k+1]xk,k∈[0,n/2−1] 可以发现： F(x)=Fl(x2)+x⋅Fr(x2)F(x) = Fl(x ^ 2) + x\\cdot Fr(x^2) F(x)=Fl(x2)+x⋅Fr(x2) 按照上下半圆分别带入单位根： 当 k&lt;n/2k &lt; n / 2k&lt;n/2 时，代入 ωnk\\omega^k_nωnk​ F(ωnk)=Fl(ωn/2k)+ωnkFr(ωn/2k)F(\\omega^k_n) = Fl(\\omega^k_{n / 2}) + \\omega^k_n Fr(\\omega^k_{n / 2}) F(ωnk​)=Fl(ωn/2k​)+ωnk​Fr(ωn/2k​) 当 k&gt;n/2k &gt; n / 2k&gt;n/2 时，设 t=k−n/2t = k - n / 2t=k−n/2 ，代入 ωnt\\omega^t_nωnt​ F(wnt+n/2)=Fl(wn/2t)−wntFr(ωn/2t)F(w^{t + n / 2}_n) = Fl(w^t_{n / 2}) - w^t_n Fr(\\omega^t_{n / 2}) F(wnt+n/2​)=Fl(wn/2t​)−wnt​Fr(ωn/2t​) 单看这个式子并不能看出什么，但是如果无限分治下去就可以得出答案。 IDFT 的实现 本质上是单位根反演，没学那么多也写不了那么详细，直接把式子放在这里： 设 G=DFT(F)G = DFT(F)G=DFT(F) ，则 G[k]=∑i=0n−1(ωnk)iF[i]G[k] = \\sum_{i = 0}^ {n - 1} (\\omega^k_n)^i F[i]G[k]=∑i=0n−1​(ωnk​)iF[i] n⋅F[k]=∑i=0n−1(ωn−k)G[i]n\\cdot F[k] = \\sum_{i = 0}^{n - 1} (\\omega^{-k}_n)G[i] n⋅F[k]=i=0∑n−1​(ωn−k​)G[i] 细节优化 可以发现 DFTDFTDFT 和 IDFTIDFTIDFT 分治起来只差一个负号，所以可以共用一个函数，并附带一个 boolboolbool 型参数。 同时可以发现每个长度为 nnn 的多项式对应的每个点的位置在开始之前都是唯一确定且已知的。所以可以线性预处理一下。 代码实现 P3803 【模板】多项式乘法（FFT） 代码实现 12345678910111213141516171819202122232425262728293031323334353637383940414243444546474849505152535455565758596061626364656667686970717273747576777879// 多项式 学习笔记// Code By CloudySky#include &lt;bits/stdc++.h&gt;// #define int long longconst double Pi = acos(-1);namespace IO &#123;inline int read() &#123; int x = 0, f = 1; char c = getchar(); while (c &lt; &#x27;0&#x27; || c &gt; &#x27;9&#x27;) &#123; if (c == &#x27;-&#x27;) f = -1; c = getchar(); &#125; while (c &gt;= &#x27;0&#x27; &amp;&amp; c &lt;= &#x27;9&#x27;) &#123; x = x * 10 + (c ^ 48); c = getchar(); &#125; return x * f;&#125;void print_n(int x) &#123; if (x &gt; 9) print_n(x / 10); putchar(x % 10 + &#x27;0&#x27;);&#125;inline void print(int x, char s = &#x27;\\n&#x27;) &#123; if (x &lt; 0) putchar(&#x27;-&#x27;), x = -x; print_n(x), putchar(s);&#125;&#125; // namespace IOusing namespace IO;const int Maxn = 1.5e6 + 10;using namespace std;struct CP &#123; double x, y; CP (double tx = 0, double ty = 0) &#123; x = tx, y = ty; &#125; CP operator+ (CP const&amp; B) const &#123; return CP (x + B.x, y + B.y); &#125; CP operator- (CP const&amp; B) const &#123; return CP (x - B.x, y - B.y); &#125; CP operator* (CP const&amp; B) const &#123; return CP (x * B.x - y * B.y, x * B.y + y * B.x); &#125;&#125; f[Maxn &lt;&lt; 1], g[Maxn &lt;&lt; 1];int tr[Maxn &lt;&lt; 1], n, m;void fft (CP *f, bool flag) &#123; for (int i = 0; i &lt; n; ++i) if (i &lt; tr[i]) swap (f[i], f[tr[i]]); for (int p = 2; p &lt;= n; p &lt;&lt;= 1) &#123; int len = p &gt;&gt; 1; CP tG(cos(2 * Pi / p), sin (2 * Pi / p)); if (!flag) tG.y *= -1; for (int k = 0; k &lt; n; k += p) &#123; CP buf(1, 0); for (int l = k; l &lt; k + len; ++l) &#123; CP tt = buf * f[len + l]; f[len + l] = f[l] - tt; f[l] = f[l] + tt; buf = buf * tG; &#125; &#125; &#125;&#125;signed main() &#123; n = read () + 1, m = read () + 1; for (int i = 0; i &lt; n; ++i) scanf (&quot;%lf&quot;, &amp;f[i].x); for (int i = 0; i &lt; m; ++i) scanf (&quot;%lf&quot;, &amp;g[i].x); for (m += n, n = 1; n &lt; m; n &lt;&lt;= 1); for (int i = 0; i &lt; n; ++i) tr[i] = (tr[i &gt;&gt; 1] &gt;&gt; 1) | ((i &amp; 1) ? n &gt;&gt; 1 : 0); fft (f, 1), fft (g, 1); for (int i = 0; i &lt; n; ++i) f[i] = f[i] * g[i]; fft (f, 0); for (int i = 0; i &lt; m - 1; ++i) printf (&quot;%d &quot;, (int) (f[i].x / n + 0.49)); return 0;&#125; 剩余系，原根与 NTTNTTNTT 前置知识略解： 阶：最小的 kkk 满足 ak≡1 mod pa^k \\equiv 1\\bmod pak≡1modp，记为 δpa\\delta_paδp​a 原根：最大的 ggg 满足 δpg=φ(p)\\delta_pg = \\varphi(p)δp​g=φ(p) FFTFFTFFT 好是好，但是由于用到了复数，常数巨大且容易丢精度。 所以就要找一些东西来代替单位根。但是实数域已经找不到可以替代的东西了。但好在大多数时候研究问题是在剩余系中，然后就有东西可以代替了。且一般模数都是 998244353=223⋅7⋅17+1998244353 = 2^{23} \\cdot 7 \\cdot 17 + 1998244353=223⋅7⋅17+1 考虑到原根的性质，可以支持找到一个单位根满足条件，即 gp−1ng^{\\small\\tfrac{p - 1}{n}}gnp−1​ 。 代码实现 代码实现： 1234567891011121314151617181920212223242526// 多项式 学习笔记// NTT 多项式转换void ntt (int *g, int n, bool op) &#123; static ull f[Maxn &lt;&lt; 1]; // 用宏定义来避免命名冲突 tpre (n); // 预处理顺序 for (int i = 0; i &lt; n; ++i) f[i] = g[tr[i]]; // 调整数组顺序 for (int p = 2; p &lt;= n; p &lt;&lt;= 1) &#123; int len = p &gt;&gt; 1; ull tG = Pow (op ? G : invG, (P - 1) / p); for (int k = 0; k &lt; n; k += p) &#123; int buf = 1; for (int l = k; l &lt; k + len; ++l) &#123; int tt = buf * f[l | len] % P; f[l | len] = (f[l] - tt + P) % P; f[l] = (f[l] + tt + P) % P; buf = buf * tG % P; &#125; &#125; &#125; if (op == 0) &#123; // 根据 DFT 还是 IDFT 来进行下一步操作 ull invn = Pow (n); for (int i = 0; i &lt; n; ++i) g[i] = f[i] * invn % P; &#125; else for (int i = 0; i &lt; n; ++i) g[i] = f[i] % P;&#125; 多项式的求导，积分 一定要记住，这两个的结果都是一个多项式，而不是一个值 多项式求导（通俗理解就是求斜率） 它的数学求法为 ∀x1,x2∈M,令Δx=x2−x1,则f′(x1)=f(x1+Δx)−f(x1)Δx\\forall x1, x2 \\in M , \\text{令} \\Delta x = x2 - x1, \\text{则} f&#x27;(x1) = \\dfrac{f(x1 + \\Delta x) - f(x1)}{\\Delta x}∀x1,x2∈M,令Δx=x2−x1,则f′(x1)=Δxf(x1+Δx)−f(x1)​ 用系数就是： F′(x)=∑i=0F[i]xi⋅ix⇒F′(x)=∑i=0F[i]xi−1⋅iF&#x27;(x) = \\sum_{i = 0} F[i]x^i\\cdot \\dfrac{i}{x} \\\\ \\Rightarrow F&#x27;(x) = \\sum_{i = 0} F[i]x^{i - 1}\\cdot i F′(x)=i=0∑​F[i]xi⋅xi​⇒F′(x)=i=0∑​F[i]xi−1⋅i 可以得出的结论是一个 nnn 次多项式的导数是一个 n−1n - 1n−1 次多项式。 多项式积分（通俗理解就是求面积） ∫(x)=C+∑i=0F[i]xi⋅xi⇒∫(x)=C+∑i=0F[i]xi+1i\\int(x) = C + \\sum_{i = 0}F[i]x^i \\cdot \\dfrac{x}{i} \\\\ \\Rightarrow\\int(x) = C + \\sum_{i = 0} \\dfrac{F[i]x^{i + 1}}{i} ∫(x)=C+i=0∑​F[i]xi⋅ix​⇒∫(x)=C+i=0∑​iF[i]xi+1​ 更好地理解 如果上面不理解，可以类比一下物理学 x−t，v−t,a−tx - t， v - t, a - tx−t，v−t,a−t 关系式。 一个 v−tv - tv−t 关系式的积分是 x−tx - tx−t 关系式，导数是 a−ta - ta−t 关系式。如果 v−tv - tv−t 为 1 次，那么 x−tx - tx−t 为 2 次；如果 v−tv - tv−t 关系式为 2 次，那么 a−ta - ta−t 为 1 次。 代码实现 代码实现： 12345678910111213// 多项式 学习笔记// 多项式求导void der (int *f, int n) &#123; for (int i = 1; i &lt; n; ++i) &#123; f[i - 1] = 1ll * f[i] * i % P; &#125; f[n - 1] = 0;&#125;// 多项式积分void inte (int *f, int n) &#123; for (int i = n; i; --i) &#123; f[i] = 1ll * f[i - 1] * Pow (i, P - 2) % P; &#125; f[0] = 0;&#125; 多项式的复合 - 牛顿迭代 这个东西不会证。他不是某个函数，更像是帮你推导式子的一种工具，需要配合倍增使用。 具体来说就是当 GGG 已知且 G(f(x))=0G(f(x)) = 0G(f(x))=0 时，F(x) \\equiv F_\\*(x) - \\dfrac{G(F_\\*(x))}{G'(F_\\*(x))}\\bmod x^n 。 其中 F_\\*(x) 表示上一次倍增的结果，界为 F(x)F(x)F(x) 的 12\\dfrac{1}{2}21​ 的多项式，GGG 一般是构造出来的。 多项式求逆 这个东西有三种求法：朴素求法，倍增大力推式子，倍增牛顿迭代。 朴素求法 考虑逆元的性质，设 F(x)F(x)F(x) 为已知多项式 G(x)G(x)G(x) 为要求的逆多项式。 C(k)=∑i=0kF[i]G[k−i]C(k) = \\sum_{i = 0}^k F[i]G[k - i] C(k)=i=0∑k​F[i]G[k−i] 只有 CCC 的第 000 位为 1 。即当目前不是常数时 ∑i=0nF[i]G[n−i]=0\\sum_{i = 0}^n F[i]G[n - i] = 0 i=0∑n​F[i]G[n−i]=0 将 F[0]G[n]F[0]G[n]F[0]G[n] 单拎出来， ∑i=1nF[i]G[n−i]+F[0]G[n]=0\\sum_{i = 1}^n F[i]G[n - i] + F[0]G[n] = 0 i=1∑n​F[i]G[n−i]+F[0]G[n]=0 移向消元： G[n]=−1F[0]⋅∑i=1nF[i]G[n−i]G[n] = -\\dfrac{1}{F[0]}\\cdot \\sum_{i = 1}^n F[i]G[n - i] G[n]=−F[0]1​⋅i=1∑n​F[i]G[n−i] 这样每次求末项，逐步求出的多项式 GGG 就是 FFF 的逆多项式。 倍增解法 考虑当前要求界为 nnn 意义下的逆多项式 R(x)R(x)R(x) ，已经求出了界为 n2\\dfrac{n}{2}2n​ 的逆多项式 R_\\*(x) 。 则当前两个多项式满足 R(x)≡R∗(x) mod xn2R(x) \\equiv R_*(x)\\bmod x^{\\tfrac{n}{2}} R(x)≡R∗​(x)modx2n​ 移项 R(x)−R∗(x)≡0 mod xn2R(x) - R_*(x) \\equiv 0 \\bmod x^ {\\tfrac{n}{2}} R(x)−R∗​(x)≡0modx2n​ 乘方，扩界 (R(x)−R∗(x))2≡0 mod xn(R(x) - R_*(x))^2 \\equiv 0 \\bmod x^n (R(x)−R∗​(x))2≡0modxn 拆括号，移相，两边同乘 F(x)F(x)F(x) R(x)≡2R∗(x)−R∗2F(x) mod xnR(x) \\equiv 2R_*(x) - R_*^2F(x) \\bmod x^n R(x)≡2R∗​(x)−R∗2​F(x)modxn 牛顿迭代解法 这个方法推出来的式子和上面是一样的，只是换一种推导思路而已。 F(x)R(x)−1≡0 mod PF(x)R(x) - 1 \\equiv 0 \\bmod P F(x)R(x)−1≡0modP 设 F(x)R(x)−1F(x)R(x) - 1F(x)R(x)−1 为 GGG ， 其中 F(x)F(x)F(x) 已知，可以作为一个系数。下面逐步推导即可。 代码实现 代码实现： 1234567891011121314151617181920212223// 多项式 学习笔记// 多项式求逆void invp (int *f, int n) &#123; int m = n; static int w[Maxn &lt;&lt; 1], r[Maxn &lt;&lt; 1]; for (n = 1; n &lt; m; n &lt;&lt;= 1); w[0] = Pow (f[0]); for (int len = 2; len &lt;= n; len &lt;&lt;= 1) &#123; for (int i = 0; i &lt; (len &gt;&gt; 1); ++i) r[i] = w[i]; cpy (sav, f, len); ntt (sav, len, 1), ntt (r, len, 1); px (r, sav, len), ntt (r, len, 0); clear (r, 0, len &gt;&gt; 1); cpy (sav, w, len); ntt (sav, len, 1), ntt (r, len, 1); px (r, sav, len), ntt (r, len, 0); for (int i = len &gt;&gt; 1; i &lt; len; ++i) w[i] = (2ll * w[i] - r[i] + P) % P; &#125; cpy (f, w, m); clear (sav, 0, n), clear (w, 0, n), clear (r, 0, n);&#125; 本文作者：CloudySky 写作时间： 2022-01-09 最后更新时间： 2022-01-09 遵循协议： BY-NC-SA","tags":"数学"},{"title":"整体二分 学习笔记","url":"/Blog/Overall-Dichotomy/","text":"整体二分可以实现的功能相较于 CDQ 分治来说就比较局限了，它可以实现 动态区间第 kkk 小。 思想大概是通过不断地二分值域，最终将每个操作归到一个点上，当前点即为查询的答案。 实质上就是将 nnn 个二分同时进行。 对操作进行重排时使用两个临时数组进行辅助。 具体实现： 将所有的插入、修改和查询操作放在同一个结构体数组中。结构体维护一下几个信息： tptptp - 当前操作的性质；修改为 0 ，查询为 1 p,v,xp, v, xp,v,x - 如果当前操作为修改，ppp 表示要修改的位置，vvv 表示&quot;变化&quot;的值， xxx 表示加（1）减（-1）。 id,l,r,kid, l, r, kid,l,r,k - 如果当前操作为查询，ididid 表示当前操作作为一个询问的编号，要找 [l,r][l, r][l,r] 中第 kkk 小。 插入和查询没什么可写的。修改转化为先删除再插入即可。 每次二分值域，**依次（顺序很重要）**枚举当前值域区间所有的操作，归为一下 4 类： 修改，要修改的权值小于 midmidmid ，将要修改的位置在树状数组上打标记。同时将当前操作插入左区间临时数组。 修改，要修改的权值大于 midmidmid ，直接放在右区间临时数组即可。 查询，kkk 值小于左区间所有已经放入的值 sss，他要找的答案一定在左区间，直接插入左区间。 查询，kkk 值大于左区间所有已经放入的值 sss，答案一定在右区间，查询右区间 k−sk - sk−s 值。 对树状数组进行恢复，合并回主数组，进行下一次分治。 这段意思是，统计某次查询前左区间数的个数，然后进行类似二分的套路操作。 代码实现： 1234567891011121314151617181920212223242526272829303132333435363738394041424344454647484950515253545556575859606162636465666768697071727374757677787980818283848586// 整体二分 学习笔记// Code By CloudySky#include &lt;bits/stdc++.h&gt;// #define int long longnamespace IO // namespace IOusing namespace IO;const int Maxn = 2e5 + 10, inf = (1 &lt;&lt; 30);using namespace std;namespace BIT &#123;int v[Maxn];void add (int x, int val) &#123; for (; x &lt; Maxn; x += (x &amp; -x)) v[x] += val;&#125;int ask (int x, int ans = 0) &#123; for (; x; x -= (x &amp; -x)) ans += v[x]; return ans;&#125;&#125; // namespace BITusing namespace BIT;struct node &#123; int tp; // 用来标记操作类型 int p, v, x; // 用来维护修改操作 int id, l, r, k; // 用来维护查询操作&#125; q[Maxn &lt;&lt; 1], q1[Maxn &lt;&lt; 1], q2[Maxn &lt;&lt; 1];int tot, tq, ans[Maxn], a[Maxn];void solve (int l, int r, int ql, int qr) &#123; if (l &gt; r || ql &gt; qr) return; // 判断不合法区间 if (l == r) &#123; // 已经将范围缩至某一确定点 for (int i = ql; i &lt;= qr; ++i) // 遍历所有操作 if (q[i].tp) // 判断是否为查询 ans[q[i].id] = l; // 统计答案 return; &#125; int mid = (l + r) &gt;&gt; 1, c1 = 0, c2 = 0; for (int i = ql; i &lt;= qr; ++i) &#123; if (q[i].tp) &#123; int s = ask (q[i].r) - ask (q[i].l - 1); if (q[i].k &lt;= s) // 类型 3 q1[++c1] = q[i]; else // 类型 4 q[i].k -= s, q2[++c2] = q[i]; &#125; else &#123; // 这里不要把 v 和 p 搞反 if (q[i].v &lt;= mid) // 类型 1 q1[++c1] = q[i], add (q[i].p, q[i].x); else q2[++c2] = q[i]; // 类型 2 &#125; &#125; for (int i = 1; i &lt;= c1; ++i) // 恢复现场 if (!q1[i].tp) add (q1[i].p, -q1[i].x); for (int i = 1; i &lt;= c1; ++i) // 合并数组 q[i + ql - 1] = q1[i]; for (int i = 1; i &lt;= c2; ++i) q[i + ql + c1 - 1] = q2[i]; solve (l, mid, ql, ql + c1 - 1); // 进行下一步分治 solve (mid + 1, r, ql + c1, qr);&#125;signed main() &#123; int n = read (), m = read (); for (int i = 1; i &lt;= n; ++i) q[++tot] = (node) &#123;0, i, a[i] = read (), 1&#125;; for (int i = 1, l, r, k; i &lt;= m; ++i) &#123; char c; cin &gt;&gt; c; if (c == &#x27;Q&#x27;) &#123; l = read (), r = read (), k = read (); q[++tot] = (node) &#123;1, 0, 0, 0, ++tq, l, r, k&#125;; &#125; else &#123; int x = read (), y = read (); q[++tot] = (node) &#123;0, x, a[x], -1&#125;; // 这里及时修改 a 数组的值 q[++tot] = (node) &#123;0, x, a[x] = y, 1&#125;; &#125; &#125; solve (-inf, inf, 1, tot); for (int i = 1; i &lt;= tq; ++i) print (ans[i]); return 0;&#125; 本文作者：CloudySky 写作时间： 2021-12-29 最后更新时间： 2021-12-29 遵循协议： BY-NC-SA","tags":"分治"},{"title":"CDQ分治 学习笔记","url":"/Blog/CDQ/","text":"CDQ 分治是 OI 中一个比较常用的分治算法。模板的实现较为简单，重点在于领会思想。 CDQ 分治用来解决点对三维偏序问题 点对的三位偏序可以表示为 有 nnn 个元素，第 iii 个元素有 ai,bi,cia_i,b_i,c_iai​,bi​,ci​ 三个属性，设 f(i)f(i)f(i) 表示满足 aj≤aia_j \\leq a_iaj​≤ai​ 且 bj≤bib_j \\leq b_ibj​≤bi​ 且 cj≤cic_j \\leq c_icj​≤ci​ 且 j≠ij \\ne ij=i 的 jjj 的数量。求 fif_{i}fi​ 。 先假设没有相同的元素，具体实现： 将整个数组按照 aia_iai​ 排序，开始递归。 将当前区间二分，左右两边分别按照 bib_ibi​ 排序。 现在考虑左边的所有数字 aia_iai​ 一定小于右边，这是在分治开始之前就已经确定好的。 然后由于你在左右分别按照第二维排序了，所以第二维也分别是有序的。 所以就可以在左右分别维护一个指针 pl,prpl, prpl,pr 。 枚举 pr∈[mid+1,r]pr \\in[mid + 1, r]pr∈[mid+1,r] 。 跳 pl∈[l,mid]pl\\in[l, mid]pl∈[l,mid] 使 bpl&lt;bprb_{pl} &lt; b_{pr}bpl​&lt;bpr​ 始终成立，同时将已经扫过的 cplc_{pl}cpl​ 插入树状数组。 每次当 plplpl 不能再跳时统计 prprpr 贡献 anspr+=ask(cpr)ans_{pr} += ask (c_{pr})anspr​+=ask(cpr​) ，即第三维也比当前数字小的数。 枚举 i∈[l,pl]i\\in[l, pl]i∈[l,pl] ，在树状数组上消除贡献。 由于你的前两维已经确定了，所以只要第三维也比当前数小的话，就一定满足条件。 由于以上整个过程都处于分治过程中，所以一定可以保证不重不漏。 另外，如果要在递归之前排序的话，一定要建临时数组，否则递归回出错； 也可以先递归，然后进行操作，最后将当前整段区间进行排序，以便父层使用，最后分治完再将序列排回原样。 两种写法更推荐后者，排序没有过多的复杂度浪费。 P3810 【模板】三维偏序（陌上花开） 代码实现： 12345678910111213141516171819202122232425262728293031323334353637383940414243444546474849505152535455565758596061626364656667686970717273747576777879808182838485// CDQ 分治 学习笔记// Code By CloudySky#include &lt;bits/stdc++.h&gt;// #define int long longnamespace IO // namespace IOusing namespace IO;const int Maxn = 2e5 + 10;using namespace std;#define lowbit(x) x &amp; -xint v[Maxn];void add (int x, int val) &#123; for (; x &lt;= Maxn; x += lowbit(x)) v[x] += val;&#125;int ask (int x) &#123; int ans = 0; for (; x; x -= lowbit (x)) ans += v[x]; return ans;&#125;struct node &#123; int x, y, z, f; bool operator &lt; (const node b) const &#123; if (x != b.x) return x &lt; b.x; if (y != b.y) return y &lt; b.y; if (z != b.z) return z &lt; b.z; return f &lt; b.f; &#125; bool operator == (const node b) const &#123; if (x != b.x) return false; if (y != b.y) return false; if (z != b.z) return false; return true; &#125;&#125; a[Maxn];bool cmp (node &amp;n, node &amp;m) &#123; if (n.y != m.y) return n.y &lt; m.y; return n.z &lt; m.z;&#125;int d[Maxn], n, k;void solve (int l, int r) &#123; if (l &gt;= r) return; int mid = (l + r) &gt;&gt; 1; solve (l, mid), solve (mid + 1, r); int pos1 = l, pos2 = mid + 1; for (; pos2 &lt;= r; ++pos2) &#123; while (a[pos1].y &lt;= a[pos2].y &amp;&amp; pos1 &lt;= mid) &#123; add (a[pos1].z, 1), pos1 ++; &#125; a[pos2].f += ask (a[pos2].z); &#125; for (int i = l; i &lt; pos1; ++i) &#123; add (a[i].z, -1); &#125; sort (a + l, a + r + 1, cmp);&#125;signed main() &#123; n = read (), k = read (); for (int i = 1; i &lt;= n; ++i) &#123; a[i] = (node) &#123;read (), read (), read ()&#125;; &#125; sort (a + 1, a + n + 1); solve (1, n); sort (a + 1, a + n + 1); int lst = n; for (int i = n - 1; i &gt;= 1; --i) &#123; if (a[i] == a[lst]) a[i].f = a[lst].f; else lst = i; &#125; for (int i = 1; i &lt;= n; ++i) &#123; d[a[i].f] ++; &#125; for (int i = 0; i &lt; n; ++i) &#123; print (d[i]); &#125; return 0;&#125; 本文作者：CloudySky 写作时间： 2021-12-29 最后更新时间： 2021-12-29 遵循协议： BY-NC-SA","tags":"分治"},{"title":"2021-12-26 模拟赛总结","url":"/Blog/solution-2021-12-26/","text":" 输入密码来证明你不是卷王","tags":"dp 数据结构 题解 test 贪心"},{"title":"P1972 [SDOI2009]HH的项链","url":"/Blog/p1972/","text":"P1972 [SDOI2009]HH的项链 题目大意： 给定一个长度为 nnn 的序列 a1,a2,…,ana_1, a_2, …, a_na1​,a2​,…,an​ ，和 mmm 组询问， 每次给定 l,rl, rl,r ，求区间 [l,r][l, r][l,r] 中不同的数字有几种。 题目正解： 可持久化线段树 题目思路： 可持久化线段树不同于主席树的用法。 注意到这道题题目唯一的难点在于不同的数字，所以可以考虑对相同的数字消除贡献。 最简单有效的方法就是只留下每种数字最后出现的位置的贡献， 但同时又要保证上一次的贡献在这一次贡献出现前不被消除。 所以考虑每次更新某个数 aia_iai​，如果之前出现过，直接在 i−1i - 1i−1 版本消除贡献，紧跟着将这次的贡献加进来。 这样在每个点构造的线段树都是一个 aaa 序列前缀的，每个数字只会在最后出现的位置被统计到的独立线段树。 所以查询答案时，直接在 RRR 版本的线段树上，查询 [L,R][L, R][L,R] 区间和即可。 时间复杂度： O(nlogn)O(nlogn)O(nlogn) 题目代码： 12345678910111213141516171819202122232425262728293031323334353637383940414243444546474849505152535455565758// Code By CloudySky#include &lt;bits/stdc++.h&gt;// #define int long longnamespace IO // namespace IOusing namespace IO;const int Maxn = 1e6 + 10;using namespace std;struct Stree &#123; int ls, rs, val;#define ls(x) St[x].ls#define rs(x) St[x].rs#define v(x) St[x].val&#125; St[Maxn &lt;&lt; 6];int rt[Maxn], tot;int add (int p, int l, int r, int v, int k) &#123; int np = ++tot; St[np] = St[p], v(np) += k; if (l == r) return np; int mid = (l + r) &gt;&gt; 1; if (v &lt;= mid) ls(np) = add (ls(p), l, mid, v, k); else rs(np) = add (rs(p), mid + 1, r, v, k); return np;&#125;int ask (int p, int l, int r, int v) &#123; if (l == r) return v(p); int mid = (l + r) &gt;&gt; 1; if (v &lt;= mid) return ask (ls(p), l, mid, v) + v(rs(p)); else return ask (rs(p), mid + 1, r, v);&#125;int lst[Maxn];signed main() &#123; int n = read (); for (int i = 1, tmp, v; i &lt;= n; ++i) &#123; v = read (); if (!lst[v]) rt[i] = add (rt[i - 1], 1, n, i, 1); else tmp = add (rt[i - 1], 1, n, lst[v], -1), rt[i] = add (tmp, 1, n, i, 1); lst[v] = i; &#125; int m = read (); for (int i = 1; i &lt;= m; ++i) &#123; int l = read (), r = read (); print (ask (rt[r], 1, n, l)); &#125; return 0;&#125; 本文作者：CloudySky 写作时间： 2021-12-25 最后更新时间： 2021-12-25 遵循协议： BY-NC-SA","tags":"数据结构 题解"},{"title":"NOIP2021 游记及题解","url":"/Blog/NOIP2021/","text":" 输入密码来证明你不是卷王","tags":"生活"},{"title":"P4302 [SCOI2003]字符串折叠","url":"/Blog/p4302/","text":"P4302 [SCOI2003]字符串折叠 题目大意： 给定一个字符串，每次可以将一个循环子串 SSS…SSSS… SSSS…S 折叠为 n(S)n(S)n(S) 。求进行多次折叠后最短长度。 n≤100n \\le 100n≤100 题目正解： 区间 DP 题目思路： 考虑区间 DP，设 fl,rf_{l, r}fl,r​ 表示 [l,r][l, r][l,r] 内折叠后的最小长度。 先按照区间 DP 常用套路，枚举断点来进行合并，如果判定枚举的当前字串是循环子串，更新 DP 数组为 fl,r=min⁡(fl,r,numlen+fl,l+k−1+2)f_{l,r} = \\min(f_{l,r}, numlen + f_{l, l + k - 1} + 2)fl,r​=min(fl,r​,numlen+fl,l+k−1​+2) 。 其中 k 为循环节长度，注意这里是循环节的DP 数组， 而不是循环节长度，因为可能会出现嵌套折叠的情况，如：ABABCABCABCABABCABCABCAB ABC ABC ABC AB ABC ABC ABCABABCABCABCABABCABCABC 会折叠为 2(AB3(ABC))2(AB3(ABC))2(AB3(ABC))。 numlen 为循环节个数的数字长度，2 为括号长度。 取最小值是因为折叠之后不一定比之前优，如：AAAAAA 长度为 2，折叠之后 2(A)2(A)2(A) 长度为 4。 进行判定时可以用 Hash 来比对，但由于本题数据范围较小，直接暴力扫描也是可以的。 时间复杂度： O(n4)O(n^4)O(n4) 或 O(n3)O(n^3)O(n3) 题目代码： 1234567891011121314151617181920212223242526272829303132333435363738394041424344454647484950515253// Code By CloudySky#include &lt;bits/stdc++.h&gt;namespace IO // 快读const int Maxn = 110;using namespace std;char s[Maxn], tmp[Maxn];int len[Maxn], f[Maxn][Maxn];bool check (int l, int r, int k) &#123; // 这里保留扫描判循环节。 if ((r - l + 1) % k != 0) return false; for (int i = 1; i &lt;= k; ++i) tmp[i] = s[l + i - 1]; for (int i = l; i &lt;= r; i += k) &#123; for (int j = 1; j &lt;= k; ++j) if (tmp[j] != s[i + j - 1]) return false; &#125; return true;&#125;signed main() &#123; // 预处理数字长度 len[1] = 1; for (int i = 2, p = 10; i &lt;= 100; ++i) &#123; len[i] = len[i - 1]; if (i == p) len[i]++, p *= 10; &#125; // 读入 cin &gt;&gt; (s + 1); int n = strlen (s + 1); // 初始化 DP 数组 for (int i = 1; i &lt;= n; ++i) &#123; for (int j = 1; j &lt;= n; ++j) f[i][j] = 100; &#125; for (int i = 1; i &lt;= n; ++i) f[i][i] = 1; // 区间 DP 过程 for (int Len = 1; Len &lt;= n; ++Len) &#123; for (int l = 1; (l + Len - 1) &lt;= n; ++l) &#123; int r = l + Len - 1; // 子段间合并 for (int k = l; k &lt;= r; ++k) f[l][r] = min (f[l][r], f[l][k] + f[k + 1][r]); // 处理循环 for (int k = 1; k &lt; r - l + 1; ++k) &#123; if (check (l, r, k)) f[l][r] = min (f[l][r], len[(r - l + 1) / k] + f[l][l + k - 1] + 2); &#125; &#125; &#125; printf (&quot;%d &quot;, f[1][n]); return 0;&#125; 本文作者：CloudySky 写作时间： 2021-12-19 最后更新时间： 2021-12-19 遵循协议： BY-NC-SA","tags":"dp 题解"},{"title":"2021-12-12 模拟赛总结","url":"/Blog/solution-2021-12-12/","text":" 输入密码来证明你不是卷王","tags":"数据结构 数学 题解 test 搜索"},{"title":"数论初步 学习笔记","url":"/Blog/Number-Theory/","text":"这篇博客仍然很不完整，性质和性质的证明仍没有完全注明。 卷积与乘法卷积 卷积通俗理解就是求三个函数关系的式子。常见的有加法卷积和乘法卷积，又称狄利克雷卷积。 加法卷积的公式为： g(n)=∑i=1nf(i)×h(n−i)g(n) = \\sum_{i = 1}^n f(i) \\times h(n - i) g(n)=i=1∑n​f(i)×h(n−i) 但它不在这次的研究范围内。 乘法卷积的公式为： g(n)=∑d∣nf(d)×h(n/d)g(n) = \\sum_{d|n} f(d) \\times h(n/d) g(n)=d∣n∑​f(d)×h(n/d) 为什么数论函数会和这个东西有关系呢？ 因为它的求和条件 d∣nd|nd∣n 会产生许多性质。 先来说明三个和卷积有关的函数。 ε\\varepsilonε 函数，又称元函数。定义式： ε(1)=1,ε(n)=0(n≠1)\\varepsilon(1) = 1, \\varepsilon(n) = 0 (n \\ne 1)ε(1)=1,ε(n)=0(n=1) III 函数，又称恒等函数。定义式： I(n)=1I(n) = 1I(n)=1 IdIdId 函数，又称单位函数。定义式： Id(n)=nId(n) = nId(n)=n 这三个函数是乘法卷积的基本函数，接下来只需要用他们 瞎搞 进行一些推算。 欧拉函数 简单性质 与乘法卷积的关系： φ∗I=Id\\varphi * I = Idφ∗I=Id 即 ∑d∣nφ(d)=n\\sum_{d|n} \\varphi(d) = n∑d∣n​φ(d)=n 也就是欧拉反演。 因为这个性质，欧拉函数经常被用来求解有关 gcd 的问题。 证明需要用到等比数列求和公式和积性函数的性质。 运用算术基本定理求 φ\\varphiφ n=p1c1p2c2…pmcmn = p_1^{c_1}p_2^{c_2}\\dots p_m^{c_m} n=p1c1​​p2c2​​…pmcm​​ φ(n)=n×(p1−1)/p1×(p2−1)/p2×⋯×(pm−1)/pm=n×∏质数p∣n(1−1/p)\\varphi(n) = n \\times (p_1-1)/p_1 \\times (p_2-1)/p_2\\times \\dots \\times (p_m-1)/p_m = n\\times \\prod_{\\text{质数}p|n}(1-1/p) φ(n)=n×(p1​−1)/p1​×(p2​−1)/p2​×⋯×(pm​−1)/pm​=n×质数p∣n∏​(1−1/p) 证明需要用到容斥原理。且根据这个式子，可以推得 φ\\varphiφ 是一个积性函数，即当 gcd(n,m)=1gcd(n,m) = 1gcd(n,m)=1 成立时，φ(nm)=φ(n)×φ(m)\\varphi(nm) = \\varphi(n)\\times\\varphi(m)φ(nm)=φ(n)×φ(m) 如果 p1∣np_1 | np1​∣n 且 p12∣np_1 ^ 2 | np12​∣n ，则 φ(n)=φ(n/p1)×p1\\varphi(n) = \\varphi(n/p_1) \\times p_1φ(n)=φ(n/p1​)×p1​ ； 证明： 令 n′=n/pn&#x27; = n / pn′=n/p, 由 p2∣np ^ 2 | np2∣n 可知 p∣n′p | n&#x27;p∣n′。 根据定义式 φ(n′)=n′×∏质数p∣n(1−1/p)\\varphi(n&#x27;) = n&#x27; \\times \\prod_{\\text{质数}p|n}(1-1/p) φ(n′)=n′×质数p∣n∏​(1−1/p) ∵p1∈p\\because p_1 \\in p ∵p1​∈p ∴φ(n′p1)=n′×∏质数p∣n(1−1/p)×p=φ(n′)×p1\\therefore \\varphi(n&#x27;p_1) = n&#x27;\\times \\prod_{\\text{质数}p|n}(1-1/p) \\times p = \\varphi(n&#x27;) \\times p_1 ∴φ(n′p1​)=n′×质数p∣n∏​(1−1/p)×p=φ(n′)×p1​ 如果 p∣np|np∣n 且 p2∤np^2\\nmid np2∤n ，则 φ(n)=φ(n/p)×φ(p)=φ(n/p)×(p−1)\\varphi(n) = \\varphi(n/p) \\times \\varphi(p) = \\varphi(n/p) \\times (p - 1)φ(n)=φ(n/p)×φ(p)=φ(n/p)×(p−1) 这个两个性质要在线性筛求 φ\\varphiφ 时用到。 证明： 令 n′=n/pn&#x27; = n / pn′=n/p，由 p2∤np^2\\nmid np2∤n 可知 gcd(p,n′)=1gcd (p, n&#x27;) = 1gcd(p,n′)=1。 根据积性函数定义 φ(n′p)=φ(n′)×φ(p)\\varphi(n&#x27;p) = \\varphi(n&#x27;) \\times \\varphi(p)φ(n′p)=φ(n′)×φ(p) 。 线性筛求 φ\\varphiφ 时间复杂度：O(n)O(n)O(n) 这种算法主要应用于求一段比较连续的区间的 φ\\varphiφ 函数。需要用到性质 3, 4 。 具体实现： 利用欧拉筛在求素数的同时，枚举的 pjp_jpj​ 相当于上文的 p1p_1p1​, iii 为 n′n&#x27;n′, i×pji \\times p_ji×pj​ 即为 nnn 。 代码实现： 12345678910111213141516171819// 数论初步 学习笔记// 线性筛求 φ 具体实现void prime ( int n ) &#123; int cnt = 0; phi[1] = 1; for ( int i = 2; i &lt;= n; ++i ) &#123; if ( ! book[i] ) &#123; book[i] = i; p[++cnt] = i; phi[i] = 1ll * ( i - 1 ); &#125; for ( int j = 1; j &lt;= cnt; ++j ) &#123; if ( p[j] &gt; book[i] || i * p[j] &gt; n ) break; book[i*p[j]] = p[j]; phi[i*p[j]] = 1ll * phi[i] * p[j]; if ( i % p[j] ) phi[i*p[j]] -= phi[i]; &#125; &#125; return; &#125; 因式分解求 φ\\varphiφ 时间复杂度：O(logn)O(logn)O(logn) 这种算法一般应用于用到 φ\\varphiφ 次数较少的时候。 具体实现： 也要利用算数基本定理，通过对 n 进行因式分解，很直接地求出 φ\\varphiφ 函数。 代码实现： 12345678910111213// 数论初步 学习笔记// 因式分解求 φ 具体实现long long phi ( int n ) &#123; ll ans = n; for ( ll i = 2; i * i &lt;= n; ++i ) &#123; if ( n % i == 0 ) ans = ans / i * ( i - 1 ); while ( n % i == 0 ) n /= i; &#125; if ( n &gt; 1 ) ans = ans / n * ( n - 1 ); return ans;&#125; φ\\varphiφ 函数求解有关 gcdgcdgcd 问题 一道经典例题就是 ∑i=1n∑i=1ngcd(i,j)\\sum_{i=1}^n\\sum_{i=1}^n gcd(i,j)∑i=1n​∑i=1n​gcd(i,j) 。 具体实现： 这时候我们就要用到 φ\\varphiφ 的性质，∑φ(d)=n\\sum \\varphi(d) = n∑φ(d)=n ，将这个式子化简为： ∑i=1n∑i=1n∑d∣gcd(i,j)φ(d)\\sum_{i=1}^n\\sum_{i=1}^n \\sum_{d|gcd(i,j)}\\varphi(d) i=1∑n​i=1∑n​d∣gcd(i,j)∑​φ(d) 然后可以改变 ∑\\sum∑ 的顺序，变成： ∑d∑i=1⌊n/d⌋∑i=1⌊n/d⌋φ(d)\\sum_d\\sum_{i=1}^{\\left\\lfloor n/d \\right\\rfloor}\\sum_{i=1}^{\\left\\lfloor n/d\\right\\rfloor} \\varphi(d) d∑​i=1∑⌊n/d⌋​i=1∑⌊n/d⌋​φ(d) 然后就可以利用整数分块和前缀和解决这道题。 P2398 GCD SUM 代码实现： 123456789101112131415161718192021222324252627282930313233343536373839404142// 数论初步 学习笔记#include &lt;cstdio&gt;#include &lt;iostream&gt;#define ll long long#define int long long const int Maxn = 2e6 + 10;using namespace std;int p[Maxn], book[Maxn];ll phi[Maxn], sum[Maxn];void prime ( int n ) &#123; int cnt = 0; phi[1] = 1; for ( int i = 2; i &lt;= n; ++i ) &#123; if ( ! book[i] ) &#123; book[i] = i; p[++cnt] = i; phi[i] = 1ll * ( i - 1 ); &#125; for ( int j = 1; j &lt;= cnt; ++j ) &#123; if ( p[j] &gt; book[i] || i * p[j] &gt; n ) break; book[i*p[j]] = p[j]; phi[i*p[j]] = 1ll * phi[i] * p[j]; if ( i % p[j] ) phi[i*p[j]] -= phi[i]; else break; &#125; &#125; for ( int i = 1; i &lt;= n; ++i ) &#123; sum[i] = 1ll * ( sum[i-1] + phi[i] ); &#125; return; &#125;signed main ( void ) &#123; int n; ll ans = 0; scanf ( &quot;%lld&quot;, &amp;n ); prime ( n ); for ( int d = 1, r; d &lt;= n; d = r + 1 ) &#123; int t = n / d; r = n / t; ans += t * t * ( sum[r] - sum[d-1] ); &#125; printf (&quot;%lld\\n&quot;, ans ); return 0;&#125; 莫比乌斯函数 简单性质 与乘法卷积的关系： μ∗I=ε\\mu * I = \\varepsilonμ∗I=ε 即 ∑d∣nμ(d)=[n==1]\\sum_{d|n} \\mu(d) = [n == 1]∑d∣n​μ(d)=[n==1] 也就是莫比乌斯反演。这个东西和上面欧拉函数的式子挺像的。其实它俩的用途也差不多。 如果 p∣np | np∣n 并且 p2∣np ^ 2 | np2∣n ， μ(n)=−μ(p)\\mu(n) = -\\mu(p)μ(n)=−μ(p) ； 如果 p∣np | np∣n 并且 p2∤np ^ 2 \\nmid np2∤n ， μ(n)=0\\mu(n) = 0μ(n)=0 。 线性筛求 μ\\muμ 和求 φ\\varphiφ 类似。 12345678910111213141516// 数论初步 学习笔记// 线性筛求 μ 具体实现void prime (int n) &#123; mu[1] = 1; for (int i = 2; i &lt;= n; ++i) &#123; if (!vis[i]) &#123; vis[i] = i, p[++cnt] = i, mu[i] = -1; &#125; for (int j = 1; j &lt;= cnt; ++j) &#123; if (i * p[j] &gt; n || p[j] &gt; vis[i]) break; vis[i * p[j]] = p[j]; if (i % p[j]) mu[i * p[j]] = -mu[i]; &#125; &#125;&#125; 莫比乌斯反演 ∑i=1n∑j=1m[gcd(i,j)==t]\\sum_{i = 1} ^ n \\sum_{j = 1} ^ m [gcd (i, j) == t] i=1∑n​j=1∑m​[gcd(i,j)==t] 一个比较经典的应用。 具体实现： ∑i=1⌊n/t⌋∑j=1⌊m/t⌋[gcd(i,j)==1]\\sum_{i = 1} ^ {\\left\\lfloor n/t \\right\\rfloor} \\sum_{j = 1} ^ {\\left\\lfloor m/t \\right\\rfloor} [gcd (i, j) == 1] i=1∑⌊n/t⌋​j=1∑⌊m/t⌋​[gcd(i,j)==1] ∑i=1⌊n/t⌋∑j=1⌊m/t⌋∑d∣gcd(i,j)μ(d)\\sum_{i = 1} ^ {\\left\\lfloor n/t \\right\\rfloor} \\sum_{j = 1} ^ {\\left\\lfloor m/t \\right\\rfloor} \\sum_{d | gcd(i, j)} \\mu(d) i=1∑⌊n/t⌋​j=1∑⌊m/t⌋​d∣gcd(i,j)∑​μ(d) 交换求和顺序 ∑d∑i=1⌊n/dt⌋∑j=1⌊m/dt⌋μ(d)\\sum_d \\sum_{i = 1} ^ {\\left\\lfloor n/dt \\right\\rfloor} \\sum_{j = 1} ^ {\\left\\lfloor m/dt \\right\\rfloor} \\mu(d) d∑​i=1∑⌊n/dt⌋​j=1∑⌊m/dt⌋​μ(d) 然后套个整除分块。 P3455 [POI2007]ZAP-Queries: 代码实现： 123456789101112131415161718192021222324252627282930313233343536373839404142434445// 数论初步 学习笔记// Code By CloudySky#include &lt;bits/stdc++.h&gt;namespace IO // namespace IOusing namespace IO;const int Maxn = 1e5 + 10;using namespace std;int p[Maxn], vis[Maxn], cnt;int mu[Maxn], sum[Maxn];void prime (int n) &#123; mu[1] = 1; for (int i = 2; i &lt;= n; ++i) &#123; if (!vis[i]) &#123; vis[i] = i, p[++cnt] = i, mu[i] = -1; &#125; for (int j = 1; j &lt;= cnt; ++j) &#123; if (i * p[j] &gt; n || p[j] &gt; vis[i]) break; vis[i * p[j]] = p[j]; if (i % p[j]) mu[i * p[j]] = -mu[i]; &#125; &#125;&#125;void work () &#123; int a = read (), b = read (), d = read (); a /= d, b /= d; long long ans = 0; for (int l = 1, r = 0; l &lt;= min (a, b); l = r + 1) &#123; r = min (a / (a / l), b / (b / l)); ans += 1ll * (sum[r] - sum[l - 1]) * (a / l) * (b / l); &#125; printf (&quot;%lld\\n&quot;, ans);&#125;signed main() &#123; prime (5e4); for (int i = 1; i &lt;= (int)5e4; ++i) sum[i] = sum[i - 1] + mu[i]; int t = read (); while (t--) work (); return 0;&#125; 1To Be Continued; 本文作者：CloudySky 写作时间： 2021-12-08 最后更新时间： 2021-12-08 遵循协议： BY-NC-SA","tags":"数学"},{"title":"省选内容学习清单","url":"/Blog/StydyContent/","text":" 输入密码来证明你不是卷王","tags":"生活"},{"title":"P3558 [POI2013]BAJ-Bytecomputer","url":"/Blog/p3558/","text":"P3558 [POI2013]BAJ-Bytecomputer 题目大意： 给定一个长度为 n 的 -1, 0, 1 序列。每次可以将 ax+=ax−1(x∈[2,n])a_x += a_{x-1} (x\\in [2, n])ax​+=ax−1​(x∈[2,n]) 求最小的修改次数使给定序列成为不降序列，无解输出 -1。 题目正解： 线性 DP 题目思路： fi,jf_{i,j}fi,j​ 表示将第 iii 位改为 j−1j - 1j−1 形成非降序列的最少修改次数。 fi,0f_{i, 0}fi,0​ 只能由 fi−1,0f_{i - 1, 0}fi−1,0​ 转移而来，如果： ai=−1a_i = -1ai​=−1, fi,0=fi−1,0f_{i,0} = f_{i - 1, 0}fi,0​=fi−1,0​ ai=0a_i = 0ai​=0, fi,0=fi−1,0+1f_{i,0} = f_{i-1, 0} + 1fi,0​=fi−1,0​+1 (把 0 拉成 -1) ai=1a_i = 1ai​=1, fi,0=fi−1,0+1f_{i,0} = f_{i-1, 0} + 1fi,0​=fi−1,0​+1 (把 1 拉成 -1) fi,1f_{i, 1}fi,1​ 的转移相对复杂，注意上一个数不一定是 0，也可以是 -1。 也要注意一下，如果 ai−1a_{i-1}ai−1​ 为 0 并不能对 aia_iai​ 造成任何改变。 ai=−1a_i = -1ai​=−1, fi,1f_{i,1}fi,1​ 失效（显然 0 无法把 -1 拉成 0） ai=0a_i = 0ai​=0, fi,1=min(fi−1,0,fi−1,1)f_{i,1} = min (f_{i-1, 0}, f_{i-1, 1})fi,1​=min(fi−1,0​,fi−1,1​) ai=1a_i = 1ai​=1, fi,1=fi−1,0+1f_{i,1} = f_{i-1, 0} + 1fi,1​=fi−1,0​+1 （这一点比较难想到, -1 把 1 拉成了 0 然后接了上去） fi,2f_{i, 2}fi,2​ 转移比较暴力，如果 ai≠1a_i \\ne 1ai​=1 就拉，否则由 fi−1f_{i-1}fi−1​ 的三个状态取 min 转移（显然 -1, 0, 1 都可以接到 1 上构成非降序列。） 转移方程较多，但并不难想到，注意不要产生丢落即可。 边界的话除了 f1,a1+1=0f_{1, a_1 + 1} = 0f1,a1​+1​=0 以外都设为 inf，最后统计答案如果都大于等于 inf 就无解，否则取 min 。 时间复杂度： O(n)O(n)O(n) 题目代码： 123456789101112131415161718192021222324252627282930313233#include &lt;bits/stdc++.h&gt;#define inf 0x3f3f3f3fconst int Maxn = 1e6 + 10;using namespace std;int a[Maxn], f[Maxn][3];int main() &#123; int n; scanf(&quot;%d&quot;, &amp;n); for (int i = 1; i &lt;= n; ++i) &#123; scanf(&quot;%d&quot;, &amp;a[i]); &#125; memset(f, 0x3f, sizeof(f)); f[1][a[1] + 1] = 0; for (int i = 2; i &lt;= n; ++i) &#123; if (a[i] == -1) &#123; f[i][0] = f[i - 1][0]; f[i][2] = f[i - 1][2] + 2; &#125; else if (a[i] == 0) &#123; f[i][0] = f[i - 1][0] + 1; f[i][1] = min(f[i - 1][0], f[i - 1][1]); f[i][2] = f[i - 1][2] + 1; &#125; else if (a[i] == 1) &#123; f[i][0] = f[i - 1][0] + 2; f[i][1] = f[i - 1][0] + 1; f[i][2] = min(f[i - 1][0], min(f[i - 1][1], f[i - 1][2])); &#125; &#125; if (f[n][0] &gt;= inf &amp;&amp; f[n][1] &gt;= inf &amp;&amp; f[n][2] &gt;= inf) puts(&quot;BRAK&quot;); else printf(&quot;%d\\n&quot;, min(f[n][0], min(f[n][1], f[n][2]))); return 0;&#125; 本文作者：CloudySky 写作时间： 2021-10-31 最后更新时间： 2021-10-31 遵循协议： BY-NC-SA","tags":"dp 题解"},{"title":"P5322 [BJOI2019]排兵布阵","url":"/Blog/p5322/","text":"P5322 [BJOI2019]排兵布阵 题目大意： 共有 s 个序列， a1,a2,…asa_1, a_2, \\dots a_sa1​,a2​,…as​，每个序列 n 个节点 m 个物品，求构造第 s + 1 个序列，仍满足共有 m 个物品，使得 ∑i=1ni×∑j=1s[as+1,i&gt;2×aj,i]\\sum_{i = 1} ^ n i \\times \\sum_{j = 1} ^ s [a_{s + 1, i} &gt; 2 \\times a_{j, i}] i=1∑n​i×j=1∑s​[as+1,i​&gt;2×aj,i​] 最大。只要求输出最大值即可。 题目正解： 线性 DP 题目思路： 根据题目描述和数据范围，可以考虑设 fi,jf_{i,j}fi,j​ 表示考虑到 iii 位置时一共放了 jjj 个物品的最大价值。 很容易就可以知道每个位置一定是刚好超过 2×a1,i2 \\times a_{1, i}2×a1,i​ ~ 2×as,i2\\times a_{s, i}2×as,i​ 中某个值时最优。状态转移方程即为 fi,j=max(fi−1,j−k+vali,k)f_i,j = max (f_{i - 1, j - k} + val_{i, k})fi​,j=max(fi−1,j−k​+vali,k​) 其中 vali,kval_{i, k}vali,k​ 即为在 i 点放 k 个物品的得分，可以预处理出来。 时间复杂度： O(nms)O(nms)O(nms) 题目代码： 1234567891011121314151617181920212223242526272829303132333435363738394041#include &lt;iostream&gt;#include &lt;cstdio&gt;#include &lt;algorithm&gt;const int Maxn = 1e2 + 10;const int Maxm = 2e4 + 10;using namespace std;int a[Maxn][Maxn];int v[Maxn][Maxm], f[Maxn][Maxm];int main () &#123; int s, n, m; scanf (&quot;%d%d%d&quot;, &amp;s, &amp;n, &amp;m); for (int i = 1; i &lt;= s; ++i) &#123; for (int j = 1; j &lt;= n; ++j) &#123; scanf (&quot;%d&quot;, &amp;a[j][i]); a[j][i] = a[j][i] * 2 + 1; &#125; &#125; int P; for (int i = 1; i &lt;= n; ++i) &#123; sort (a[i] + 1, a[i] + s + 1); P = 1; for (int j = 0; j &lt;= m; ++j) &#123; while (j &gt;= a[i][P] &amp;&amp; P &lt;= s) &#123; P ++; &#125; v[i][j] = (P - 1) * i; &#125; &#125; for (int i = 1; i &lt;= n; ++i) &#123; for (int j = 0; j &lt;= m; ++j) &#123; f[i][j] = f[i-1][j]; for (int k = 1; k &lt;= s; ++k) &#123; if (j - a[i][k] &lt; 0) break; f[i][j] = max (f[i][j], f[i-1][j-a[i][k]] + v[i][a[i][k]]); &#125; &#125; &#125; printf (&quot;%d&quot;, f[n][m]); return 0;&#125; 本文作者：CloudySky 写作时间： 2021-10-31 最后更新时间： 2021-10-31 遵循协议： BY-NC-SA","tags":"dp 题解"},{"title":"P5020 [NOIP2018 提高组] 货币系统","url":"/Blog/p5020/","text":"P5020 [NOIP2018 提高组] 货币系统 题目大意： 给定 n 种面值不同的货币，求与这 n 种货币组成的系统等价的系统中 用到货币最少的系统 的货币数量 m。 定义系统等价为任意一种面值要么两个系统都能表示出来，要么都不能表示出来。 题目正解： 完全背包 题目思路： 想到面值表示就想到了完全背包（厕所灵感） 可以发现如果一种货币本身可以被另一种货币表示出来，那么由它参与的面值也一定可以由除它以外的货币表示出来。 所以我们只要找出有多少种货币本身是被其他货币表示出来的即可。 然后可以发现一种货币只可能被比他小的货币表示出来。 所以可以先把货币从小到大排序，然后从小到大枚举货币跑完全背包，其中 fjf_jfj​ 存储 0/1 表示面值 jjj 能否被表示出来。如果发现某个货币本身可以被表示出来就更新答案 ans++; 最后输出 n - ans 即可。 状态转移方程也很简单: fj=max(fj,fj−a[i])f_j = max(f_j, f_{j-a[i]}) fj​=max(fj​,fj−a[i]​) 时间复杂度： O(n×max(ai))O(n\\times max(a_i))O(n×max(ai​)) 题目代码： 12345678910111213141516171819202122232425262728293031#include &lt;iostream&gt;#include &lt;cstdio&gt;#include &lt;cstring&gt;#include &lt;algorithm&gt;const int Maxn = 2.5e4 + 10;using namespace std;int a[Maxn], f[Maxn];void work () &#123; int n, mx; scanf (&quot;%d&quot;, &amp;n); for (int i = 1; i &lt;= n; ++i) &#123; scanf (&quot;%d&quot;, &amp;a[i]); mx = max (mx, a[i]); &#125; sort (a + 1, a + n + 1); memset (f, 0, sizeof (f)); int ans = 0; for (int i = 1; i &lt;= n; ++i) &#123; if (f[a[i]]) ans ++; f[a[i]] = 1; for (int j = a[i]; j &lt;= mx; ++j) &#123; f[j] = max (f[j], f[j-a[i]]); &#125; &#125; printf (&quot;%d\\n&quot;, n - ans);&#125;int main () &#123; int t; scanf (&quot;%d&quot;, &amp;t); while (t--) work ();&#125; 本文作者：CloudySky 写作时间： 2021-10-28 最后更新时间： 2021-10-28 遵循协议： BY-NC-SA","tags":"dp 题解"},{"title":"P1868 饥饿的奶牛","url":"/Blog/p1868/","text":"P1868 饥饿的奶牛 题目大意： 共有 n 个区间，选取任意个不重叠的区间使覆盖面积最大，求最大面积。 题目正解： DP + 二分 题目思路： 首先考虑给线段排序。因为每回你都要满足左端点大于要转移点的右端点，所以按照右端点排序会方便些，因为这样就可以二分了。 然后考虑转移方程。设 fif_ifi​ 表示考虑到第 i 片草的最大价值。 可以按照这个草选不选分为两种。 如果不选那么 fi=fi−1f_i = f_{i-1}fi​=fi−1​ 如果选的话因为 f 满足单调性，所以直接二分查找最后一个右端点小于当前草左端点的草，设它为 k。 fi=fk+valif_i = f_k + val_ifi​=fk​+vali​ 将以上两种情况取 maxmaxmax 即可。 最终转移方程： fi=max(fi−1,fk+ri−li+1)f_i = max (f_{i-1}, f_k + r_i - l_i + 1) fi​=max(fi−1​,fk​+ri​−li​+1) 时间复杂度： O(nlogn)O(nlogn)O(nlogn) 题目代码： 1234567891011121314151617181920212223242526272829303132333435363738#include &lt;iostream&gt;#include &lt;cstdio&gt;#include &lt;algorithm&gt;const int Maxn = 1.5e5 + 10;using namespace std;struct range &#123; int l, r; bool operator &lt; (const range y) const &#123; return r &lt; y.r; &#125;&#125; a[Maxn];int f[Maxn], g[Maxn];int find (int val, int R) &#123; int l = 0, r = R; while (l &lt; r) &#123; int mid = (l + r + 1) &gt;&gt; 1; if (a[mid].r &gt;= val) r = mid - 1; else l = mid; &#125; return l;&#125;int main () &#123; int n; scanf (&quot;%d&quot;, &amp;n); for (int i = 1; i &lt;= n; ++i) &#123; scanf (&quot;%d%d&quot;, &amp;a[i].l, &amp;a[i].r); &#125; sort (a + 1, a + n + 1); for (int i = 1; i &lt;= n; ++i) &#123; int k = find (a[i].l , i - 1); f[i] = max (f[i-1], f[k] + a[i].r - a[i].l + 1); &#125; printf (&quot;%d\\n&quot;, f[n]); return 0;&#125; 本文作者：CloudySky 写作时间： 2021-10-27 最后更新时间： 2021-10-27 遵循协议： BY-NC-SA","tags":"dp 题解"},{"title":"2021-10-21 CSP 考前模拟赛题解","url":"/Blog/solution-2021-10-21/","text":" 输入密码来证明你不是卷王","tags":"dp 图论 数学 题解 test"},{"title":"字符串基础 学习笔记","url":"/Blog/String/","text":"字符串 HashHashHash Hash 是一种将一个字符串映射为一个数字的算法,它可以帮助我们在 O(1)O(1)O(1) 的时间内判断两个字符串是否相等,或进行回文判断。但 HashHashHash 也有一定的出错概率。当数据范围为 10510^5105 级别时可能会出现哈希冲突，可以使用双模数哈希。 基础 hashhashhash 时间复杂度:O(1)O(1)O(1) 对于一个长度为 nnn 的字符串,它的哈希值为 ∑i=1i≤nsi×basen−i mod P\\sum_{i=1}^{i\\le n} s_i\\times base^{n-i} \\bmod P∑i=1i≤n​si​×basen−imodP 。其中 basebasebase 和 PPP 自选。 具体实现： 对于一个字符串 SSS ,它的每一个位前缀哈希值就等于上一位前缀哈希值 Hi−1×base+siH_{i-1}\\times base +s_iHi−1​×base+si​。 预处理出 basebasebase 的 1∼n1\\sim n1∼n 次方 Pow1∼nPow_{1\\sim n}Pow1∼n​ 对于一段区间 [l,r][l,r][l,r] ,它的 hashhashhash 值即为 Hr−Hl−1×Powr−l+1H_r-H_{l-1}\\times Pow_{r-l+1}Hr​−Hl−1​×Powr−l+1​ 代码实现: 1234567891011121314151617181920// 字符串基础 学习笔记// 基础 hash 具体实现unsigned long long h[1e5 + 10], pow[1e5 + 10];bool check(int l, int r) &#123; //查询区间Hash值 return h[r] - h[l - 1] * pow[r - l + 1];&#125;void init_hash(char* s) &#123; //初始Hash映射数组 int n = strlen(s); for (int i = 1; i &lt;= n; ++i) &#123; h[i] = h[i - 1] * base + s[i]; //套公式 &#125;&#125;void Init_pow() &#123; pow[0] = 1; for (int i = 1; i &lt;= Maxn; ++i) pow[i] = pow[i - 1] * base; //初始 base 幂&#125; 允许失配 k 次的匹配 时间复杂度:O(nklogn)O(nklogn)O(nklogn) 具体实现: 枚举子串,每次二分+hash 找到第一个不同的位置,从这个位置之后继续匹配。 代码实现：暂无 KMPKMPKMP 模式串匹配 时间复杂度：O(n)O(n)O(n) KMPKMPKMP 算法是一个在线性时间内完成字符串匹配的算法。 具体实现： nxtnxtnxt 数组维护在文本串每一位最长的前缀等于后缀的长度 当 nxtnxtnxt 数组维护到第 iii 位时， 如果 snxti+1=si+1s_{nxt_i+1}=s_{i+1}snxti​+1​=si+1​ 就把 nxtnxtnxt 数组 +1+1+1， 否则让 nxtnxtnxt 数组 跳 nxtnxtnxt。 匹配时直接暴力拓展,失配时跳 nxtnxtnxt 而不是从头开始。 代码实现： 1234567891011121314151617181920212223242526// 字符串基础 学习笔记// KMP 模式串匹配具体实现//s 是模式串, s1 是文本串, Ans 记录匹配成功的位置int nxt[Maxn];void init(char* s) &#123; int n = strlen(s + 1); for (int i = 2, j = 0; i &lt;= n; ++i) &#123; while (j &amp;&amp; s[j + 1] != s[i]) //如果第 i 位失配了,就跳 nxt j = nxt[j]; if (s[j + 1] == s[i]) ++j; //可以匹配成功就 +1 nxt[i] = j; &#125;&#125;vector&lt; int &gt; Ans;void check(char* s, char* s1) &#123; int n = strlen(s + 1), m = strlen(s1 + 1); for (int i = 1, j = 0; i &lt;= m; ++i) &#123; while (j &amp;&amp; s[j + 1] != s1[i]) //失配就跳 nxt j = nxt[j]; if (s[j + 1] == s1[i]) ++j; //可以匹配就暴力拓展 if (j == n) &#123; Ans.push_back(i - n + 1); //匹配成功就计入答案 j = nxt[j]; &#125; &#125;&#125; ManacherManacherManacher 回文匹配 时间复杂度：O(n)O(n)O(n) ManacherManacherManacher 是通过维护 RRR 和 midmidmid 在线性时间内求一个模式串最长回文子串的算法，但它有一个明显的缺点就是只能判断长度为奇数的回文串，所以要在读入时进行特殊字符补位操作。 证明: 由于 R 是单调递增的，所以时间复杂度也是线性的。 具体实现： 在读入时先将第一位设为 ‘@’ 防止数组越界，后将读入字符和补 ‘#’ 交替进行，方便判偶数长度。 每到一位都要维护两个信息以便下次拓展，分别是这一位及以前所有回文子串右端点最大值 RRR 和拓展 RRR 到当前值的 midmidmid。 更新第 i 位时先继承回文半径为 iii 关于 midmidmid 的 对称点 jjj 的答案和 iii 到 RRR 的距离中的最小值，后暴力拓展，同时更新 RRR 和 midmidmid。 代码实现： 1234567891011121314151617181920// 字符串基础 学习笔记// Manacher 回文匹配具体实现int scan(char* s) &#123; char c = &#x27; &#x27;, s[0] = &#x27;~&#x27;, s[1] = &#x27;#&#x27;, int cnt = 1; //先补特殊字符防止越界 while (c &lt; &#x27;a&#x27; || c &gt; &#x27;z&#x27;) c = getchar(); while (c &gt;= &#x27;a&#x27; &amp;&amp; c &lt;= &#x27;z&#x27;) s[++cnt] = c, s[++cnt] = &#x27;#&#x27;, c = getchar(); //补位和读入交替进行 return cnt; //返回字符串长度&#125;int manacher(char* s, int n) &#123; int R = 0, pos, ans = 0; for (int i = 1; i &lt;= n; ++i) &#123; if (i &lt;= R) r[i] = min(r[(pos &lt;&lt; 1) - i], R - i + 1); //先继承 while (s[i - r[i]] == s[i + r[i]]) r[i]++; //后暴力拓展 if (i + r[i] &gt; R) R = i + r[i] - 1, pos = i; //能更新就更新 if (r[i] &gt; ans) ans = r[i]; ///更新答案 &#125; return ans;&#125; 字符串 TrieTrieTrie 详见 本文作者：CloudySky 写作时间： 2021-08-12 最后更新时间： 2021-10-09 遵循协议： BY-NC-SA","tags":"字符串"},{"title":"背包问题 学习笔记","url":"/Blog/Bags/","text":"背包问题是动态规划问题中一类比较基础，偏向格式化的问题。 动规模型是：有 N 个物品，每个物品有 viv_ivi​ 的体积和 wiw_iwi​ 的质量，你需要选择任意个物品，使得这些物品的总体积小于背包容量 V，并让 ∑i∈{bags}wi\\sum_{i\\in \\{bags\\}} w_i∑i∈{bags}​wi​ 最大。 背包问题包括几类子问题：01 背包问题，完全背包问题，多重背包问题，混合背包问题等等。 01 背包问题 时间复杂度：O(NV)O(NV)O(NV) 01 背包，顾名思义，就是每个物品只有两种状态，选或不选。 具体实现： 不难发现，最基础的动规转移方程就是，fi,j=max⁡(fi,j,fi−1,j−v[i]+wi)f_{i,j} = \\max (f_{i,j}, f_{i-1,j-v[i]}+w_i)fi,j​=max(fi,j​,fi−1,j−v[i]​+wi​)。 但是会出现一个问题，这样的空间复杂度是 O(NV)O(NV)O(NV) 的。非常难易接受。 考虑优化，直接消掉一维，但是显然体积维不能消掉，于是考虑消掉物品维。 但这样就出现了一个问题，就是在转移时如果需要用的物品的 dpdpdp 数组值已经被覆盖了，那么转移出来的答案会是错误的。 所以需要更改枚举数序，将体积维从大到小枚举，这样每一个可能要用到的状态一定不会被覆盖掉。 （因为任何一个物品的体积都为正数，所以一个状态只可能从比它小的状态转移过来） 代码实现： 1234567// 背包问题 学习笔记// 01 背包具体实现for ( int i = 1; i &lt;= N; ++i ) &#123; for ( int j = V; j &gt;= v[i]; --j ) &#123; f[j] = max ( f[j], f[j-v[i]] + w[i] ); &#125;&#125; printf ( &quot;%d\\n&quot;, f[V] ); 完全背包问题 时间复杂度：O(NV)O(NV)O(NV) 完全背包，就是一个物品可以使用无限次的背包问题。 具体实现： 刚才在进行 01 背包空间优化时发现，如果正序枚举会出选一个物品用多次的情况，从而导致结果错误，那么我们在进行多重背包时就可以利用这一点。因为多重背包并不会限制物品个数。 代码实现： 1234567// 背包问题 学习笔记// 完全背包具体实现for ( int i = 1; i &lt;= N; ++i ) &#123; for ( int j = v[i]; j &lt;= V; ++j ) &#123; f[j] = max ( f[j], f[j-v[i]] + w[i] ); &#125;&#125; printf ( &quot;%d\\n&quot;, f[V] ); 多重背包问题 时间复杂度 O(NVS)O(NVS)O(NVS) ~ O(NV)O(NV)O(NV) 多重背包就是一个物品 i 最多选择 sis_isi​ 个的背包。它具有两种常见的优化，二进制拆分和单调队列优化。 具体实现： 可以考虑在枚举完体积后再枚举个数。（否则可能会重复使用） 代码实现： 12345678910// 背包问题 学习笔记// 多重背包具体实现for ( int i = 1; i &lt;= N; ++i ) &#123; for ( int j = V; j &gt;= 0; --j ) &#123; for ( int k = 1; k &lt;= s[i]; ++k ) &#123; if ( j &lt; k * v[i] ) break; f[j] = max ( f[j], f[j-k*v[i]] + k * w[i] ); &#125; &#125;&#125; printf ( &quot;%d\\n&quot;, f[V] ); 单调队列优化： 考虑多重背包的转移方程： fu+k∗vi=max⁡k′(fu+k′∗vi+(k−k′)∗wi)fu+k∗vi=max⁡k′(fu+k′∗vi+k∗wi−k′∗wi)fu+k∗vi=max⁡k′(fu+k′∗vi−k′∗wi)+k∗wif_{u + k * v_i} = \\max_{k&#x27;}(f_{u + k&#x27; * v_i} + (k - k&#x27;) * w_i) \\\\ f_{u + k * v_i} = \\max_{k&#x27;}(f_{u + k&#x27; * v_i} + k * w_i - k&#x27; * w_i) \\\\ f_{u + k * v_i} = \\max_{k&#x27;}(f_{u + k&#x27; * v_i} - k&#x27; * w_i) + k * w_i \\\\ fu+k∗vi​​=k′max​(fu+k′∗vi​​+(k−k′)∗wi​)fu+k∗vi​​=k′max​(fu+k′∗vi​​+k∗wi​−k′∗wi​)fu+k∗vi​​=k′max​(fu+k′∗vi​​−k′∗wi​)+k∗wi​ 发现多重背包状态转移时 j 只会从 j−1×vi,j−2×vi,j−3×vi,…j - 1 \\times v_i , j - 2 \\times v_i , j - 3 \\times v_i, \\dotsj−1×vi​,j−2×vi​,j−3×vi​,… 转移过来。所以就可以将所有的 j 按 mod(vi)mod (v_i)mod(vi​)分成 viv_ivi​ 个系。 然后对前面的 maxmaxmax 跑一边单调队列即可。 AcWing 06 代码实现： 1234567891011121314151617181920212223242526272829303132333435363738394041424344454647// 背包问题 学习笔记// 多重背包 3 || 模板 多重背包单调队列优化// Code By CloudySky#include &lt;bits/stdc++.h&gt;namespace IO // IOusing namespace IO;const int Maxn = 2e4 + 10;using namespace std;#define f(x, y) f[x &amp; 1][y]int v[Maxn], w[Maxn], s[Maxn];int f[Maxn][Maxn], q[Maxn];inline int solve(int i, int u, int k) &#123; return f((i - 1), u + k * v[i]) - k * w[i]; // 用来计算贡献的函数，这里的 k 其实是上文的 k&#x27;&#125;signed main() &#123; int n = read(), m = read(); for (int i = 1; i &lt;= n; ++i) &#123; v[i] = read(), w[i] = read(), s[i] = read(); &#125; for (int i = 1; i &lt;= n; ++i) &#123; int l = s[i]; if (l &gt; m / v[i]) l = m / v[i]; // 判定每个余数系的元素个数。 for (int u = 0; u &lt; v[i]; ++u) &#123; // 分系跑单调队列。 int hd = 0, tl = -1; for (int k = 0; k &lt;= (m - u) / v[i]; ++k) &#123; while (hd &lt;= tl &amp;&amp; solve(i, u, q[tl]) &lt;= solve(i, u, k)) tl--; // 弹出劣解元素。 if (hd &lt;= t &amp;&amp; q[hd] &lt; k - l) hd++; // 弹出过期元素。 q[++tl] = k; // 当前元素加入队列。 f(i, u + k * v[i]) = solve(i, u, q[hd]) + k * w[i]; // 计算答案，由于是单调的，每个位置只会被更新 1 次，所以不需要取最值。 &#125; &#125; &#125; printf(&quot;%d&quot;, f(n, m)); return 0;&#125; 本文作者：CloudySky 写作时间： 2021-10-07 最后更新时间： 2021-10-07 遵循协议： BY-NC-SA","tags":"dp"},{"title":"博弈论初步基础知识 学习笔记","url":"/Blog/Game-Theory/","text":"关于博弈论这个算法，可能是算法竞赛中最实际的算法吧。博弈论算法虽然定理较多，但体系还算较完整。博弈论的学习很简单，代码量也相对较小，就是看能不能想出来正确的构造法。 公平组合游戏 公平组合游戏，就像字面意思。既是回合制游戏，还得是公平的。说高大上一点，就是拥有状态集，终止状态集，状态转移边，可以在有限步数内结束的游戏。 是不是感觉这个规则要求太苛刻了？有什么创造性吗？所以这个规则并不完全是博弈论要讨论的内容。 策梅洛定理 其表示在二人的有限游戏中，如果双方皆拥有完全的资讯，并且运气因素并不牵涉在游戏中，那先行或后行者当一必有一方有必胜/必不败的策略。 --百度百科 这种游戏相对于公平组合游戏规则就活泛多了。比如常玩的五子棋，围棋就不是公平组合游戏，因为甲放的棋子乙不能动。但他们都在策梅洛定理的研究范内。 博弈论的体系都是在这种游戏的基础上构建的。 设先手必胜状态为 NNN 状态，先手必败状态为 PPP 状态。 那么一个满足上述要求的游戏中， 如果一个状态 能 转移到 PPP 状态，那么它一定是 NNN 状态。 如果一个状态只能转移到 NNN 状态，那么它一定是 PPP 状态。 （上面一定要记准确了，不然 SG 函数会很难受） 所以对于任意状态集，都可以确定哪一方赢。 需要用数学归纳思想感性证明。 巴什博弈 有 n 个石子，两人轮流取，每次只能取 [1,m][1,m][1,m] 个。最后取光者胜。 一个简单的构造就是 (m+1)∣n(m+1)|n(m+1)∣n 时，先手必败，否则先手必胜。 这个应该挺好理解的。就是如果甲取 kkk 个，则乙取 m−k+1m-k+1m−k+1 个，这样始终可以保证不论甲取何值，乙都可以取且可以保证和一定。如果不能整除，那乙没有任何办法。 Nim 游戏 有 𝑛 堆石子，每堆有 aia_iai​ 个。每次从一堆中取任意个，取完最后一个石子者赢。 如果 ⊕𝑎𝑖=0⊕ 𝑎_𝑖 = 0⊕ai​=0 ，那么先手必败，否则先手必胜。 是不是突然感觉就蒙了？这个是咋构造出来的？不管你是不是，我是。 sg 函数 先定义一个 ygsgygsgygsg 函数： ygsg(x)=1(x∈N)ygsg(x) = 1 (x\\in N)ygsg(x)=1(x∈N)（这里的 N 是必胜态而不是数集 N ） 在根据上面的策梅洛定理， ygsg(x)={0∄x−&gt;y,ygsg(y)=01∃x−&gt;y,ygsg(y)=0ygsg(x) = \\begin{cases}0 &amp;\\nexists x-&gt;y,ygsg(y)=0\\\\1 &amp;\\exists x-&gt;y,ygsg(y)=0\\end{cases} ygsg(x)={01​∄x−&gt;y,ygsg(y)=0∃x−&gt;y,ygsg(y)=0​ 然后再定义 sg(x)=mex{sg(y)∣x−&gt;y}sg(x) = mex\\{sg(y)|x-&gt;y\\}sg(x)=mex{sg(y)∣x−&gt;y} 这个函数又是什么意思呢？ 通俗理解一下，就是 sg 函数和他的状态转移边构成了一个 DAG，如果 sg(x) 这个状态可达的所有状态中，含有 P 状态，那么 sg(x)&gt;0sg(x) &gt; 0sg(x)&gt;0 否则 sg(x)=0sg(x) = 0sg(x)=0，然后就得出了 sg(x)&gt;0↔ygsg(x)=1↔x∈Nsg(x)&gt;0\\leftrightarrow ygsg(x)=1\\leftrightarrow x\\in Nsg(x)&gt;0↔ygsg(x)=1↔x∈N。然后就有 sg(x,y)=sg(x)⊕sg(y)sg(x,y) = sg(x) \\oplus sg(y)sg(x,y)=sg(x)⊕sg(y)（具体为什么还是不太清楚） 本文作者：CloudySky 写作时间： 2021-09-22 最后更新时间： 2021-09-22 遵循协议： BY-NC-SA","tags":"数学"},{"title":"网络流及 Dinic 学习笔记","url":"/Blog/Flow/","text":"网络流是 OI 中一种非常招人痛恨的算法，因其较难理解且理解后也做不对题。 网络流的基础知识听起来很抽象，但实际上并不是非常难理解。它分为 网络 和 流。（不然为啥子叫网络流？） 网络 网络就是一张满足一些性质的图。 首先，它是一张有向图。 图中的每条边都有一个 ccc 值，代表这条边的容量。 可表示为 c(u,v)(u,v∈V)c(u,v)_{(u,v\\in V)}c(u,v)(u,v∈V)​ 它具有两个特殊的点，源点和汇点。 （这两个点一般都不是题目给出的。） 流 流是一个函数。流函数可表示为： f(u,v)(u,v∈V)f(u,v)_{(u,v\\in V)}f(u,v)(u,v∈V)​ 具体的性质分为以下三条，（这些性质名字看起来很高深，但类比水流很容易理解） 容量限制：f(u,v)≤c(u,v)f(u,v)\\le c(u,v)f(u,v)≤c(u,v) 斜对称性：f(u,v)=−f(v,u)f(u,v) = - f(v,u)f(u,v)=−f(v,u) 流守恒性： ∀x∈V,且x∉{s,t},∑(u,x)∈Ef(u,x)=∑(x,v)∈Ef(x,v)\\forall x\\in V,\\text且 x \\notin\\{s,t\\},\\sum_{(u,x)\\in E} f(u,x) = \\sum_{(x,v)\\in E} f(x,v) ∀x∈V,且x∈/{s,t},(u,x)∈E∑​f(u,x)=(x,v)∈E∑​f(x,v) (通俗理解一下，就是每个点都不会有“积水”) 用网络流能解决的问题 网络流常见的问题可以概括理解为以下三种： 最大流问题：求一张网络从源点到汇点的最大流量。（这个问题也可以转变为二分图最大匹配问题。） 最小割问题：删掉总流量为 XXX 的边使整张图不连通，最小的 XXX 。仔细推一下就能发现，对于一张图，最小割和最大流其实得到的答案其实是一样的。 费用流问题：全称为最大费用最大流或者最小费用最大流。顾名思义，就是在网络中的每条边中加入一种属性，也就是这条边的费用。你在这条边上的花费就是 这条边的费用×这条边的流量\\text{这条边的费用} \\times \\text{这条边的流量}这条边的费用×这条边的流量 。要求优先满足最大流量的同时满足最大费用。 解决网络流问题的算法 DinicDinicDinic 算法 时间复杂度：O(n2m)O(n^2m)O(n2m) （在二分图上是 O(nm)O(\\sqrt nm)O(n​m) ） 虽然说这个复杂度看起来非常劣，但网络流算法的复杂度往往比这个上界低很多。我们只需要记住这个算法可以处理的数据范围是 104∼10510^4 \\sim 10^5104∼105 即可。 具体实现： 每次先 BFSBFSBFS 将这个残量网络（即每条边的容量减掉流量）构建为分层图。 后用 DFSDFSDFS 在这个分层图上同时找出多条增广路。 将增广路上的边流量减小最大可减小剩余容量，同时将对应的反向边的剩余容量增加（方便后面“反悔”），这就要求我们建边时成对建边（听起来挺简单的？） DinicDinicDinic 算法还有一个常见的优化。当前弧优化。也就是当前增广时如果有一条边已经被增广过或者不能被增广，那就将这条边在当前轮从边集中删除。 代码实现： 123456789101112131415161718192021222324252627282930313233343536373839// 网络流及 Dinic,EK 学习笔记// Dinic 算法具体实现struct edge &#123;int v, nxt, t;&#125; e[Maxn &lt;&lt; 1];int hd[Maxn], hhd[Maxn], cnt = 1;void add(int u, int v, int t) &#123;e[++cnt] = (edge) &#123;v, hd[u], t&#125;; hd[u] = cnt;&#125;int ans, s, t, dep[Maxn];int dfs(int x, int flow) &#123; if (x == t || !flow) return flow; // 能到达终点或者没有流量了。 int res = flow; // flow 表示流入当前节点的流量，res 表示积攒的流量，这一部分是要被退回去的，并不能计入答案。 for (int &amp;i = hhd[x]; i &amp;&amp; res; i = e[i].nxt) &#123; // 当前弧优化，当 i 跳 nxt 时， hhd 也同时跳 nxt 代表删除了这条边。 // 同时在没有流量时直接退出循环可以显著降低常数。 int y = e[i].v; if (!e[i].t || dep[y] != dep[x] + 1) continue; int k = dfs(y, min(res, e[i].t)); e[i].t -= k, e[i ^ 1].t += k, res -= k; &#125; return flow - res;&#125;// 广搜构建分层图，dep[x] 表示 x 节点的深度。bool bfs() &#123; queue &lt;int&gt; q; memset(dep, 0, sizeof(dep)); dep[s] = 1, q.push(s); while (!q.empty()) &#123; int x = q.front(); q.pop(); for (int i = hd[x]; i; i = e[i].nxt) &#123; int y = e[i].v; if (e[i].t &amp;&amp; !dep[y]) dep[y] = dep[x] + 1, q.push(y); &#125; &#125; return dep[t]; // 如果到不了重点说明已经达到最大值了。&#125;void dinic() &#123;while (bfs()) memcpy(hhd, hd, sizeof(hd)), ans += dfs(s, inf);&#125; （好像确实不难？） 费用流 wqswqswqs 算法 时间复杂度：O(nmflow)O(nmflow)O(nmflow)（flow 为边权和） 可处理的范围一般为 10310^3103 具体实现： 对 dinicdinicdinic 进行了一定修改的算法，直接把 BFSBFSBFS 改成 SPFASPFASPFA 即可。同时为了防止费用为 0 的边导致死循环还要记一个 visvisvis 。 代码实现： 1234567891011121314151617181920212223242526272829303132333435363738394041424344// 网络流及 Dinic,EK 学习笔记struct edge &#123;int v, nxt, t, w;&#125; e[Maxn &lt;&lt; 1];int hd[Maxn], hhd[Maxn], cnt = 1;void add(int u, int v, int t, int w) &#123; e[++cnt] = (edge) &#123;v, hd[u], t, w&#125;; hd[u] = cnt;&#125;int ans, cost, s, t, dis[Maxn], vis[Maxn];int dfs(int x, int flow) &#123; if (!flow || x == t) return flow; int res = flow; vis[x] = 1; for (int &amp;i = hhd[x]; i &amp;&amp; res; i = e[i].nxt) &#123; int y = e[i].v; if (!e[i].t || vis[y] || dis[y] != dis[x] + e[i].w) continue; int k = dfs(y, min(res, e[i].t)); e[i].t -= k, e[i ^ 1].t += k, res -= k; &#125; return flow - res;&#125;bool bfs() &#123; queue &lt;int&gt; q; memset(dis, 0x3f, sizeof(dis)), memset(vis, 0, sizeof(vis)); dis[s] = 0, q.push(s); while (!q.empty()) &#123; int x = q.front(); q.pop(); vis[x] = 0; for (int i = hd[x]; i; i = e[i].nxt) &#123; int y = e[i].v; if (e[i].t &amp;&amp; dis[y] &gt; dis[x] + e[i].w) &#123; dis[y] = dis[x] + e[i].w; if (!vis[y]) vis[y] = 1, q.push(y); &#125; &#125; &#125; return dis[t] != inf;&#125;void dinic() &#123; int k; while (bfs()) memcpy(hhd, hd, sizeof(hd)), k = dfs(s, inf), ans += k, cost += k * dis[t];&#125; 网络流建图套路小总结 如果给定某些物品的初态以及终态，求某种极限转移，可以将源点连向初态费用为 0 ，终态连向汇点费用为 0，转移连成出边费用为代价。 经典题：负载平衡。 某些取数类问题，可以变成从起点走过物品到终点，其中走过某个物品就代表选了它。将每个物品拆成两个点，中间连一条容量为取数限制权值为物品价值的边。最后最大流即为答案。 经典题：方格取数加强版。 网格图相邻问题可以黑白交替转染色化成二分图，之后跑网络流。 经典题：方格取数问题。 某些阶段性问题可以构建分层图跑网络流。 经典题：家园/星际转移问题。 本文作者：CloudySky 写作时间： 2021-09-19 最后更新时间： 2022-02-26 遵循协议： BY-NC-SA","tags":"图论"},{"title":"线段树 学习笔记","url":"/Blog/Segment-Tree/","text":"update: 2021-12-25 进行了一些简单修改和维护。 线段树 时间复杂度：O(nlogn)O(nlogn)O(nlogn) 线段树是一种用来动态维护区间和，区间积，区间极值等区间信息的数据结构，它是建立在分治思想上的。 具体实现： 建立一个结构体来表示这颗线段树，结构体的每个点是这个线段树的节点，它需要维护以下几个信息： l,rl,rl,r 用来维护这个节点所表示的区间，其中设当前节点表示的区间为 [l,r][l,r][l,r] ，mid=l+r&gt;&gt;1mid = l + r &gt;&gt; 1mid=l+r&gt;&gt;1 ，则左子节点表示的区间为 [l,mid][l,mid][l,mid] ，右子节点表示的区间为 [mid+1,r][mid+1,r][mid+1,r] 。 ls,rsls, rsls,rs 即这个节点左右子节点的下标。 根据需要维护 Sum,Max,MinSum, Max, MinSum,Max,Min 等信息。 以上前两条可以根据个人代码习惯省略。 pushuppushuppushup 操作：用来把子节点的信息上传给父节点 buildbuildbuild 操作：用来建立左右子节点，以及统计初始信息，如无特殊要求 lslsls 即为 当前节点的下标×2\\text{当前节点的下标} \\times 2当前节点的下标×2 ，rsrsrs 即为 当前节点的下标×2+1\\text{当前节点的下标} \\times 2 + 1当前节点的下标×2+1 。 changechangechange 操作：用来区间修改统计的信息。其中，要修改的区间要 “沉降” 在各个节点上。即，如果 [lx,rx]∈[L,R][l_x,r_x] \\in [L,R][lx​,rx​]∈[L,R] 就直接修改 xxx 这个节点，并打上懒惰标记，懒惰标记等到要用子节点的信息时再下放，来保证修改操作时间复杂度的正确性。否则单次修改操作时间复杂度会被卡成 O(n)O(n)O(n) 。 spreadspreadspread 操作：用来下方懒惰标记，具体实现因统计的数据而异。 askaskask 操作：用来统计区间信息，与修改操作类似，将要询问的区间**“沉降”**在树上。要注意向下递归时先下放标记。 P3373 [模板]线段树 2 代码实现： 123456789101112131415161718192021222324252627282930313233343536373839404142434445464748495051525354555657585960616263646566676869707172737475767778798081828384858687888990919293949596979899100101102103104105// 线段树，可持久化权值线段树，树套树 学习笔记// Code By CloudySky/*下面是曾经错过的点：每次更改要修改标记而不是直接覆盖不要忘记每次上传数据大写的 P 和小写的 p 要分清,不要对小 p 取模更新 add 标记比较特殊要先将 add_s*mu_f 再 +add_f*/#include &lt;iostream&gt;#include &lt;cstdio&gt;#include &lt;cstring&gt;const int Maxn = 1e5 + 10;const long long P = 571373;using namespace std;typedef long long ll;long long a[Maxn];#define ls p &lt;&lt; 1#define rs p &lt;&lt; 1 | 1// 结构体封装线段树struct Stree &#123; int l, r; ll val, add, mu; #define l(x) St[x].l #define r(x) St[x].r #define v(x) St[x].val #define ad(x) St[x].add #define mu(x) St[x].mu&#125; St[Maxn&lt;&lt;2];// 下传标记，注意本题由于既有乘法标记，又有加法标记，所以要注意下传顺序void spread (int p) &#123; ad(ls) = (ad(ls) * mu(p) + ad(p)) % P; // 先更新子节点加法标记 ad(rs) = (ad(rs) * mu(p) + ad(p)) % P; mu(ls) = mu(ls) * mu(p) % P; // 后更新子节点乘法标记 mu(rs) = mu(rs) * mu(p) % P; v(ls) = (v(ls) * mu(p) % P + 1ll * ad(p) * (r(ls) - l(ls) + 1)) % P;// 最后更新子节点权值 v(rs) = (v(rs) * mu(p) % P + 1ll * ad(p) * (r(rs) - l(rs) + 1)) % P; mu(p) = 1, ad(p) = 0;&#125;// 建树函数void build (int p, int l, int r) &#123; l(p) = l, r(p) = r; mu(p) = 1;// 确定左右端点，同时初始化乘法标记 if (l(p) == r(p)) &#123; v(p) = a[l(p)]; return; // 确定叶子节点初值 &#125; int mid = (l + r) &gt;&gt; 1; build (ls, l, mid); // 递归构建左子树 build (rs, mid + 1, r); // 递归构建右子树 v(p) = v(ls) + v(rs); // 统计子节点信息&#125;// 加法操作void add (int p, int l, int r, ll k) &#123; if (l(p) &gt;= l &amp;&amp; r(p) &lt;= r) &#123; // 如果完全被包含直接沉降 v(p) = v(p) + 1ll * k * (r(p) - l(p) + 1) % P; // 更新当前节点权值 (ad(p) += k) %= P; return; // 打标记 &#125; int mid = (l(p) + r(p)) &gt;&gt; 1; spread (p); // 既然执行到这一步，说明当前节点的子节点要被访问（否则上面 if 语句已经回溯），需要先下传标记 if (l &lt;= mid) add (ls, l, r, k); if (r &gt; mid) add (rs, l, r, k); v(p) = v(ls) + v(rs);&#125;// 乘法操作void times (int p, int l, int r, ll k) &#123; if (l(p) &gt;= l &amp;&amp; r(p) &lt;= r) &#123; v(p) = v(p) * k % P; ad(p) = ad(p) * k % P; mu(p) = mu(p) * k % P; return; &#125; int mid = (l(p) + r(p)) &gt;&gt; 1; spread (p); if (l &lt;= mid) times (ls, l, r, k); if (r &gt; mid) times (rs, l, r, k); v(p) = v(ls) + v(rs);&#125;// 查询操作ll ask (int p, int l, int r) &#123; if (l(p) &gt;= l &amp;&amp; r(p) &lt;= r) return v(p); // 如果完全被包含直接返回 int mid = (l(p) + r(p)) &gt;&gt; 1; spread (p); // 否则需要用到子节点信息，下传标记 ll ans = 0; if (l &lt;= mid) (ans += ask (ls, l, r)) %= P; // 统计左节点答案 if (r &gt; mid) (ans += ask (rs, l, r)) %= P; // 统计右节点答案 return ans; // 返回答案&#125;int main () &#123; int n, m, p; scanf (&quot;%d%d%d&quot;, &amp;n, &amp;m, &amp;p); for (int i = 1; i &lt;= n; ++i) scanf (&quot;%lld&quot;, &amp;a[i]); build (1, 1, n); for (int i = 1; i &lt;= m; ++i) &#123; int l, r, opt; ll k; scanf (&quot;%d%d%d&quot;, &amp;opt, &amp;l, &amp;r); if (opt == 1) &#123; scanf (&quot;%lld&quot;, &amp;k); times (1, l, r, k); &#125; else if (opt == 2) &#123; scanf (&quot;%lld&quot;, &amp;k); add (1, l, r, k); &#125; else &#123; printf (&quot;%lld\\n&quot;, ask (1, l, r)); &#125; &#125; return 0;&#125; 权值线段树 时间复杂度：O(nlogn)O(nlogn)O(nlogn) 权值线段树是用来维护一个值域上的数的存在信息，相对于普通线段树来将代码量较小，但用处也不少。最经典的应用是静态全局第 k 小。 具体实现： 要维护的信息：这个节点的左，右子节点（应为权值线段树可能会用到动态开点，所以记录左右子节点相对重要） buildbuildbuild 操作：与上面类似。ls,rsls, rsls,rs 的建立根据要求和值域范围修改。 changechangechange 操作：权值线段树一般不要求区间修改，可以直接单点修改。 askaskask 操作：askaskask 操作在权值线段树上的含义是在 [L,R][L,R][L,R] 范围内的数有多少个，一般不是很常用。 findfindfind 操作：相当于线段树上二分，这个操作只有在权值线段树上才有意义，含义是找到 $rank \\le k $ 的最大的数。如果要找到当前 [l,r][l, r][l,r] （均为线段树节点区间）第 kkk 小，如果左边节点个数能够达到，就在左边递归找，否则在右边递归找第 k−cntlk - cnt_lk−cntl​ 的点 P1923 【深基9.例4】求第 k 小的数（多少有点大材小用，且过不了） 代码实现： 12345678910111213141516171819202122232425262728293031323334353637383940414243444546474849505152535455// 线段树，可持久化权值线段树，树套树 学习笔记// 权值线段树动态开点版// Code By CloudySky#include &lt;bits/stdc++.h&gt;// #define int long longnamespace IO // namespace IO using namespace IO;const int Maxn = 5e6 + 10;using namespace std;struct Stree &#123; int ls, rs, val;#define ls(x) St[x].ls#define rs(x) St[x].rs#define v(x) St[x].val&#125; St[Maxn &lt;&lt; 2];int tot = 1;// 插入权值int add(int p, int l, int r, int v) &#123; if (!p) p = ++tot; // 动态开点 v(p) += 1; // 统计权值 if (l == r) return p; // 返回当前节点,以便父节点进行统计 int mid = (l + r) &gt;&gt; 1; if (v &lt;= mid) ls(p) = add(ls(p), l, mid, v); else rs(p) = add(rs(p), mid + 1, r, v); return p;&#125;int find(int p, int l, int r, int v) &#123; if (l == r) return l; // 如果到达最底层说明找到了 int mid = (l + r) &gt;&gt; 1; // 现在要找到当前 l, r 第 k 小，如果左边节点个数能够达到，就在左边找，否则在右边找第 k - (cnt_l) 的点 if (v &lt;= v(ls(p))) return find(ls(p), l, mid, v); else return find(rs(p), mid + 1, r, v - v(ls(p)));&#125;int a[Maxn], b[Maxn];signed main() &#123; int n = read(), k = read() + 1; for (int i = 1; i &lt;= n; ++i) a[i] = read(), b[i] = a[i]; sort(b + 1, b + n + 1); for (int i = 1, v; i &lt;= n; ++i) &#123; v = lower_bound(b + 1, b + n + 1, a[i]) - b; add(1, 1, n, v); &#125; print(b[find(1, 1, n, k)]); return 0;&#125; 可持久化权值线段树 时间复杂度：O(nlogn)O(nlogn)O(nlogn) 可持久化的权值线段树可以解决静态区间第 k 小问题。 具体实现： 可持久化思想的引入也较好理解，可持久化顾名思义，就是支持继承某个历史版本并更新，注意主席树这里的历史版本和日常说的历史版本意义并不相同，这里的每个历史版本指的都是当前序列的每个前缀。 那访问历史版本复制一遍不就行了嘛？为什么还要再写别的东西呢？ 主要是考虑数据范围和时空限制。如果每次都复制一遍处理 10410^4104 级别的数据都很吃力。 所以就要考虑优化，首先，权值线段树的修改操作仅是单点修改，所以每次改动最多会造成线段树上一条链，即 lognlognlogn 个点的变化，所以我们可以依赖于历史版本，仅将需要修改的地方进行修改。并且记录每个版本的根即可。 对于要实现区间第 k 小的权值线段树来讲，每个插入一个数即建立一个新的版本，求 [L,R][L,R][L,R] 的第 k 小，就用 l−1l-1l−1 版本和 rrr 版本相对位置相同的节点的权值做差即可。其他与一般权值线段树类似。 注意：为了保证权值线段树的时间复杂度正确，一般要提前进行离散化操作，不会的话建议自行百度。 P3834 [模板]可持久化线段树 2 代码实现： 123456789101112131415161718192021222324252627282930313233343536373839404142434445464748495051525354555657585960616263646566676869707172737475767778798081828384858687888990// 线段树，可持久化权值线段树，树套树 学习笔记// 可持久化线段树 || 线段树模板// Code By CloudySky#include &lt;bits/stdc++.h&gt;// #define int long longnamespace IO &#123;inline int read() &#123; int x = 0, f = 1; char c = getchar(); while (c &lt; &#x27;0&#x27; || c &gt; &#x27;9&#x27;) &#123; if (c == &#x27;-&#x27;) f = -1; c = getchar(); &#125; while (c &gt;= &#x27;0&#x27; &amp;&amp; c &lt;= &#x27;9&#x27;) &#123; x = x * 10 + (c ^ 48); c = getchar(); &#125; return x * f;&#125;void print_n(int x) &#123; if (x &gt; 9) print_n(x / 10); putchar(x % 10 + &#x27;0&#x27;);&#125;inline void print(int x, char s = &#x27;\\n&#x27;) &#123; if (x &lt; 0) putchar(&#x27;-&#x27;), x = -x; print_n(x), putchar(s);&#125;&#125; // namespace IOusing namespace IO;const int Maxn = 2e5 + 10;using namespace std;int a[Maxn], b[Maxn], tot;struct Stree &#123; int ls, rs, val; #define ls(x) St[x].ls #define rs(x) St[x].rs #define v(x) St[x].val&#125; St[Maxn &lt;&lt; 6];// 这个函数用来构建初始局面，不过一般情况下无需使用。/*int build(int l, int r) &#123; int p = ++tot; // 动态开点 if (l == r) return p; // 最底层回溯 int mid = l + r &gt;&gt; 1; // 二分建树 ls(p) = build(l, mid); rs(p) = build(mid + 1, r); return p;&#125;*/// 这个函数用来插入新的权值int add (int p, int l, int r, int v) &#123; int np = ++tot; // 动态开点 St[np] = St[p], v(np) ++; // 继承上版本信息 || 更新当前版本信息 if (l == r) return np; // 下面为权值线段树内容 int mid = (l + r) &gt;&gt; 1; if (v &lt;= mid) ls(np) = add (ls(p), l, mid, v);// 递归传参仍要传旧版本，但更新的信息要存在新版本里 else rs(np) = add (rs(p), mid + 1, r, v); return np;&#125;int ask (int p, int q, int l, int r, int k) &#123; if (l == r) return l; // 最底层回溯 int s = v(ls(p)) - v(ls(q)); // 做差比较，求当前区间 int mid = (l + r) &gt;&gt; 1; // 二分查找 // 下面为权值线段树内容 if (k &lt;= s) return ask (ls(p), ls(q), l, mid, k); else return ask (rs(p), rs(q), mid + 1, r, k - s);&#125;int rt[Maxn];signed main() &#123; // 处理读入 int n = read (), m = read (); for (int i = 1; i &lt;= n; ++i) a[i] = read (), b[i] = a[i]; // 离散化 || 构建序列 sort (b + 1, b + n + 1); for (int i = 1, k; i &lt;= n; ++i) k = lower_bound (b + 1, b + n + 1, a[i]) - b, rt[i] = add (rt[i - 1], 1, n, k); // 处理询问 for (int i = 1; i &lt;= m; ++i) &#123; int l = read (), r = read (), k = read (); print (b[ask (rt[r], rt[l - 1], 1, n, k)]); &#125; return 0;&#125; 树套树 时间复杂度：O(nlog2n)O(nlog^2n)O(nlog2n) 树套树这里是指树状数组的思想套线段树，可以用解决主席树解决不了的遗憾——动态区间第 k 小。 具体实现： 介于主席树每次都要继承上一版本的思想，如果前面版本被修改了，后面版本必须全部修改，但这样时间复杂度就会退化，所以想要解决动态问题，就必须解决掉后面版本对前面版本的依赖性。 这就要用到树套树的思想，按照树状数组的样子，建 lognlognlogn 颗线段树。求解时只需要 lognlognlogn 颗线段树做差。 P2617 Dynamic Rankings 代码实现： 1234567891011121314151617181920212223242526272829303132333435363738394041424344454647484950515253545556575859606162636465666768697071727374757677787980818283848586878889909192939495// Code By CloudySky#include &lt;bits/stdc++.h&gt;// #define int long longnamespace IO &#123;inline int read() &#123; int x = 0, f = 1; char c = getchar(); while (c &lt; &#x27;0&#x27; || c &gt; &#x27;9&#x27;) &#123; if (c == &#x27;-&#x27;) f = -1; c = getchar(); &#125; while (c &gt;= &#x27;0&#x27; &amp;&amp; c &lt;= &#x27;9&#x27;) &#123; x = x * 10 + (c ^ 48); c = getchar(); &#125; return x * f;&#125;void print_n(int x) &#123; if (x &gt; 9) print_n(x / 10); putchar(x % 10 + &#x27;0&#x27;);&#125;inline void print(int x, char s = &#x27;\\n&#x27;) &#123; if (x &lt; 0) putchar(&#x27;-&#x27;), x = -x; print_n(x), putchar(s);&#125;&#125; // namespace IOusing namespace IO;const int Maxn = 2e5 + 10;using namespace std;struct Stree &#123; int ls, rs, val; #define ls(x) St[x].ls #define rs(x) St[x].rs #define v(x) St[x].val&#125; St[Maxn * 400];int rt[Maxn], tot;vector &lt;int&gt; as1, as2;int add(int p, int l, int r, int v, int k) &#123; int np = ++tot; St[np] = St[p], v(np) += k; if (l == r) return np; int mid = (l + r) &gt;&gt; 1; if (v &lt;= mid) ls(np) = add(ls(p), l, mid, v, k); else rs(np) = add(rs(p), mid + 1, r, v, k); return np;&#125;int ask(int l, int r, int k) &#123; if (l == r) return l; int x = 0, mid = (l + r) &gt;&gt; 1; for (int i : as1) x += v(ls(i)); for (int i : as2) x -= v(ls(i)); if (k &lt;= x) &#123; for (unsigned i = 0; i &lt; as1.size(); ++i) as1[i] = ls(as1[i]); for (unsigned i = 0; i &lt; as2.size(); ++i) as2[i] = ls(as2[i]); return ask(l, mid, k); &#125; else &#123; for (unsigned i = 0; i &lt; as1.size(); ++i) as1[i] = rs(as1[i]); for (unsigned i = 0; i &lt; as2.size(); ++i) as2[i] = rs(as2[i]); return ask(mid + 1, r, k - x); &#125;&#125;int a[Maxn], t[Maxn &lt;&lt; 1], cnt;struct query &#123; int op, l, r, k; &#125; q[Maxn];void Add(int pos, int val) &#123; int k = lower_bound(t + 1, t + cnt + 1, a[pos]) - t; for (int i = pos; i &lt;= Maxn - 10; i += (i &amp; -i)) rt[i] = add(rt[i], 1, cnt, k, val);&#125;int Ask(int l, int r, int k) &#123; as1.clear(), as2.clear(); for (int i = r; i; i -= (i &amp; -i)) as1.push_back(rt[i]); for (int i = l - 1; i; i -= (i &amp; -i)) as2.push_back(rt[i]); return t[ask(1, cnt, k)];&#125;signed main() &#123; int n = read(), m = read(); for (int i = 1; i &lt;= n; ++i) a[i] = read(), t[++cnt] = a[i]; static char s[5]; for (int i = 1; i &lt;= m; ++i) &#123; scanf(&quot;%s&quot;, s); q[i] = &#123;s[0] == &#x27;Q&#x27; ? 1 : 2, read(), read()&#125;; if (q[i].op == 1) q[i].k = read(); else t[++cnt] = q[i].r; &#125; sort(t + 1, t + cnt + 1); cnt = unique(t + 1, t + cnt + 1) - t - 1; for (int i = 1; i &lt;= n; ++i) Add(i, 1); for (int i = 1; i &lt;= m; ++i) &#123; int op = q[i].op, l, r, k, x, y; if (op == 1) l = q[i].l, r = q[i].r, k = q[i].k, print(Ask(l, r, k)); if (op == 2) x = q[i].l, y = q[i].r, Add(x, -1), a[x] = y, Add(x, 1); &#125; return 0;&#125; updated: 2021-10-14 扫描线 时间复杂度：O(nlogn)O(nlogn)O(nlogn) 扫描线算法是用来求解平面矩形面积和周长问题的一种算法。经常用线段树来维护。最常用的一种算法就是求矩形的面积并。 具体实现： 先上一张图： 对于这张图当中的两个矩形，可以把他拆成两条线段分别是左边界和右边界，将左边界上每个点的权值赋为 1，将右边界上每个点的权值赋为 -1。 然后想象一条竖线从左向右扫描。这条竖线用一颗线段树来维护，即线段数上的每个点对应 x=ax = ax=a 上的每个点。因为值域上最多有 2×n2 \\times n2×n 种取值，所以可以通过离散化使值域降低到可接受范围。 线段树需要维护的有两种信息，一个是当前线段整体被覆盖的次数，另一个是当前线段被覆盖的长度，用于更新答案。显然，如果 被覆盖的次数≥1\\text{被覆盖的次数} \\ge 1被覆盖的次数≥1 那么被覆盖的长度一定为当前线段的总长度，否则被覆盖的长度就是两个子线段被覆盖的和。 然后每次更新答案只需要 ans+=len(root)×(xnow−xlst)ans += len(root) \\times (x_{now}-x_{lst})ans+=len(root)×(xnow​−xlst​) 。 P5490 【模板】扫描线 代码实现： 1234567891011121314151617181920212223242526272829303132333435363738394041424344454647484950515253545556575859606162636465666768697071727374757677787980818283848586878889// 线段树，可持久化权值线段树，树套树 学习笔记#include &lt;bits/stdc++.h&gt;const int Maxn = 2e5 + 10;using namespace std;typedef long long ll;long long X[Maxn &lt;&lt; 1];struct Scanl &#123; long long l, r, h; int mark; bool operator&lt;(const Scanl&amp; y) const &#123; return h &lt; y.h; &#125;&#125; line[Maxn &lt;&lt; 1];namespace Segment_tree &#123;#define ls p &lt;&lt; 1#define rs p &lt;&lt; 1 | 1struct Stree &#123; int l, r, sum; ll len;#define l(x) St[x].l#define r(x) St[x].r#define s(x) St[x].sum#define ln(x) St[x].len&#125; St[Maxn &lt;&lt; 3];void build(int p, int l, int r) &#123; l(p) = l, r(p) = r; s(p) = ln(p) = 0; if (l == r) return; int mid = (l + r) &gt;&gt; 1; build(ls, l, mid); build(rs, mid + 1, r);&#125;void up(int p) &#123; if (s(p)) ln(p) = X[r(p) + 1] - X[l(p)]; else ln(p) = ln(ls) + ln(rs);&#125;void change(int p, ll l, ll r, int c) &#123; if (l(p) &gt;= l &amp;&amp; r(p) &lt;= r) &#123; s(p) += c, up(p); return; &#125; int mid = (l(p) + r(p)) &gt;&gt; 1; if (l &lt;= mid) change(ls, l, r, c); if (r &gt; mid) change(rs, l, r, c); up(p); return;&#125;&#125; // namespace Segment_treeusing namespace Segment_tree;unordered_map&lt; int, int &gt; pos; // 用来离散化映射signed main(void) &#123; int n; scanf(&quot;%d&quot;, &amp;n); for (int i = 1; i &lt;= n; ++i) &#123; long long x1, x2, y1, y2; scanf(&quot;%lld%lld%lld%lld&quot;, &amp;x1, &amp;y1, &amp;x2, &amp;y2); X[(i &lt;&lt; 1) - 1] = x1, X[i &lt;&lt; 1] = x2; line[(i &lt;&lt; 1) - 1] = (Scanl)&#123;x1, x2, y1, 1&#125;; line[i &lt;&lt; 1] = (Scanl)&#123;x1, x2, y2, -1&#125;; &#125; n &lt;&lt;= 1; sort(line + 1, line + n + 1); sort(X + 1, X + n + 1); int tot = unique(X + 1, X + n + 1) - X - 1; build(1, 1, tot - 1); for (int i = 1; i &lt;= tot; ++i) pos[X[i]] = i; ll ans = 0; for (int i = 1; i &lt; n; ++i) &#123; change(1, pos[line[i].l], pos[line[i].r] - 1, line[i].mark); ans += ln(1) * (line[i + 1].h - line[i].h); &#125; printf(&quot;%lld\\n&quot;, ans); return 0;&#125; 本文作者：CloudySky 写作时间： 2021-09-15 最后更新时间： 2021-12-25 遵循协议： BY-NC-SA","tags":"数据结构"},{"title":"离散对数 学习笔记","url":"/Blog/HOCE/","text":"时间复杂度：O(nlogn)O( \\sqrt n log n )O(n​logn) （不使用 mapmapmap 会剪掉一个 logloglog） 高次同余方程不同于线性同余方程。例： 给定 a,b,pa, b, pa,b,p，（a,p 互质）求解 xxx 使得 ax≡b(mod p)a ^ x \\equiv b (\\mod p)ax≡b(modp) 可以通过 BSGS 算法(Baby Step,Giant Step)(Baby\\ Step, Giant\\ Step)(Baby Step,Giant Step)，来实现。 具体实现： 设 x=i×t−jx = i \\times t - jx=i×t−j ，其中 t=⌈n⌉t = \\left\\lceil \\sqrt n \\right\\rceilt=⌈n​⌉ ，0≤j≤t0 \\le j \\le t0≤j≤t ，然后将方程移项，变成 ai×t≡b×aj(mod p)a ^ {i \\times t} \\equiv b \\times a ^ j (\\mod p)ai×t≡b×aj(modp) 。 然后枚举 j∈[0,t−1]j \\in [ 0, t - 1]j∈[0,t−1] ，将 b×aj(mod p)b \\times a ^ j (\\mod p)b×aj(modp) 插入 hash 表， 然后枚举 i∈[0,t]i \\in [0, t]i∈[0,t] ，求出 ai,t(mod p)a ^ {i ,t} (\\mod p)ai,t(modp) 并在 hash 表中查找，如果找到就返回 i×t−ji \\times t - ji×t−j， 否则说明没有答案。 证明： ∵gcd(a,p)=1\\because gcd(a,p) = 1∵gcd(a,p)=1 根据欧拉定理，aφ(p)≡1(mod p)a ^ {\\varphi (p)} \\equiv 1 (\\mod p)aφ(p)≡1(modp) 所以如果存在答案，一定在 [1,p][1,p][1,p] 范围内，否则无解。 代码实现： 123456789101112131415161718192021// 求解高次同余方程（离散对数） 学习笔记ll BSGS(ll a, ll b, ll p) &#123; map&lt; ll, ll &gt; hash; hash.clear(); ll t = ( ll ) sqrt(p) + 1; b %= p; for (ll j = 0; j &lt; t; ++j) &#123; ll val = b * Pow(a, j, p) % p; //枚举 j ，将右半边插入 hash 表 hash[val] = j; &#125; a = Pow(a, t, p); //以下所有 a 均为 a ^ t if (a == 0) return b == 0 ? 1 : -1; //特判为 0 情况 for (ll i = 0; i &lt;= t; ++i) &#123; ll val = Pow(a, i, p); if (hash.find(val) == hash.end()) //查表 continue; if (i * t - hash[val] &gt;= 0) return i * t - hash[val]; //找答案 &#125; return -1;&#125; P3846 [TJOI2007] 可爱的质数/[模板]BSGS 代码实现： 12345678910111213141516171819202122232425262728293031323334353637383940414243444546// 求解高次同余方程（离散对数） 学习笔记#include &lt;bits/stdc++.h&gt;#define ll long longusing namespace std;ll Pow(ll x, ll y, ll p) &#123; ll ans = 1; x %= p; for (; y; y &gt;&gt;= 1) &#123; if (y &amp; 1) ans = ans * x % p; x = x * x % p; &#125; return ans % p;&#125;ll BSGS(ll a, ll b, ll p) &#123; map&lt; ll, ll &gt; hash; hash.clear(); b %= p; ll t = ( ll ) sqrt(p) + 1; for (ll j = 0; j &lt; t; ++j) &#123; ll val = b * Pow(a, j, p) % p; hash[val] = j; &#125; a = Pow(a, t, p); if (a == 0) return b == 0 ? 1 : -1; for (ll i = 0; i &lt;= t; ++i) &#123; ll val = Pow(a, i, p); if (hash.find(val) == hash.end()) continue; else if (i * t - hash[val] &gt;= 0) return i * t - hash[val]; &#125; return -1;&#125;int main(void) &#123; ll p, b, n; scanf(&quot;%lld%lld%lld&quot;, &amp;p, &amp;b, &amp;n); ll l = BSGS(b, n, p); if (l == -1) puts(&quot;no solution&quot;); else printf(&quot;%lld&quot;, (l % p + p) % p); return 0;&#125; 本文作者：CloudySky 写作时间： 2021-09-14 最后更新时间： 2021-09-14 遵循协议： BY-NC-SA","tags":"数学"},{"title":"中国剩余定理 学习笔记","url":"/Blog/CRT/","text":"中国剩余定理 时间复杂度：O(nlogn)O(nlogn)O(nlogn) 中国剩余定理是用来解形如 x≡a1( mod m1)x≡a2( mod m2)x≡a3( mod m3)…x≡ak( mod mk)x \\equiv a_1(\\bmod m_1) \\\\ x \\equiv a_2(\\bmod m_2) \\\\ x \\equiv a_3(\\bmod m_3) \\\\ \\dots \\\\ x \\equiv a_k(\\bmod m_k) x≡a1​(modm1​)x≡a2​(modm2​)x≡a3​(modm3​)…x≡ak​(modmk​) 保证 m1,m2,…mkm_1,m_2,\\dots m_km1​,m2​,…mk​ 互质 的同余方程的最小整数解的算法。 具体实现： 设 M=∏i=1nmiM=\\prod_{i=1}^n m_iM=∏i=1n​mi​，Mi=M/miM_i = M / m_iMi​=M/mi​，MiTi≡1( mod mi)M_iT_i \\equiv 1(\\bmod m_i)Mi​Ti​≡1(modmi​) 。（即 TiT_iTi​ 是 MiM_iMi​ 在模 p 意义下的逆元） 则其中的一种特解为：ans=∑i=1nai×Mi×Tians = \\sum_{i=1}^n a_i \\times M_i \\times T_ians=∑i=1n​ai​×Mi​×Ti​，最小整数解即为 ans mod Mans \\bmod MansmodM 。 证明： ∵Mi=M/mi∴∀j∈[1,k],当i≠j时，ajMjTj≡0( mod mi)当i=j时，aiMiTi≡ai( mod mi)∴∑i=1kaiMiTi≡ai( mod mi)满足题意\\because M_i = M / m_i \\\\ \\therefore \\forall j\\in[1,k],\\text当 i ≠ j \\text{时，}a_jM_jT_j \\equiv 0(\\bmod m_i) \\\\ \\text当 i = j \\text{时，}a_iM_iT_i \\equiv a_i(\\bmod m_i) \\\\ \\therefore \\sum_{i=1}^ka_iM_iT_i\\equiv a_i(\\bmod m_i)\\text{满足题意} ∵Mi​=M/mi​∴∀j∈[1,k],当i=j时，aj​Mj​Tj​≡0(modmi​)当i=j时，ai​Mi​Ti​≡ai​(modmi​)∴i=1∑k​ai​Mi​Ti​≡ai​(modmi​)满足题意 P1495 [模板]中国剩余定理(CRT)/曹冲养猪 代码实现： 123456789101112131415161718192021222324252627282930313233343536373839404142// 中国剩余定理（CRT）及 Excrt 学习笔记// 中国剩余定理具体实现#include &lt;cstdio&gt;#define ll long longconst int Maxn = 12;using namespace std;long long a[Maxn], m[Maxn];long long Mi[Maxn], t[Maxn], ans = 0;void exgcd(ll a, ll b, ll&amp; x, ll&amp; y) &#123; if (!b) &#123; x = 1, y = 0; return; &#125; ll tx, ty; exgcd(b, a % b, tx, ty); x = ty, y = tx - a / b * ty; return;&#125;int main(void) &#123; int n; ll M = 1; scanf(&quot;%d&quot;, &amp;n); for (int i = 1; i &lt;= n; ++i) &#123; scanf(&quot;%lld%lld&quot;, &amp;m[i], &amp;a[i]); M *= 1ll * m[i]; &#125; for (int i = 1; i &lt;= n; ++i) &#123; Mi[i] = M / (1ll * m[i]); &#125; for (int i = 1; i &lt;= n; ++i) &#123; ll y; exgcd(Mi[i], m[i], t[i], y); t[i] = (t[i] % m[i] + m[i]) % m[i]; &#125; for (int i = 1; i &lt;= n; ++i) &#123; ans += a[i] * Mi[i] * t[i]; &#125; printf(&quot;%lld&quot;, ans % M); return 0;&#125; updated: 2021-09-14 拓展中国剩余定理（Excrt） 时间复杂度：O(nlogn)O(nlogn)O(nlogn) 拓展中国剩余定理这个名字我认为不很恰当，因为算法的实现思路和思维含量完全不同，仅仅是因为解决的问题类似。 Excrt 所能解决 m 并不互质的同余方程组。核心思路是将方程组一一合并（即构造出一个同余方程等效于同时满足两个同余方程），到最后剩下的便是答案。 具体实现： 首先思考如何合并两个方程组： x≡a1(mod m1)x \\equiv a_1(\\mod m_1)x≡a1​(modm1​) x≡a2(mod m2)x \\equiv a_2(\\mod m_2)x≡a2​(modm2​) 先把它化为标准形式 x=a1+k1×m1=a2+k2×m2x = a_1 + k_1 \\times m_1 = a_2 + k_2 \\times m_2x=a1​+k1​×m1​=a2​+k2​×m2​ 然后把它移项，变成： k1m1−k2m2=a2−a1k_1 m_1 - k_2 m_2 = a_2 - a_1k1​m1​−k2​m2​=a2​−a1​ 这样就是一个标准的一元二次不定方程，所以就可以判断无解情况，即 (a2−a1)∣gcd(m1,m2)( a_2 - a_1 ) | gcd ( m_1, m_2 )(a2​−a1​)∣gcd(m1​,m2​) 不成立。 然后解出来 k1,k2k_1 , k_2k1​,k2​ 。 合并后的方程组就变成了 x≡a1+k1×m1×(a2−a1)/gcd(m1,m2)(mod lcm(m1,m2))x \\equiv a_1 + k_1 \\times m_1 \\times ( a_2 - a_1 ) / gcd ( m_1, m_2 ) ( \\mod lcm ( m_1, m_2 ) )x≡a1​+k1​×m1​×(a2​−a1​)/gcd(m1​,m2​)(modlcm(m1​,m2​)) 接下来只需要依次合并方程组就可以了。 注意：在合并第 n−1n - 1n−1 和第 nnn 个方程时，要将 an−1a_{n-1}an−1​ 和 临时的解对 mnm_nmn​ 取模，来保证方程的正确性。 代码实现： 123456789101112131415161718192021// 中国剩余定理（CRT）及 Excrt 学习笔记// 拓展中国剩余定理具体实现namespace Excrt &#123;ll a1, m1;bool Insert(ll a2, ll m2) &#123; ll x, y; ll g = exgcd(m1, m2, x, y); ll c = (a2 - a1 % m2 + m2) % m2; if (c % g) &#123; return 0; &#125; ll lcm = m1 / g * m2; x = mul(x, c / g, m2); a1 += x * m1, a1 %= lcm; a1 = (a1 + lcm) % lcm; m1 = lcm; return true;&#125;&#125; // namespace Excrtusing namespace Excrt; P4777 [模板]扩展中国剩余定理（EXCRT） 代码实现： 123456789101112131415161718192021222324252627282930313233343536373839404142434445464748495051525354555657585960616263646566// 中国剩余定理（CRT）及 Excrt 学习笔记// 模板 扩展中国剩余定理#include &lt;cstdio&gt;const int Maxn = 1e5 + 10;#define ll long longusing namespace std;long long a[Maxn], m[Maxn];ll gcd(long long a, long long b) &#123; if (!b) return a; return gcd(b, a % b);&#125;ll exgcd(ll a, ll b, ll&amp; x, ll&amp; y) &#123; if (!b) &#123; x = 1, y = 0; return a; &#125; ll tx, ty, g = exgcd(b, a % b, tx, ty); x = ty, y = tx - a / b * ty; return g;&#125;ll mul(ll a, ll b, ll mod) &#123; ll ans = 0; for (; b; b &gt;&gt;= 1, a = (a &lt;&lt; 1) % mod) &#123; if (b &amp; 1) ans = (ans + a) % mod; &#125; return ans;&#125;namespace Excrt &#123;ll a1, m1;bool Insert(ll a2, ll m2) &#123; ll x, y; ll g = exgcd(m1, m2, x, y); ll c = (a2 - a1 % m2 + m2) % m2; if (c % g) &#123; return 0; &#125; ll lcm = m1 / g * m2; x = mul(x, c / g, m2); a1 += x * m1, a1 %= lcm; a1 = (a1 + lcm) % lcm; m1 = lcm; return true;&#125;&#125; // namespace Excrtint main(void) &#123; long long n; scanf(&quot;%lld&quot;, &amp;n); for (int i = 1; i &lt;= n; ++i) &#123; scanf(&quot;%lld%lld&quot;, &amp;m[i], &amp;a[i]); &#125; Excrt::a1 = a[1], Excrt::m1 = m[1]; for (int i = 2; i &lt;= n; ++i) &#123; if (!Excrt::Insert(a[i], m[i])) &#123; printf(&quot;No Solution&quot;); return 0; &#125; &#125; printf(&quot;%lld&quot;, (Excrt::a1 + Excrt::m1) % Excrt::m1); return 0;&#125; 本文作者：CloudySky 写作时间： 2021-09-12 最后更新时间： 2021-09-14 遵循协议： BY-NC-SA","tags":"数学"},{"title":"拓展欧几里得算法 学习笔记","url":"/Blog/Exgcd/","text":"时间复杂度： O(logn)O(logn)O(logn) 拓展欧几里得算法是用来解决二元一次不定方程的一种算法，即这个式子： ax+by=cax + by = cax+by=c 其中 c 一定要满足 c∣gcd(a,b)c | gcd(a,b)c∣gcd(a,b) 。否则无解。 它实际上是先解出来 ax+by=gcd(a,b)ax + by = gcd(a,b)ax+by=gcd(a,b) ，然后再将解出来的 x ×c/gcd(a,b)\\times c / gcd(a,b)×c/gcd(a,b) 即可。 具体实现： 当 b=0b = 0b=0 时，一组解就是 {x=1y=0\\begin{cases}x = 1 \\\\y = 0\\end{cases}{x=1y=0​ 。 只要在回溯时倒着推回去便能找到一组特解。 x0x_0x0​ 便是 x+k×lcm(a,b)x + k \\times lcm(a,b)x+k×lcm(a,b) 。 证明： ∵ax+by=gcd(a,b)且gcd(a,b)=gcd(b,amod b)将下带入上，并设bx′+(amod b)y′=gcd(b,amod b)又∵amod b=a−⌊a/b⌋∗b∴bx′+(a−⌊a/b⌋∗b)y′=gcd(a,b)这步很多博客都跳步了，但我认为其实很重要：∴ay′+bx′−b⌊a/b⌋∗y′=gcd(a,b)∴ay′+b(x′−⌊a/b⌋∗y′)=gcd(a,b)∴x=y′,y=x′−⌊a/b⌋∗y′\\because ax + by = gcd(a,b) \\\\ \\text且 gcd(a,b) = gcd(b,a\\mod b) \\\\ \\text{将下带入上，并设} \\\\ bx&#x27;+(a\\mod b)y&#x27;=gcd(b,a\\mod b) \\\\ \\text又\\because a\\mod b=a-\\left\\lfloor a/b \\right\\rfloor * b \\\\ \\therefore bx&#x27;+(a-\\left\\lfloor a/b \\right\\rfloor * b)y&#x27;=gcd(a,b) \\\\ \\text{这步很多博客都跳步了，但我认为其实很重要：} \\\\ \\therefore ay&#x27;+bx&#x27;-b\\left\\lfloor a/b \\right\\rfloor * y&#x27;=gcd(a,b) \\\\ \\therefore ay&#x27;+b(x&#x27; - \\left\\lfloor a/b \\right\\rfloor * y&#x27;)=gcd(a,b) \\\\ \\therefore x = y&#x27;,y = x&#x27; - \\left\\lfloor a/b \\right\\rfloor * y&#x27; ∵ax+by=gcd(a,b)且gcd(a,b)=gcd(b,amodb)将下带入上，并设bx′+(amodb)y′=gcd(b,amodb)又∵amodb=a−⌊a/b⌋∗b∴bx′+(a−⌊a/b⌋∗b)y′=gcd(a,b)这步很多博客都跳步了，但我认为其实很重要：∴ay′+bx′−b⌊a/b⌋∗y′=gcd(a,b)∴ay′+b(x′−⌊a/b⌋∗y′)=gcd(a,b)∴x=y′,y=x′−⌊a/b⌋∗y′ 代码实现： 12345678910// 拓展欧几里得算法（exgcd） 学习笔记int exgcd(int a, int b, int&amp; x, int&amp; y) &#123; if (!b) &#123; x = 1, y = 0; return a; &#125; int tx, ty, g = exgcd(b, a % b, tx, ty); x = ty, y = tx - a / b * ty; return g;&#125; exgcd 同时也可以用来求乘法逆元，条件是 xxx 和 ppp 互质。 原理是： 设 xxx 在mod p\\mod pmodp 意义下的逆元是 x−1x^{-1}x−1。 ∵x∗x−1≡1(mod p)\\because x * x^{-1} \\equiv 1(\\mod p) ∵x∗x−1≡1(modp) ∴x∗x−1=k∗p+1\\therefore x * x^{-1} = k * p + 1 ∴x∗x−1=k∗p+1 即x∗x−1−k∗p=1\\text即 x * x^{-1} - k * p = 1 即x∗x−1−k∗p=1 这样就化成了扩展欧几里得的常见形式了，xxx 和 ppp 已知，x−1x^{-1}x−1 和 kkk 是要求的。（但一般 k 求出来没有什么用） P1082 [NOIP2012 提高组] 同余方程 代码实现： 1234567891011121314151617181920212223// 拓展欧几里得算法（exgcd） 学习笔记#include &lt;cmath&gt;#include &lt;cstdio&gt;using namespace std;int exgcd(int a, int b, int&amp; x, int&amp; y) &#123; if (!b) &#123; x = 1, y = 0; return a; &#125; int tx, ty, g = exgcd(b, a % b, tx, ty); x = ty, y = tx - a / b * ty; return g;&#125;int main(void) &#123; int a, b, x, k; scanf(&quot;%d%d&quot;, &amp;a, &amp;b); int g = exgcd(a, b, x, k); x = (x % b + b) % b; printf(&quot;%d&quot;, x); return 0;&#125; 本文作者：CloudySky 写作时间： 2021-09-12 最后更新时间： 2021-09-12 遵循协议： BY-NC-SA","tags":"数学"},{"title":"矩阵 学习笔记","url":"/Blog/Matrix/","text":"矩阵 在数学中，矩阵（Matrix）是一个按照长方阵列排列的复数或实数集合，最早来自于方程组的系数及常数所构成的方阵。这一概念由19世纪英国数学家凯利首先提出。–百度百科 在 OI 中，矩阵也有很大的作用。一般写法为用结构题封装，靠重载运算符来定义运算。 矩阵运算法则： 加法，减法：求 a,ba, ba,b 矩阵的和：resresres 的每一个点等于 aaa 矩阵对应位置的点加上 bbb 矩阵的对应位置的点。 resi,j(0&lt;i,j&lt;sz)=ai,j+bi,jres_{i,j}(0&lt;i,j&lt;sz) = a_{i,j} + b_{i,j}resi,j​(0&lt;i,j&lt;sz)=ai,j​+bi,j​ 矩阵乘法：要求左矩阵的行数等于右矩阵的列数 resresres 的每个点等于 aaa 矩阵对应行的所有点分别乘 bbb 矩阵对应列的每个对应点 的和。 resi,j=∑k=0k&lt;szai,k×bk,jres_{i,j} = \\sum_{k = 0}^{k &lt; sz} a_{i,k} \\times b_{k,j}resi,j​=∑k=0k&lt;sz​ai,k​×bk,j​ 由上可见，矩阵乘法满足结合律，但不满足交换律。 矩阵除法：需要用高斯消元求逆矩阵。 还有一个需要注意的点：只有主对角线（左上到右下）为 1， 其他全为 0 的矩阵为单位矩阵，一般记作 III，任何矩阵乘单位矩阵都得它本身，在快速幂时会用到。 代码实现： 1234567891011121314151617181920212223242526272829303132333435363738394041424344// 矩阵 学习笔记// 矩阵基础知识具体实现namespace Matrix &#123;const int sz = 2;struct mat &#123; long long a[sz][sz]; mat() &#123; memset(a, 0, sizeof(a)); &#125; mat operator+(const mat&amp; T) const &#123; mat res; for (int i = 0; i &lt; sz; ++i) for (int j = 0; j &lt; sz; ++j) res.a[i][j] = (a[i][j] + T.a[i][j]) % p; return res; &#125; mat operator*(const mat&amp; T) const &#123; mat res; for (int i = 0; i &lt; sz; ++i) for (int k = 0; k &lt; sz; ++k) &#123; int r = a[i][k]; for (int j = 0; j &lt; sz; ++j) (res.a[i][j] += T.a[k][j] * r) %= P; &#125; return res; &#125; mat operator^(const long long&amp; x) const &#123; mat res, bas; for (int i = 0; i &lt; sz; ++i) res.a[i][i] = 1; for (int i = 0; i &lt; sz; ++i) for (int j = 0; j &lt; sz; ++j) bas.a[i][j] = a[i][j] % P; long long y = x; for (; y; y &gt;&gt;= 1) &#123; if (y &amp; 1) res = res * bas; bas = bas * bas; &#125; return res; &#125;&#125;;&#125; // namespace Matrixusing namespace Matrix; 矩阵加速递推 时间复杂度：O(sz3×logn)O(sz^3 \\times log n)O(sz3×logn) 矩阵加速递推是矩阵在 OI 中一种比较常用的用法，主要用于解决的是一个递推式要求的项数太多而 TLE 的问题。大多数矩阵加速递推都是从斐波那契数列入手： fi=fi−1+fi−2(i≥3)f_i = f_{i-1} + f_{i-2}(i \\ge 3)fi​=fi−1​+fi−2​(i≥3) 这个式子都会写，但如果让求 n=1e18n = 1e18n=1e18 时，就迷茫了。 这个时候就要用上矩阵了。 我们把转移要用的所有东西都放在矩阵里，对于斐波那契来说，这个矩阵就是 [fi−1,fi−2][f_{i-1},f_{i-2}][fi−1​,fi−2​] ， 然后把他想要变成的样子也放在矩阵里，就是 [fi,fi−1][f_i,f_{i-1}][fi​,fi−1​] 。（因为要继续递推，所以第二个矩阵的形式一定要和第一个矩阵保持一致） 接下来就要思考如何让第一个矩阵通过矩阵运算转移到第二个矩阵。我们就要从递推式 fi=fi−1+fi−2(i≥3)f_i = f_{i-1} + f_{i-2}(i \\ge 3)fi​=fi−1​+fi−2​(i≥3) 入手。我们发现第二个矩阵的第一项要通过第一个矩阵的两项之和来转移，所以转移矩阵的第一列即为：1,1。然后第二个矩阵的第二项直接由第一个矩阵的第一项漂移过来，与第一个矩阵的第二项无关，所以转移矩阵的第二列即为：1,0。 所以完整的递推式： [fifi−1]=[fi−1fi−2]×[1110]\\begin{bmatrix}f_i&amp;f_{i-1}\\end{bmatrix} = \\begin{bmatrix}f_{i-1}&amp;f_{i-2}\\end{bmatrix} \\times \\begin{bmatrix}1&amp;1\\\\1&amp;0\\end{bmatrix}[fi​​fi−1​​]=[fi−1​​fi−2​​]×[11​10​] 因为要求第 n 项，即 [1,1]×转移矩阵×转移矩阵×转移矩阵×…[1,1] \\times \\text{转移矩阵} \\times \\text{转移矩阵} \\times \\text{转移矩阵} \\times …[1,1]×转移矩阵×转移矩阵×转移矩阵×…，即 [1,1]×转移矩阵n−2[1,1] \\times \\text{转移矩阵}^{n-2}[1,1]×转移矩阵n−2（因为前两项已经在那了），这个时候就可以矩阵快速幂了，矩阵快速幂与普通快速幂类似。 代码实现： 1234567891011121314151617181920212223242526272829303132333435363738394041424344454647484950515253545556575859// 矩阵 学习笔记// 矩阵加速递推具体实现 || 斐波那契数列#include &lt;cstdio&gt;#include &lt;cstring&gt;const int P = 1e9 + 7;using namespace std;namespace Matrix &#123;const int sz = 2;struct mat &#123; long long a[sz][sz]; mat() &#123; memset(a, 0, sizeof(a)); &#125; mat operator*(const mat&amp; T) const &#123; mat res; for (int i = 0; i &lt; sz; ++i) for (int k = 0; k &lt; sz; ++k) &#123; int r = a[i][k]; for (int j = 0; j &lt; sz; ++j) (res.a[i][j] += T.a[k][j] * r) %= P; &#125; return res; &#125; mat operator^(const long long&amp; x) const &#123; mat res, bas; for (int i = 0; i &lt; sz; ++i) res.a[i][i] = 1; for (int i = 0; i &lt; sz; ++i) for (int j = 0; j &lt; sz; ++j) bas.a[i][j] = a[i][j] % P; long long y = x; for (; y; y &gt;&gt;= 1) &#123; if (y &amp; 1) res = res * bas; bas = bas * bas; &#125; return res; &#125;&#125;;&#125; // namespace Matrixusing namespace Matrix;int main(void) &#123; long long n; scanf(&quot;%lld&quot;, &amp;n); if (n == 1 || n == 2) &#123; printf(&quot;1&quot;); return 0; &#125; mat st; st.a[0][0] = st.a[0][1] = 1; mat bs; bs.a[1][1] = 0; bs.a[0][0] = bs.a[0][1] = bs.a[1][0] = 1; st = st * (bs ^ (n - 2)); printf(&quot;%lld&quot;, st.a[0][0]); return 0;&#125; updated: 2021-10-02 线段树套矩阵 时间复杂度：O(nlogn×sz3)O(nlogn\\times sz^3)O(nlogn×sz3) 既然矩阵拥有自己独立且较完整的运算法则，满足区间可加性，那么它就也可以用线段树维护。 线段树套矩阵支持区间乘 bsbsbs 幂，区间求和。大部分操作和普通线段树是一样的，值得注意的是，tagtagtag 标记必须打成矩阵，而非整形，否则会导致每次下传标记都要矩阵快速幂，从而时间复杂度退化。 具体实现： 建树时将每个节点的的 tagtagtag 打成 III 矩阵，每次下传标记时将 tagtagtag 与 III 比较，如果不同则代表标记被修改过，下传标记后仍将 tagtagtag 打成 III。查询时返回值设为 matmatmat 即可。 其他与普通线段树一致。 CF718C Sasha and Array 代码实现：  矩阵 学习笔记#include &lt;cstdio&gt;#include &lt;cstring&gt;#define ll long longconst long long P = 1e9 + 7;const int Maxn = 1e5 + 10;using namespace std;namespace Matrix &#123;const int sz = 2;struct mat &#123; long long a[sz][sz]; mat() &#123; memset(a, 0, sizeof(a)); &#125; mat operator+(const mat&amp; T) const &#123; mat res; for (int i = 0; i &lt; sz; ++i) for (int j = 0; j &lt; sz; ++j) res.a[i][j] = (a[i][j] + T.a[i][j]) % P; return res; &#125; mat operator*(const mat&amp; T) const &#123; mat res; for (int i = 0; i &lt; sz; ++i) for (int k = 0; k &lt; sz; ++k) &#123; long long r = a[i][k] % P; for (int j = 0; j &lt; sz; ++j) (res.a[i][j] += r * T.a[k][j] % P) %= P; &#125; return res; &#125; mat operator^(long long x) &#123; mat res, bs; for (int i = 0; i &lt; sz; ++i) res.a[i][i] = 1; for (int i = 0; i &lt; sz; ++i) for (int j = 0; j &lt; sz; ++j) bs.a[i][j] = a[i][j] % P; for (; x; x &gt;&gt;= 1) &#123; if (x &amp; 1) res = res * bs; bs = bs * bs; &#125; return res; &#125; bool operator==(const mat&amp; T) const &#123; bool flag = true; for (int i = 0; i &lt; sz; ++i) for (int j = 0; j &lt; sz; ++j) if (a[i][j] != T.a[i][j]) flag = false; return flag; &#125;&#125;;&#125; // namespace Matrixusing namespace Matrix;long long a[Maxn];mat bs, I;namespace Segment_Tree &#123;#define ls p &lt;&lt; 1#define rs p &lt;&lt; 1 | 1struct Stree &#123; int l, r; mat dat, tag;#define l(x) St[x].l#define r(x) St[x].r#define v(x) St[x].dat#define t(x) St[x].tag&#125; St[Maxn &lt;&lt; 3];void build(int p, int l, int r) &#123; l(p) = l, r(p) = r; t(p) = I; if (l(p) == r(p)) &#123; v(p) = bs ^ (a[l] - 1); return; &#125; int mid = (l(p) + r(p)) &gt;&gt; 1; build(ls, l, mid); build(rs, mid + 1, r); v(p) = v(ls) + v(rs);&#125;void spread(int p) &#123; if (t(p) == I) return; v(ls) = v(ls) * t(p); v(rs) = v(rs) * t(p); t(ls) = t(ls) * t(p); t(rs) = t(rs) * t(p); t(p) = I;&#125;void add(int p, int l, int r, mat k) &#123; if (l(p) &gt;= l &amp;&amp; r(p) &lt;= r) &#123; v(p) = v(p) * k; t(p) = t(p) * k; return; &#125; spread(p); int mid = (l(p) + r(p)) &gt;&gt; 1; if (l &lt;= mid) add(ls, l, r, k); if (r &gt; mid) add(rs, l, r, k); v(p) = v(ls) + v(rs);&#125;mat ask(int p, int l, int r) &#123; if (l(p) &gt;= l &amp;&amp; r(p) &lt;= r) &#123; return v(p); &#125; spread(p); int mid = (l(p) + r(p)) &gt;&gt; 1; mat ans; if (l &lt;= mid) ans = ans + ask(ls, l, r); if (r &gt; mid) ans = ans + ask(rs, l, r); return ans;&#125;&#125; // namespace Segment_Treeusing namespace Segment_Tree;signed main(void) &#123; mat st; st.a[0][0] = 1; bs.a[0][0] = bs.a[0][1] = bs.a[1][0] = 1; I.a[0][0] = I.a[1][1] = 1; int n, m; scanf(&quot;%d%d&quot;, &amp;n, &amp;m); for (int i = 1; i &lt;= n; ++i) &#123; scanf(&quot;%lld&quot;, &amp;a[i]); &#125; build(1, 1, n); for (int i = 1; i &lt;= m; ++i) &#123; int opt, l, r; ll k; scanf(&quot;%d%d%d&quot;, &amp;opt, &amp;l, &amp;r); if (opt == 1) &#123; scanf(&quot;%lld&quot;, &amp;k); mat tmp = bs ^ k; add(1, l, r, tmp); &#125; else &#123; mat ans = st; ans = ans * ask(1, l, r); printf(&quot;%lld\\n&quot;, ans.a[0][0]); &#125; &#125; return 0;&#125; update:2021-12-7 大概是 10.1 集训的时候学的这东西了，之前一直没来及写。 行列式 定义： 令 μ(P)\\mu(P)μ(P) 为 PPP 排列的逆序对数。 则 del(A)=∑P(−1)μ(P)∏kAk,pkdel(A) = \\sum_P(-1)^{\\mu(P)} \\prod_k A_{k, p_k} del(A)=P∑​(−1)μ(P)k∏​Ak,pk​​ 这玩意有没有啥具象意义我是不知道，反正就这么算的。 这个东西还有一些性质，用来加快运算： III 的行列式为 111 交换行列式的两行，行列式变号。 矩阵行列式具有线性性 若某一行乘 t，则行列式乘 t。 两个矩阵若只有一行不同则两个矩阵的行列式之和为当前行依次相加的矩阵的行列式。即为：∣x+x′y+y′ab∣=∣xyab∣+∣x′y′ab∣\\begin{vmatrix}x + x&#x27; &amp; y + y&#x27;\\\\ a &amp; b\\end{vmatrix} = \\begin{vmatrix}x &amp; y \\\\ a &amp; b\\end{vmatrix} + \\begin{vmatrix}x&#x27; &amp; y&#x27;\\\\ a &amp; b\\end{vmatrix} ∣∣​x+x′a​y+y′b​∣∣​=∣∣​xa​yb​∣∣​+∣∣​x′a​y′b​∣∣​ 有某两行一样的矩阵，行列式是 0。 用矩阵的一行加上另一行的倍数，行列式不变。即为： ∣ xyab∣=∣xya+kxb+ky∣\\begin{vmatrix}\\ x &amp; y \\\\ a &amp; b \\end{vmatrix} = \\begin{vmatrix} x &amp; y \\\\ a + kx &amp; b + ky \\end{vmatrix} ∣∣​ xa​yb​∣∣​=∣∣​xa+kx​yb+ky​∣∣​ 依次给出证明： 比较简单，因为只有主对角线一种排列方案最终会产生贡献。 因为交换两行相当于每个排列相较于原来都有两个数发生了变化，根据逆序对的性质，逆序对会发生奇数个变化。则前面的 (−1)μ(P)(-1)^{\\mu(P)}(−1)μ(P) 相较于原来会取反，导致行列式取反。 因为每行只选一个数，根据乘法分配律，成立。 同样因为每行只选一个数，根据乘法分配律，成立。 因为交换任意两行行列式取反，又因为交换相同的两行，矩阵并没有发生本质上的变化，所以 0 的相反数为 0。 构造一个矩阵 A=∣xyxy∣A = \\begin{vmatrix} x &amp; y \\\\ x &amp; y \\end{vmatrix}A=∣∣​xx​yy​∣∣​, B=∣ xyab∣B = \\begin{vmatrix}\\ x &amp; y \\\\ a &amp; b \\end{vmatrix}B=∣∣​ xa​yb​∣∣​ 根据上述规则，del(A)=0del(A) = 0del(A)=0，A′=∣xykxky∣A&#x27; = \\begin{vmatrix} x &amp; y \\\\ kx &amp; ky \\end{vmatrix}A′=∣∣​xkx​yky​∣∣​ 则 del(A′)=0del(A&#x27;) = 0del(A′)=0。然后… del(A′+B)=del(A′)+del(B)=del(B)del(A&#x27; + B) = del(A&#x27;) + del(B) = del(B)del(A′+B)=del(A′)+del(B)=del(B) 。 啊，我第一次学的时候没觉着有这么显然呀… 具体实现： 然后有了这几条性质，我们就可以用消元求行列式了。 代码实现： 1234567891011121314151617181920212223// 矩阵 学习笔记// 消元求行列式具体实现// 大体思路是先找到当前列中非零的某个值所对应的行号（一般为最大值），然后交换到当前行，然后把没有固定的行当前列消为零，最后行列式的值即为主对角线各值之积。double calc(int n) &#123; double res = 1.0; for (int i = 0; i &lt; n; ++i) &#123; int mx = i; for (int j = i + 1; j &lt; n; ++j) if (Abs(a[j][i]) &gt; Abs(a[mx][i])) mx = j; if (mx != i) for (int j = 0; j &lt; n; ++j) swap(a[i][j], a[mx][j]); for (int k = i + 1; k &lt; n; ++k) &#123; double mul = a[k][i] / a[i][i]; for (int j = i; j &lt; n; ++j) a[k][j] -= a[i][j] * mul; &#125; if (Abs(a[i][i]) &lt; eps) return 0; &#125; for (int i = 0; i &lt; n; ++i) res *= a[i][i]; return Abs(res);&#125; 矩阵树定理 矩阵树这个东西是用来计数的，他能实现的功能就是求一张图的生成树个数。大概包括无向图，有向图外向树，有向图内向树。但不能包括自环。 首先要了解 3 种关于图的矩阵： 邻接矩阵，记为 AAA ，这个应该没有什么问题。 度数矩阵，记为 DDD ，这个矩阵只有主对角线上有值，Di,iD_{i, i}Di,i​ 即为 i 节点的度数。 基尔霍夫矩阵（最烦音译了，就叫他矩阵树矩阵吧），记为 KKK， $K = D - A $。 设 K′K&#x27;K′ 为 KKK 去掉第 kkk 行，第 kkk 列 k∈(1,n)k \\in (1, n)k∈(1,n) 后的矩阵。（一般删根） 最终的答案就是 del(K′)del(K&#x27;)del(K′) 证明不会。。。 P4336 [SHOI2016]黑暗前的幻想乡: 代码实现（这道题还用了容斥）： 123456789101112131415161718192021222324252627282930313233343536373839404142434445464748495051525354555657585960616263646566676869707172737475767778798081828384858687888990919293949596979899100101102103104105106107108109110111// 矩阵 学习笔记#include &lt;cstdio&gt;#include &lt;cstring&gt;#include &lt;iostream&gt;const long long P = 1e9 + 7;using namespace std;typedef long long ll;inline long long Abs(long long x) &#123; return x &gt; 0 ? x : -x;&#125;long long Pow(long long x, long long y) &#123; long long ans = 1; x %= P; for (; y; y &gt;&gt;= 1) &#123; if (y &amp; 1) ans = (ans * x) % P; x = (x * x) % P; &#125; return ans % P;&#125;namespace Matrix &#123;const int sz = 20;struct mat &#123; long long a[sz][sz]; mat() &#123; memset(a, 0, sizeof(a)); &#125; mat operator+(const mat&amp; T) const &#123; mat res; for (int i = 0; i &lt; sz; ++i) &#123; for (int j = 0; j &lt; sz; ++j) res.a[i][j] = (a[i][j] + T.a[i][j]) % P; &#125; return res; &#125; mat operator-(const mat&amp; T) const &#123; mat res; for (int i = 0; i &lt; sz; ++i) &#123; for (int j = 0; j &lt; sz; ++j) res.a[i][j] = (a[i][j] + P - T.a[i][j]) % P; &#125; return res; &#125; long long calc(int n) &#123; long long res = 1ll; for (int i = 0; i &lt; n; ++i) &#123; int mx = i; for (int j = i + 1; j &lt; n; ++j) if (Abs(a[j][i]) &gt; Abs(a[mx][i])) mx = j; if (mx != i) &#123; res *= -1; for (int j = 0; j &lt; n; ++j) swap(a[i][j], a[mx][j]); &#125; for (int k = i + 1; k &lt; n; ++k) &#123; long long div = a[k][i] * Pow(a[i][i], P - 2) % P; for (int j = i; j &lt; n; ++j) a[k][j] = ((a[k][j] - a[i][j] * div % P) % P + P) % P; &#125; if (Abs(a[i][i]) == 0) return 0; &#125; res = (res + P) % P; for (int i = 0; i &lt; n; ++i) (res *= a[i][i]) %= P; return Abs(res); &#125;&#125;;&#125; // namespace Matrixusing namespace Matrix;int siz[262144], u[20][400], v[20][400], m[20];ll ans;int main(void) &#123; int n; scanf(&quot;%d&quot;, &amp;n); long long ans = 0; long long up = (1 &lt;&lt; (n - 1)) - 1; for (int i = 1; i &lt; n; i++) &#123; scanf(&quot;%d&quot;, &amp;m[i]); for (int j = 1; j &lt;= m[i]; j++) &#123; scanf(&quot;%d%d&quot;, &amp;u[i][j], &amp;v[i][j]); &#125; &#125; for (int i = 1; i &lt;= up; i++) &#123; siz[i] = siz[i &gt;&gt; 1] + (i &amp; 1); &#125; for (int j = 1; j &lt;= up; j++) &#123; mat K; for (int i = 1, p = j; p; p &gt;&gt;= 1, i++) &#123; if ((p &amp; 1) == 0) continue; for (int k = 1; k &lt;= m[i]; k++) &#123; int U = u[i][k] - 1; int V = v[i][k] - 1; K.a[U][U]++; K.a[V][V]++; K.a[U][V] = (K.a[U][V] + P - 1) % P; K.a[V][U] = (K.a[V][U] + P - 1) % P; &#125; &#125; long long det = K.calc(n - 1); ans = (ans + P + ((n - siz[j]) % 2 ? det : -det)) % P; &#125; printf(&quot;%lld\\n&quot;, ans); return 0;&#125; 本文作者：CloudySky 写作时间： 2021-09-12 最后更新时间： 2021-12-07 遵循协议： BY-NC-SA","tags":"数学"},{"title":"康托展开 学习笔记","url":"/Blog/Cantor/","text":"时间复杂度：O(nlogn)O(nlogn)O(nlogn) 康托展开（狭义）以及逆康托展开是指排列和阶乘进制数（即当前排列的字典序排名）进行转化的算法。 具体实现： 维护一个数据结构线段树或树状数组，用来维护未被选择的、比当前数字小的数的个数。 设到第 iii 位未被选择的、比当前数字小的数的个数为 aia_iai​。则： ans=∑i=1nai×(n−i)!+1ans = \\sum_{i=1}^n a_i \\times (n-i)! + 1ans=∑i=1n​ai​×(n−i)!+1 理解一下这个式子：当前面几位定好之后，这个排列的排名就只与比当前位小且还未被选择的数的个数有关。 例如：排列 1 2 5 4 3 答案便是 0×4!+0×3!+2×2!+1×1+0+1=60 \\times 4! + 0 \\times 3! + 2 \\times 2! + 1\\times 1 + 0 + 1 = 60×4!+0×3!+2×2!+1×1+0+1=6 。 统计每一位答案并在树上修改。 逆康托展开与之相反，且要求康托展开统计答案时用数组模拟阶乘进制数。 从后往前扫，在线段树上二分查找，有 aia_iai​ 个比它小且使用过的数的数。（即排名为 ai+1a_i + 1ai​+1 的数） 统计每一位答案并在树上修改。 U72177 火星人plus： 代码实现： 1234567891011121314151617181920212223242526272829303132333435363738394041424344454647484950515253545556575859606162636465666768697071727374757677787980818283848586878889// 康托展开 学习笔记#include &lt;cstdio&gt;const int Maxn = 1e5 + 10;using namespace std;long long n, m, p[Maxn], x[Maxn];namespace Segment_tree &#123;#define ls p &lt;&lt; 1#define rs p &lt;&lt; 1 | 1struct Stree &#123; int l, r; long long dat;#define l(x) St[x].l#define r(x) St[x].r#define v(x) St[x].dat&#125; St[Maxn &lt;&lt; 2];void build(int p, int l, int r) &#123; l(p) = l, r(p) = r; if (l == r) &#123; v(p) = 0; return; &#125; int mid = (l + r) &gt;&gt; 1; build(ls, l, mid), build(rs, mid + 1, r); v(p) = v(ls) + v(rs);&#125;long long ask(int p, int l, int r) &#123; if (l(p) &gt;= l &amp;&amp; r(p) &lt;= r) return v(p); int mid = (l(p) + r(p)) &gt;&gt; 1; long long ans = 0; if (l &lt;= mid) ans += ask(ls, l, r); if (r &gt; mid) ans += ask(rs, l, r); return ans;&#125;void add(int p, int v, long long k) &#123; if (l(p) == r(p)) &#123; v(p) += k; return; &#125; int mid = (l(p) + r(p)) &gt;&gt; 1; if (v &lt;= mid) add(ls, v, k); else add(rs, v, k); v(p) = v(ls) + v(rs);&#125;int find(int p, long long k) &#123; if (l(p) == r(p)) return l(p); if (v(ls) &gt;= k) return find(ls, k); else return find(rs, k - v(ls));&#125;&#125; // namespace Segment_treeusing namespace Segment_tree;signed main(void) &#123; scanf(&quot;%d%lld&quot;, &amp;n, &amp;m); build(1, 1, n); for (int i = n; i &gt;= 1; --i) scanf(&quot;%lld&quot;, &amp;p[i]); for (int i = 1; i &lt;= n; ++i) x[i] = ask(1, 1, p[i]), add(1, p[i], 1); x[1] += m; for (int i = 1; i &lt;= n; ++i) &#123; if (x[i] &lt; i) break; x[i + 1] += x[i] / i; x[i] %= i; &#125; for (int i = n; i &gt;= 1; --i) &#123; p[i] = find(1, x[i] + 1); add(1, p[i], -1); &#125; for (int i = n; i &gt;= 1; --i) printf(&quot;%lld &quot;, p[i]); return 0;&#125; 本文作者：CloudySky 写作时间： 2021-09-12 最后更新时间： 2021-09-12 遵循协议： BY-NC-SA","tags":"数学"},{"title":"FHQ_Treap 学习笔记","url":"/Blog/FHQ-Treap/","text":"时间复杂度：O(nlogn)O(nlogn)O(nlogn) FhqTreapFhqTreapFhqTreap 是一种 TreapTreapTreap 的变形，他摒弃了传统平衡树的旋转操作，取而代之的，是分裂和合并操作。具体而言一共包含 333 种函数： 按大小分裂，可以直接退化为非递归形式且不改变树的结构，类似线段树上二分，找到第 kkk 大的数（ kthkthkth ）。 按权值分裂 启发式合并操作 其中平衡树的操作都可以转变为这几种操作的组合。要维护的信息和普通的 TreapTreapTreap 基本一致，随即键值来保证树的结构的思想也如出一辙。 具体实现： 插入操作：读入一个数 xxx ，将 xxx 放入平衡树中。可以转变先按 xxx 将树分裂为左右两棵树 aaa 和 bbb，先将 aaa 和 xxx 合并，再将合并后的树与 bbb 合并。 （个人认为最难理解）删除操作：读入一个数 xxx， 删除平衡树中第一个权值为 xxx 的点。可以转变为先按 xxx 分裂为左右两棵子树 a,ba, ba,b，再将 aaa 按 x−1x - 1x−1 分裂为 a,ca, ca,c，最后先将 ccc 的左右子树合并再与 a,ba, ba,b 合并。原因：可能有多个相同的值，而只需要删除一个，在这些权值相同的数中，最好找的就是根节点，所以直接删除根节点即可。 查询排名操作：按 x−1x - 1x−1 分裂，左子树的大小 +1+ 1+1 就是 xxx 的排名。（因为可能存在重复数字，所以不能直接按 xxx 分裂） 按照排名找数：直接调用函数即可。 查前驱操作：先按 xxx 分裂为 a,ba, ba,b，再将 aaa 按 x−1x - 1x−1 分裂，或按 aaa 子树大小分裂，右子树即为所求（注意求出答案后要先把 aaa 重新合并好，再将 a,ba, ba,b 合并起来）。 查后继操作：与前驱类似，先按 xxx 分裂为 a,ba, ba,b，再将 bbb 按 x+1x + 1x+1 分裂，或按 111 大小分裂，左子树即为所求。 代码实现： 分裂函数： 12345678910// FHQ_Treap 学习笔记// 将 p 按照 val 分裂为 a 子树和 b 子树void splite (int p, int val, int &amp;a, int &amp;b) &#123; if (!p) &#123;a = b = 0; return;&#125; if (v(p) &lt;= val) // 说明 val 在右子树上，递归右子树 a = p, splite (rs(p), val, rs(p), b); else // 否则递归左子树 b = p, splite (ls(p), val, a, ls(p)); push_up (p); // 因为树的形态被改变，所以记着上传信息&#125; 按大小分裂函数的变形： 1234567891011121314// FHQ_Treap 学习笔记// 变形后的函数并不会真的改变树的结构，与线段树的二分查找类似，返回值是权值第 k + 1 大的元素int find (int p, int k) &#123; while (1) &#123; if (sz(ls(p)) &gt;= k) //要 找的值在左子树上 p = ls(p); else if (sz(ls(p)) + 1 == k) // 找到了 return v(p); else &#123; // 要找的值在右子树上，说明左子树以及根上的值都比要找的值小，k - (sz(ls) + 1)，在右子树上找 k -= sz(ls(p)) + 1; p = rs(p); &#125; &#125;&#125; 启发式合并函数： 12345678910111213// FHQ_Treap 学习笔记int merge (int a, int b) &#123; if (!a || !b) &#123;return a | b;&#125; // d 为随机权值来保证树的结构 if (d(a) &lt; d(b)) &#123; // 应该接在右子树上 rs(a) = merge (rs(a), b); push_up (a); return a; &#125; else &#123; // 应该接在左子树上 ls(b) = merge (a, ls(b)); push_up (b); return b; &#125;&#125; 六种操作： 1234567891011121314151617181920212223242526272829// FHQ_Treap 学习笔记 if (opt == 1) &#123; // 插入操作，先按照 x 分裂，插入节点后启发式合并。 splite (root, x, a, b); root = merge (merge (a, insert (x)), b);// 这里相当于把代码压缩了一下，相当于 t = merge (a, insert (x)), root = merge (t, b) &#125; if (opt == 2) &#123; // 删除操作，按照上文。 splite (root, x, a, b); splite (a, x - 1, a, c); c = merge (ls(c), rs(c)); root = merge (merge (a, c), b); &#125; if (opt == 3) &#123; // 查询排名。 splite (root, x - 1, a, b); printf (&quot;%d\\n&quot;, sz(a) + 1); root = merge (a, b); &#125; if (opt == 4) &#123; // 按照排名找数直接查就行了。 printf (&quot;%d\\n&quot;, find(root, x)); &#125; if (opt == 5) &#123; // 找前驱，这里用的是先按权值再按大小分裂。 splite (root, x - 1, a, b); printf (&quot;%d\\n&quot;, find (a, sz(a))); root = merge (a, b); &#125; if (opt == 6) &#123; // 同上。 splite (root, x, a, b); printf (&quot;%d\\n&quot;, find (b, 1)); root = merge (a, b); &#125; P3369 [模板]普通平衡树: 代码实现： 123456789101112131415161718192021222324252627282930313233343536373839404142434445464748495051525354555657585960616263646566676869707172737475767778798081828384858687888990919293949596979899// FHQ_Treap 学习笔记// Code By CloudySky#include &lt;bits/stdc++.h&gt;namespace IO// namespace IOconst int Maxn = 1e5 + 10;using namespace std;struct Treap &#123; int ls, rs, val, dat, siz; #define ls(x) T[x].ls #define rs(x) T[x].rs #define v(x) T[x].val #define d(x) T[x].dat #define sz(x) T[x].siz&#125; T[Maxn]; int tot;int insert (int val) &#123; int p = ++tot; ls(p) = rs(p) = 0; d(p) = rand (); v(p) = val, sz(p) = 1; return p;&#125;void push_up (int p) &#123; sz(p) = sz(ls(p)) + sz(rs(p)) + 1;&#125;void splite (int p, int val, int &amp;a, int &amp;b) &#123; if (!p) &#123;a = b = 0; return;&#125; if (v(p) &lt;= val) a = p, splite (rs(p), val, rs(p), b); else b = p, splite (ls(p), val, a, ls(p)); push_up (p);&#125;int merge (int a, int b) &#123; if (!a || !b) &#123;return a | b;&#125; if (d(a) &lt; d(b)) &#123; rs(a) = merge (rs(a), b); push_up (a); return a; &#125; else &#123; ls(b) = merge (a, ls(b)); push_up (b); return b; &#125;&#125;int find (int p, int k) &#123; while (1) &#123; if (sz(ls(p)) &gt;= k) &#123; p = ls(p); &#125; else if (sz(ls(p)) + 1 == k) &#123; return v(p); &#125; else &#123; k -= sz(ls(p)) + 1; p = rs(p); &#125; &#125;&#125;int root;signed main() &#123; int n = read (); for (int i = 1; i &lt;= n; ++i) &#123; int opt = read (), x = read (), a, b, c; if (opt == 1) &#123; splite (root, x, a, b); root = merge (merge (a, insert (x)), b); &#125; if (opt == 2) &#123; splite (root, x, a, b); splite (a, x - 1, a, c); c = merge (ls(c), rs(c)); root = merge (merge (a, c), b); &#125; if (opt == 3) &#123; splite (root, x - 1, a, b); printf (&quot;%d\\n&quot;, sz(a) + 1); root = merge (a, b); &#125; if (opt == 4) &#123; printf (&quot;%d\\n&quot;, find(root, x)); &#125; if (opt == 5) &#123; splite (root, x - 1, a, b); printf (&quot;%d\\n&quot;, find (a, sz(a))); root = merge (a, b); &#125; if (opt == 6) &#123; splite (root, x, a, b); printf (&quot;%d\\n&quot;, find (b, 1)); root = merge (a, b); &#125; &#125; return 0;&#125; 本文作者：CloudySky 写作时间： 2021-09-11 最后更新时间： 2021-09-11 遵循协议： BY-NC-SA","tags":"数据结构"},{"title":"schedule","url":"/Blog/schedule/","text":" 输入密码来证明你不是卷王","tags":"生活"},{"title":"字典树 学习笔记","url":"/Blog/Trie/","text":"字典树是 OI 中常用的数据结构，实现起来较为简单且常数较小，具有较高可拓展性，目前应用比较广泛的是 字符串 TrieTrieTrie 树， ACACAC 自动机， 01Trie01Trie01Trie ，和可持久化 01Trie01Trie01Trie ，它甚至可以实现平衡树的部分功能。 字符串 TrieTrieTrie 时间复杂度: O(n)O(n)O(n) 能方便地判定一个模式串是否为一些文本串的前缀 或 在文本串中出现过，又或者有些题会要求判出现次数。 具体实现（以判出现次数为例）： 读入文本串时，对于任意一个文本串，将每个字符作为边，并在路径末端节点（即每个字符串的末尾，并非每条边的终点）权值 +1+1+1，表示当前位置有一个字符串结束了。 每跳一个字符，如果当前节点已经存在就直接跳，否则新建一个节点。 匹配时，如果跳到某个节点不存在，直接 return false ，如果跳完所有的边还在树上就 return v[p] 代码实现： 1234567891011121314151617181920212223// 字典树 学习笔记// 字符串 Trie 具体实现int trie[Maxn][26], v[Maxn], tot;// trie 数组记录边的信息, v 记录点的信息, tot 为总结点数void insert(char* s) &#123; int p = 0, n = strlen(s); for (int k = 0; k &lt; n; ++k) &#123; int ch = s[k] - &#x27;a&#x27;; // 将字符转为 int if (!trie[p][ch]) trie[p][ch] = ++tot; // 如果没有就新建节点 p = trie[p][ch]; // 直接跳 &#125; v[p]++; // 标记跳到这里有一个字符串结束了&#125;int search(char* s) &#123; int n = strlen(s), p = 0; for (int k = 0; k &lt; n; ++k) &#123; p = trie[p][s[k] - &#x27;a&#x27;]; // 直接跳 if (!p) return false; // 节点不存在 &#125; return v[p]; // 已经跳完所有边&#125; 01Trie01Trie01Trie 时间复杂度:O(nlogn)O(nlogn)O(nlogn) 01 trie 是将数字按照二进制位从高到低依次表示存入字典树的数据结构，经常被用来解决最大异或和问题。 具体实现： 将所有数按照二进制存入 trie 树，长度不够的在高位补 0，保证树的深度一致。 每跳到一个节点就将当前节点的权值 +1,表示沿着当前节点往下走存在多少个数。 查询两个数的最大异或和时，能向不同的方向走，就向不同的方向走，不能就向同一方向走，边跳边记录数字，最终这两个数即为这个序列中异或和最大的两个数。 代码实现： 12345678910111213141516171819202122232425262728// 字典树 学习笔记// 01Trie 具体实现void insert(int val) &#123; int x = 0; bool c; for (int k = (1 &lt;&lt; 30); k; k &gt;&gt;= 1) &#123; //最高位补齐 c = val &amp; k; if (!trie[x][c]) &#123; //如果没有就新建节点 trie[x][c] = ++tot; &#125; x = trie[x][c]; //跳到子节点 &#125;&#125;int ask(int val) &#123; int ans = 0, x = 0; bool c; for (int k = (1 &lt;&lt; 30); k; k &gt;&gt;= 1) &#123; c = val &amp; k; if (trie[x][!c]) &#123; //如果存在相反的方向就向相反的方向跳,同时计入答案 ans += k; x = trie[x][!c]; //这里直接就入了异或和 &#125; else x = trie[x][c]; //否则就向相同的方向跳 &#125; return ans;&#125; 可持久化 01Trie01Trie01Trie 时间复杂度：O(nlogn)O(nlogn)O(nlogn) 可持久化 01Trie01Trie01Trie 与非可持久化 01Trie01Trie01Trie 功能类似，支持静态区间查询。 具体实现与线段树类似。 代码实现： 12345678910111213141516171819202122232425262728293031323334// 字典树 学习笔记// 可持久化 01Trie 具体实现//v数组记录的是当前这位及以上数的个数void insert(int p, int lst, int val) &#123; for (int i = 28; i &gt;= 0; --i) &#123; v[p] = v[lst] + 1; //先继承 if ((val &amp; (1 &lt;&lt; i)) == 0) &#123; if (!trie[p][0]) trie[p][0] = ++tot; //后修改 trie[p][1] = trie[lst][1]; p = trie[p][0]; lst = trie[lst][0]; &#125; else &#123; if (!trie[p][1]) trie[p][1] = ++tot; trie[p][0] = trie[lst][0]; p = trie[p][1]; lst = trie[lst][1]; &#125; &#125; v[p] = v[lst] + 1; return;&#125;int ask(int p1, int p2, int val) &#123; int ans = 0; for (int i = 28; i &gt;= 0; --i) &#123; bool t = (val &amp; (1 &lt;&lt; i)); if (v[trie[p1][!t]] - v[trie[p2][!t]]) &#123; //能向相反方向跳,就向相反方向跳。 ans += (1 &lt;&lt; i); p1 = trie[p1][!t], p2 = trie[p2][!t]; &#125; else //否则向相同方向跳 p1 = trie[p1][t], p2 = trie[p2][t]; &#125; return ans;&#125; TrieTrieTrie 树实现平衡树功能 时间复杂度：O(nlogn)O(nlogn)O(nlogn) 根据之前的内容，不难发现，TrieTrieTrie 树可以实现在 O(logn)O(logn)O(logn) 时间内找到序列中比某个数小的数的个数，且支持 O(log)O(log)O(log) 时间内修改操作，于是我们就可以借助 trie 树实现平衡树的功能。 Tire 树实现平衡树优点是常数较小，代码较好实现；缺点是对空间要求较大，容易被卡空间。 插入操作 具体实现：同 01trie 插入操作。 修改操作 具体实现：可以转为删除后插入操作。 1.2代码实现： 123456789101112// 字典树 学习笔记// Trie 树实现平衡树功能 || 插入修改操作具体实现void insert(int val, int k) &#123; int p = 1; for (int i = Maxk - 1; i &gt;= 0; --i) &#123; int c = (val &gt;&gt; i) &amp; 1; if (!trie[p][c]) trie[p][c] = ++cnt; p = trie[p][c]; v[p] += k; &#125;&#125; 查询排名操作 具体实现：一位一位的匹配，如果当前位为 0 直接向左跳，否则将左半边计入答案，向右跳。 代码实现： 123456789101112131415// 字典树 学习笔记// Trie 树实现平衡树功能 || 查询排名操作具体实现int check_nlt(int x) &#123; int p = 1, ans = 0; for (int i = Maxk - 1; i &gt;= 0; i--) &#123; if ((x &gt;&gt; i) &amp; 1) &#123; ans += v[trie[p][0]]; p = trie[p][1]; &#125; else p = trie[p][0]; if (!p) break; &#125; return ans;&#125;//直接查到的是比 x 小的数的个数,排名要 +1 根据排名查询数值操作 具体实现：类似线段树二分，如果左边个数小于 k 直接向左跳，否则 查询右半边 排名为 k-左半边个数 的数。 代码实现： 123456789101112131415// 字典树 学习笔记// Trie 树实现平衡树功能 || 根据排名查询数值具体实现int check_kth(int k) &#123; int p = 1, ans = 0; for (int i = Maxk - 1; i &gt;= 0; --i) &#123; if (v[trie[p][0]] &gt;= k) p = trie[p][0]; else &#123; ans |= (1 &lt;&lt; i); k -= v[trie[p][0]]; p = trie[p][1]; &#125; &#125; return ans;&#125; 前驱后继操作 具体实现：可以转换为 3.4 操作的组合。 5.6代码实现： 1234567891011// 字典树 学习笔记// Trie 树实现平衡树功能 || 前驱后继具体实现int pre(int x) &#123; return check_kth(check_nlt(x));&#125;int nxt(int x) &#123; int ans; ans = check_kth(check_nlt(x + 1) + 1); return ans;&#125; 本文作者：CloudySky 写作时间： 2021-08-19 最后更新时间： 2021-08-19 遵循协议： BY-NC-SA","tags":"数据结构 字符串 数学"},{"title":"拓扑排序 学习笔记","url":"/Blog/Topo/","text":"时间复杂度:O(n+m)O(n+m)O(n+m) 拓扑排序是对有向无环图节点排序的一种方法，一般通过广度优先搜索实现。可以方便我们实现在 DAG 上 DP 的转移，满足 DP 的无后效性。 具体实现： 在建图的同时统计每个点的入度。扫一遍所有节点，将入度为零的节点入队。 每次从队列中还未被访问的节点取出，从图中删除，即将它能到的节点入度 -1。 将入度被减为 0 的节点入队。 最终队列里的节点顺序即为此 DAG 的拓扑排序。 代码实现： 1234567891011121314// 拓扑排序 学习笔记void Topo(int n) &#123; for (int i = 1; i &lt;= n; i++) //扫描每个节点，寻找入度为0的点入队 if (!in[i]) q.push(i); while (!q.empty()) &#123; int u = q.front(); q.pop(); //从队列中取出未访问的点，如果需要可以再建一个数组存储 for (int i = head[u]; i; i = e[i].nxt) &#123; int v = e[i].v; in[v]--; //从图中删除这个节点 if (!in[v]) q.push(v); &#125; &#125;&#125; 本文作者：CloudySky 写作时间： 2021-08-10 最后更新时间： 2021-08-10 遵循协议： BY-NC-SA","tags":"图论"},{"title":"二分图基础知识 学习笔记","url":"/Blog/Bipartite-Graph/","text":"二分图的定义:一个无向图如果满足可以将点集分为两部分，且每部分之间互相没有连边，则称这个图为二分图。 二分图的性质：二分图中不存在奇环。 二分图的匹配:一个边的子集且所有点至多出现一次。 最大匹配 边最多的匹配。 交错路:一条路径，其中的边是交错的（一条匹配边，一条非匹配边，…）。 增广路:以非匹配点为端点，长度为奇数的交错路。 增广路的性质: 当图中不存在增广路时，此时的匹配为二分图最大匹配。 将增广路的边的状态翻转可以使最大匹配数 +1+1+1 。 匈牙利算法求二分图最大匹配 时间复杂度：O(nm)O(nm)O(nm) 匈牙利算法就是每次寻找增广路的算法。 具体实现: 枚举每一个节点，每次把标记数组清空，以当前节点为根 dfsdfsdfs 如果找到一条增广路，就更改之前的匹配并返回 truetruetrue 否则返回 falsefalsefalse，不做任何修改 代码实现： 12345678910111213141516// 二分图基础知识 学习笔记// 匈牙利算法求二分图最大匹配具体实现int map[1e3 + 10][1e3 + 10], flag[1e3 + 10], mtc[1e3 + 10];//这道题的输入已经将图的点集分好了，所以使用邻接表存图，mtc 数组为当前节点的匹配点bool dfs(int x) &#123; for (int i = 1; i &lt;= m; ++i) &#123; if (!map[x][i] &amp;&amp; flag[i]) //如果这两个点之间没有边或当前右部点被访问过，说明当前状态不合法。 continue; flag[i] = 1; //标记当前右部点被访问过。 if (!mtc[i] || dfs(mtc[i])) &#123; //如果当前右部点没有匹配点，或从当前右部点出发能找到一条增广路，说明当前道路是增广路。 mtc[i] = x; return true; //更改匹配节点，返回 true &#125; &#125; return false; //如果访问了所有边仍没找到增广路，返回 false&#125; 网络流求解二分图最大匹配 见 Flow 完美匹配 当二分图的左右部点数量相同时才会谈完美匹配。 完美匹配是所有点都是匹配点的一个匹配。 霍尔定理：对于任何左部点的子集 sss，与 sss 相邻的右部点的数量不小于 ∣s∣|s|∣s∣，则这个二分图存在最大匹配。 本文作者：CloudySky 写作时间： 2021-08-10 最后更新时间： 2021-08-10 遵循协议： BY-NC-SA","tags":"图论"},{"title":"P3275 [SCOI2011]糖果","url":"/Blog/p3275/","text":"P3275 [SCOI2011]糖果 题目大意： 给定 n 个点和 5 种相等或不等的约束条件共 K 个,求能否同时满足所有约束条件。 题目正解： 差分约束 + SPAF 题目思路： 无了 时间复杂度： O(nm)O(nm)O(nm) 题目代码: 12345678910111213141516171819202122232425262728293031323334353637383940414243444546474849505152535455565758596061626364656667686970717273747576777879808182//ps:这是一个无脑卡常后的代码…#include &lt;bits/stdc++.h&gt;const int Maxn = 100010;inline void read(int&amp; x) &#123; int f = 1; x = 0; char s = getchar(); while (s &lt; &#x27;0&#x27; || s &gt; &#x27;9&#x27;) &#123; if (s == &#x27;-&#x27;) f = -1; s = getchar(); &#125; while (s &gt;= &#x27;0&#x27; &amp;&amp; s &lt;= &#x27;9&#x27;) &#123; x = x * 10 + s - &#x27;0&#x27;; s = getchar(); &#125; x *= f;&#125;using namespace std;struct edge &#123; int v, t, nxt;&#125; e[Maxn &lt;&lt; 2];int head[Maxn], cnt[Maxn], Cnt;void add(int u, int v, int t) &#123; e[++Cnt].v = v, e[Cnt].t = t, e[Cnt].nxt = head[u], head[u] = Cnt;&#125;int dis[Maxn], book[Maxn];queue&lt; int &gt; q;//SPAF 判负环inline bool SPAF(int n) &#123; dis[0] = 0, book[0] = 1, cnt[0] = 1; q.push(0); while (!q.empty()) &#123; int x = q.front(); q.pop(); if (cnt[x] &gt;= n) return false; book[x] = 0; for (register int i = head[x]; i; i = e[i].nxt) &#123; int y = e[i].v, z = e[i].t; if (dis[y] &lt; dis[x] + z) &#123; dis[y] = dis[x] + z; if (!book[y]) q.push(y), book[y] = 1, cnt[y]++; &#125; &#125; &#125; return true;&#125;signed main() &#123; int n, m; read(n), read(m); for (register int i = n; i &gt;= 1; i--) &#123; add(0, i, 1); &#125; //差分约束建边 for (register int i = 1, k, x, y; i &lt;= m; i++) &#123; read(k), read(x), read(y); if (k == 1) add(x, y, 0), add(y, x, 0); if (k == 2) add(x, y, 1); if (k == 3) add(y, x, 0); if (k == 4) add(y, x, 1); if (k == 5) add(x, y, 0); if (!(k &amp; 1) &amp;&amp; x == y) &#123; printf(&quot;%d\\n&quot;, -1); return 0; &#125; &#125; if (!SPAF(n)) &#123; printf(&quot;%d\\n&quot;, -1); &#125; else &#123; //输出最小糖果数,也就是这张图最短路径树的大小 long long ans = 0; for (int i = n; i &gt;= 1; i--) &#123; ans += dis[i] * 1ll; &#125; printf(&quot;%lld\\n&quot;, ans); &#125; return 0;&#125; 本文作者：CloudySky 写作时间： 2021-08-10 最后更新时间： 2021-08-10 遵循协议： BY-NC-SA","tags":"图论 题解"},{"title":"P4171 [JSOI2010] 满汉全席","url":"/Blog/p4171/","text":"P4171 [JSOI2010] 满汉全席 题目大意： 给定 n 个点，每个点有两个状态和 m 组约束条件，每组包括两个约束条件 (opt,i)(opt,i)(opt,i) 表示第 iii 个点状态必须为 opt,opt∈[0,1]opt, opt\\in[0, 1]opt,opt∈[0,1] 。求能否 mmm 组条件都至少满足一个。 题目正解： 2-sat + tarjan 缩点 题目思路： 无了 时间复杂度： O(mlogn)O(mlogn)O(mlogn) 题目代码： 1234567891011121314151617181920212223242526272829303132333435363738394041424344454647484950515253545556575859606162636465666768697071727374757677787980818283848586878889909192//将 1 个点 x 拆成 2个点,m 为 x,h 为 x+n#include &lt;bits/stdc++.h&gt;const int Maxn = 1e3 + 10;using namespace std;struct edge &#123; int v, nxt;&#125; e[Maxn &lt;&lt; 2];int hd[Maxn], cnt, n, m;void add(int u, int v) &#123; e[++cnt] = (edge)&#123;v, hd[u]&#125;; hd[u] = cnt;&#125;int low[Maxn], dfn[Maxn], tim;int col[Maxn], vis[Maxn];int stc[Maxn], top;//dfn 表示 深搜时间戳,low 表示通过非搜索树边能到达的最远祖先void tarjan(int x) &#123; low[x] = dfn[x] = ++tim; //tarjan 算法 dfn 时间戳 stc[++top] = x; vis[x] = 1; for (int i = hd[x]; i; i = e[i].nxt) &#123; int y = e[i].v; if (!dfn[y]) &#123; //如果 y 还未访问 tarjan(y); low[x] = min(low[x], low[y]); &#125; else if (vis[y]) //如果 y 已访问说明当前边是非树边,更新 low low[x] = min(low[x], dfn[y]); &#125; if (low[x] == dfn[x]) &#123; //缩点 int y; while ((y = stc[top--]) != 0) &#123; vis[y] = 0; col[y] = x; if (y == x) break; &#125; &#125;&#125;inline void init() &#123; //由于多组询问要及时清空数组。 cnt = 0; memset(hd, 0, sizeof(hd)); memset(low, 0, sizeof(low)); memset(col, 0, sizeof(col)); memset(dfn, 0, sizeof(dfn)); memset(vis, 0, sizeof(vis));&#125;int main() &#123; int K; scanf(&quot;%d&quot;, &amp;K); while (K--) &#123; init(); scanf(&quot;%d%d&quot;, &amp;n, &amp;m); int x, y; char t1, t2; for (int i = 1; i &lt;= m; i++) &#123; cin &gt;&gt; t1 &gt;&gt; x &gt;&gt; t2 &gt;&gt; y; /*若两个点都要为 1 ,则将点 1 的 2 向点 2 的 1 连边,并将点 2 的 2 向点 1 的 1 连边,表示两个约束条件满足 1 个即可*/ if (t1 == &#x27;m&#x27;) &#123; if (t2 == &#x27;m&#x27;) add(x + n, y), add(y + n, x); else add(x + n, y + n), add(y, x); //同上 &#125; if (t1 == &#x27;h&#x27;) &#123; if (t2 == &#x27;m&#x27;) add(x, y), add(y + n, x + n); //同上 else add(x, y + n), add(y, x + n); //同上 &#125; &#125; for (int i = 1; i &lt;= 2 * n; i++) if (!dfn[i]) tarjan(i); bool flag = true; for (int i = 1; i &lt;= n; i++) //若有 1 个节点的 2 个状态在同一连通块中,则说明无解。 if (col[i] == col[i + n]) flag = false; if (flag) printf(&quot;GOOD\\n&quot;); else printf(&quot;BAD\\n&quot;); &#125; return 0;&#125; 本文作者：CloudySky 写作时间： 2021-08-10 最后更新时间： 2021-08-10 遵循协议： BY-NC-SA","tags":"图论 题解"},{"title":"玄学建图初步 学习笔记","url":"/Blog/Build-Graph/","text":"在解决实际问题的时候,有很多情况下一个看似与图论毫无关系的问题,也能通过一些巧妙的做法转化为图论问题。这些问题往往要用特殊的建图方法和一些图论知识来解决. 差分约束 因为最短路松弛操作满足:如果 Du+Wu,v&lt;DvD_{u}+ W_{u,v} &lt; D_{v}Du​+Wu,v​&lt;Dv​ 就更新 Dv=Du+Wu,vD_{v} = D_{u} + W_{u,v}Dv​=Du​+Wu,v​ ，即 Dv−Du⩽Wu,vD_{v} - D_{u} \\leqslant W_{u,v}Dv​−Du​⩽Wu,v​，与不等约束条件，如: X1−X2⩽kX_1-X_2 \\leqslant kX1​−X2​⩽k 非常相似。 所以当存在一些点和一些不等条件时,可以转化为 X1X_1X1​ 向 X2X_2X2​ 连一条权值为 kkk 的边。然后用 SPAFSPAFSPAF 判断是否存在负环即可。 2-sat 当存在一些具有两面性的事物,和一些约束条件,表示某个事物的一个性质和另一个事物的一个性质不能同时存在或必须存在一个时，就可以将每个事物表示成两个点，约束条件连边，用 tarjantarjantarjan 判断代表同一事物的两个点是否在同一连通块中。从而解决问题。 Problems: P3275 [SCOI2011]糖果 P4171 [JSOI2010] 满汉全席 本文作者：CloudySky 写作时间： 2021-08-10 最后更新时间： 2021-08-10 遵循协议： BY-NC-SA","tags":"图论"},{"title":"Tarjan算法 学习笔记","url":"/Blog/Tarjan/","text":"有向图强联通分量 有向图强联通分量是指，对于 G 的子图 G’ 中，任意两个点都能互达，则G’为G中的强联通分量。 即： ∀(u,v)∈G′,存在路径u−&gt;v且v−&gt;u\\forall (u,v)\\in G&#x27;,\\text{存在路径}u-&gt;v\\text{且}v-&gt;u∀(u,v)∈G′,存在路径u−&gt;v且v−&gt;u 无向图割点、割边 无向图的割点是指删去后能使无向图中连通块个数增加的点；割边是指删去后能使无向图连通块增加的边。 割点的等价描述： ∃u,w≠v\\exists u,w\\not= v∃u,w=v，Pu,wP_{u,w}Pu,w​ 都经过 v。 V−vV-vV−v 可划分为两个节点集 U,WU,WU,W，∀u∈U,w∈W\\forall u\\in U ,w\\in W∀u∈U,w∈W ,Pu,wP_{u,w}Pu,w​ 都经过 v。 割边的等价描述： eee 不属于 GGG 中的任何回路 ∃u,v∈G\\exists u,v\\in G∃u,v∈G ， eee 属于任何一条道路 Pu,vP_{u,v}Pu,v​ G−eG-eG−e 可划分为两个结点集 U,WU,WU,W，∀u∈U,w∈W\\forall u\\in U ,w\\in W∀u∈U,w∈W ， eee 属于任何一条道路 Pu,vP_{u,v}Pu,v​ tarjan 算法 时间复杂度 O(n+m)O(n+m)O(n+m) tarjan 算法是求有向图强联通分量和无向图割点割边的非常实用的算法，本质上是 DFSDFSDFS。 具体实现： 在一个有向图中进行 dfsdfsdfs 会出现以下 4 种边： 树边，当它指向的节点未被访问过时，会沿着这条边访问指向的节点，所以这条边会被加进搜索树里。 返祖边，当它指向的节点比当前节点深度小时，这条边被称为返祖边。 子向边，指向深度大于当前节点且已被访问过的点。 横插边，指向祖先节点的另一颗子树的边。 很容易发现，只有返祖边会产生强连通分量，所以只有 1,21, 21,2 边是有用的，tarjantarjantarjan 要做的就是找到这两种边，并统计强连通分量和进行缩点。 tarjantarjantarjan 算法有两个重要的数组，分别是 dfndfndfn （深搜时间戳）数组和 lowlowlow （非搜索树边能到达的深度最小祖先）数组，用来统计强连通分量，以及一个栈 stcstcstc 数组，用来缩点。 钦定 111 个节点也算一个强连通分量，这样所有的点必定属于一个强连通分量。可以发现的是，如果当前节点的 dfn=lowdfn = lowdfn=low 说明这个节点是当前连通块中深度最小的，由于每个连通块有且仅有一个这种点，所以可以把当前块内信息统计在这种点上。 有向图缩点要在访问完当前节点在搜索树上所有子节点后在弹栈缩点。而无向图中，由于一个节点可以属于多个双连通分量，所以要在每次访问完一个子节点后都尝试缩点。 代码实现：（有向图） 1234567891011121314151617181920212223242526// Tarjan 算法 学习笔记int a[Maxn];int dfn[Maxn], low[Maxn], tim, col[Maxn], vis[Maxn];int stc[Maxn], top;void dfs (int x) &#123; // 接下来三步一定要一气呵成，不然很容易挂。 stc[++top] = x, // 节点入栈 dfn[x] = low[x] = ++tim, // 标记时间戳 vis[x] = 1; // 标记已访问 for (int i = hd[x]; i; i = e[i].nxt) &#123; int y = e[i].v; if (!dfn[y]) dfs (y), // 如果没访问过，代表这条边是树边，深搜 low[x] = min (low[x], low[y]); // 用low[y]来更新low[x] else if (vis[y]) // 说明这条边是返祖边或子向边（横插边所指向的点 vis 均已成 0） low[x] = min (low[x], dfn[y]); // 用dfn[v]来更新low[u] &#125; if (low[x] == dfn[x]) &#123; int y; while ((y = stc[top--]) != 0) &#123; // 如果当前节点是当前连通块中深度最小的点,就更新答案 vis[y] = 0, col[y] = x; // 缩点 if (y == x) break; a[x] = min (a[x], a[y]); // 更新答案 &#125; &#125;&#125; 本文作者：CloudySky 写作时间： 2021-08-10 最后更新时间： 2021-08-10 遵循协议： BY-NC-SA","tags":"图论"},{"title":"欧拉路 学习笔记","url":"/Blog/Euler-Path/","text":"欧拉路本质上是一笔画问题的延伸，具有欧拉路的图有很多性质，具体如下： 无向图欧拉路： 有且仅有 222 个点度数为奇数，其余点度均为偶数；或所有点数均为偶数（欧拉回路） 有向图欧拉路： 除去起点和终点，所有店的入度和出度均相等。 起点出度比入度大 111，终点入度比出度大 111；或起点终点出入度相同（欧拉回路） 判定欧拉路 判断一张图是否为欧拉路一般要靠 dfsdfsdfs 实现，最后扫一遍是否有边未访问过。 时间复杂度:O(n+m)O(n+m)O(n+m) 代码实现： 12345678910// 欧拉路 学习笔记// 判定欧拉路具体实现void dfs(int x) &#123; for (int i = hd[x]; i; i = e[i].nxt) &#123; //枚举每一条边 int y = e[i].v; if (vis[i]) continue; //判断是否走过 vis[y] = 1; dfs(y); //如果没走过就走 &#125;&#125; Hierholzer 算法判定欧拉回路 时间复杂度: O(n+m)O(n+m)O(n+m) 具体实现： 选择任意顶点为起点，遍历所有相邻边。 深搜，访问所有相邻节点，将经过的边都删除。 如果当前顶点没有相临边，则将当前顶点入栈。 栈中的顶点倒序输出，则是从起点出发的欧拉回路。 代码实现： 1234567891011121314// 欧拉路 学习笔记// Hierholzer 算法判定欧拉回路具体实现int val[Maxn &lt;&lt; 1];int stc[Maxn], top;void dfs(int x) &#123; for (int i = hd[x]; i; i = e[i].nxt) &#123; if (!val[i]) continue; int y = e[i].v; val[i] = val[i ^ 1] = 0; dfs(y); &#125; stc[++top] = x;&#125; 本文作者：CloudySky 写作时间： 2021-08-10 最后更新时间： 2021-08-10 遵循协议： BY-NC-SA","tags":"图论"},{"title":"P1967 [NOIP2013 提高组] 货车运输","url":"/Blog/p1967/","text":"P1967 [NOIP2013 提高组] 货车运输 题目大意： 给定一张无向图,多组询问,每次查询两个点之间路径上最小边权最大。 题目正解： 最大生成树 + 倍增Lca 。 题目思路： 由于题目只要求最小边权最大，并没有限制路径长度，所以路径必然在整张图的最大生成树上。（因为最大生成树能保证整张图联通，且最小边权最大）。 所以要先用 Kruskal 算法构建出整张图的最小生成树，然后倍增找 Lca。 时间复杂度: O(mlogm+qlogn)O(mlogm+qlogn)O(mlogm+qlogn) 题目代码： 123456789101112131415161718192021222324252627282930313233343536373839404142434445464748495051525354555657585960616263646566676869707172737475767778798081828384858687888990919293949596979899100101102103104105106107108109110111112113114115116#include &lt;bits/stdc++.h&gt;#include &lt;queue&gt;const int Maxn = 1e4 + 10;const int Maxm = 1e5 + 10;#define inf 0x3f3f3f3fusing namespace std;int n, m, cnt, ans[Maxn];int fa[Maxn][22], w[Maxn][22], dep[Maxn], lg[Maxn], vis[Maxn];//fa 数组维护当前节点第 2 的 k 次方的祖先//w 数组维护在生成树上到相应 fa 的最小边权//dep 数组维护当前节点深度 lg 数组预处理 2 的 k 次方//vis 数组标记在深搜找 Lca 是当前节点是否被访问过int f[Maxn];int find(int x) &#123; //Kruskal最小生成树用并查集维护点的连通性 return x == f[x] ? x : f[x] = find(f[x]);&#125;inline int init() &#123; for (int i = 1; i &lt;= n; i++) //初始化并查集 f 数组和 lg 数组 f[i] = i, lg[i] = lg[i - 1] + (1 &lt;&lt; lg[i - 1] == i); memset(w, 0x3f, sizeof(w));&#125;struct Tedge &#123; int u, v, t; //在构建出最大生成树之前的临时边 bool operator&lt;(const Tedge y) const &#123; return t &gt; y.t; &#125;&#125; te[Maxm];struct edge &#123; int v, t, nxt;&#125; e[Maxm]; //最小生成树上的边int hd[Maxn], Cnt;void add(int u, int v, int t) &#123; e[++Cnt] = (edge)&#123;v, t, hd[u]&#125;; hd[u] = Cnt;&#125;void dfs(int x, int fx) &#123; //深搜预处理 dep 数组, fa 数组和 w 数组 vis[x] = 1; for (int i = 1; i &lt;= lg[dep[x]]; i++) &#123; fa[x][i] = fa[fa[x][i - 1]][i - 1]; //倍增跳 Lca //求 x 到 fa[x][i-1] 和 fa[x][i-1] 到 fa[x][i] 两段不相交路径上的最小值 w[x][i] = min(w[x][i - 1], w[fa[x][i - 1]][i - 1]); &#125; for (int i = hd[x]; i; i = e[i].nxt) &#123; int y = e[i].v; if (y != fx) &#123; dep[y] = dep[x] + 1; fa[y][0] = x; w[y][0] = e[i].t; dfs(y, x); &#125; &#125;&#125;int LCA(int x, int y) &#123; //处理询问 //深度不齐先让 y 深度更大,方便后面处理 int ans = inf; if (dep[x] &gt; dep[y]) swap(x, y); for (int k = lg[dep[y] - dep[x]]; k + 1; k--) &#123; //先只让 y 跳 Lca 补齐深度 if (dep[fa[y][k]] &gt;= dep[x]) &#123; ans = min(ans, w[y][k]); y = fa[y][k]; &#125; &#125; if (x == y) return ans; //如果 x 就是 y 的祖先,直接返回 for (int k = lg[dep[x]] - 1; k + 1; k--) &#123; //x 和 y 同时跳 Lca if (fa[x][k] != fa[y][k]) &#123; ans = min(ans, min(w[x][k], w[y][k])); x = fa[x][k], y = fa[y][k]; &#125; &#125; ans = min(ans, min(w[y][0], w[x][0])); return ans;&#125;int main() &#123; //初始化 scanf(&quot;%d%d&quot;, &amp;n, &amp;m); init(); for (int i = 1, x, y, t; i &lt;= m; i++) &#123; scanf(&quot;%d%d%d&quot;, &amp;x, &amp;y, &amp;t); te[i].u = x, te[i].v = y, te[i].t = t; &#125; //Kruskal sort(te + 1, te + m + 1); for (int i = 1; i &lt;= m; i++) &#123; if (cnt == n - 1) break; int t = te[i].t; int x = te[i].u, y = te[i].v, fx, fy; if ((fx = find(x)) == (fy = find(y))) continue; f[fx] = fy; add(x, y, t); add(y, x, t); &#125; //预处理 Lca for (int i = 1; i &lt;= n; i++) &#123; if (!vis[i]) &#123; dep[i] = 1, fa[i][0] = i; w[i][0] = inf, dfs(i, i); &#125; &#125; //倍增找 Lca 回答询问. int q; scanf(&quot;%d&quot;, &amp;q); for (int i = 1, x, y; i &lt;= q; i++) &#123; scanf(&quot;%d%d&quot;, &amp;x, &amp;y); if (find(x) != find(y)) printf(&quot;-1\\n&quot;); else printf(&quot;%d\\n&quot;, LCA(x, y)); &#125; return 0;&#125; 本文作者：CloudySky 写作时间： 2021-08-10 最后更新时间： 2021-08-10 遵循协议： BY-NC-SA","tags":"图论 题解"},{"title":"P2502 [HAOI2006]旅行","url":"/Blog/p2502/","text":"P2502 [HAOI2006]旅行 题目大意： 给定一张无向图,求从给定节点 s 到 给定节点 t 的最大权值比最小权值最小的路径。 题目正解： 最小生成树变式 题目思路： 首先用并查集特判 s 和 t 不连通的情况,输出 “imposiible”。 其次可以排除掉与起点和终点不连通的边。 由于要求最大权值比最小权值最小,所以可以将所有边排序。 然后从小到大枚举最大边，从最大边开始从大到小枚举最小边。 每次判断图是否联通，如果联通，计入备选答案。 最后从备选答案中选择最优解。 时间复杂度 O(n2)O(n^2)O(n2) 时间复杂度： O(m2)O(m^2)O(m2) 题目代码： 1234567891011121314151617181920212223242526272829303132333435363738394041424344454647484950515253545556575859606162636465666768697071727374757677787980818283848586#include &lt;bits/stdc++.h&gt;const int Maxn = 510;const int Maxm = 5e3 + 10;using namespace std;inline int gcd(int a, int b) &#123; return !b ? a : gcd(b, a % b);&#125;//由于题目最后输出需要约分,所以需要求 gcdint f[Maxn];int find(int x) &#123; return f[x] == x ? x : f[x] = find(f[x]);&#125;struct edge &#123; int u, v, t; bool operator&lt;(const edge y) const &#123; return t &lt; y.t; &#125;&#125; e[Maxm &lt;&lt; 1];int n, m, s, t, vis[Maxn], cnt;struct Ans &#123; int mx, mn;&#125; a[Maxm &lt;&lt; 1];//备选答案数组void solve() &#123; int fs = find(s); for (int i = 1; i &lt;= n; i++) if (find(i) != fs) vis[i] = 0; for (int i = 1; i &lt;= n; i++) f[i] = i; sort(e + 1, e + m + 1); for (int i = 1; i &lt;= m; i++) &#123; //正序枚举最大边 int u = e[i].u, v = e[i].v; if (!vis[u] || !vis[v]) continue; //判断是否合法 for (int j = 1; j &lt;= n; j++) f[j] = j; //初始化联通情况 for (int j = i; j; j--) &#123; int x = e[j].u, y = e[j].v; //倒序枚举最小边 if (!vis[x] || !vis[y]) continue; //删除无用边 int fx = find(x), fy = find(y); if (fx != fy) &#123; f[fx] = fy; int fs = find(s), ft = find(t); //如果合法更改联通情况 if (fs == ft) &#123; //判断当前状态是否合法 a[++cnt] = (Ans)&#123;e[i].t, e[j].t&#125;; //若合法计入备选答案 break; &#125; &#125; &#125; &#125;&#125;int main() &#123; //预处理 scanf(&quot;%d%d&quot;, &amp;n, &amp;m); for (int i = 1; i &lt;= n; i++) f[i] = i, vis[i] = 1; for (int i = 1, x, y, c; i &lt;= m; i++) &#123; scanf(&quot;%d%d%d&quot;, &amp;x, &amp;y, &amp;c); e[i] = (edge)&#123;x, y, c&#125;; int fx=find(x),fy=find(y))if(fx!=fy)f[fx]=fy; &#125; scanf(&quot;%d%d&quot;, &amp;s, &amp;t); //特判不联通 if (find(s) != find(t)) &#123; printf(&quot;IMPOSSIBLE\\n&quot;); return 0; &#125; //枚举,统计答案 solve(); double ans = 5e4; int pos = 0; //在合法解中寻找最优解 for (int i = 1; i &lt;= cnt; i++) &#123; if (( double ) a[i].mx / ( double ) a[i].mn &lt; ans) &#123; ans = (( double ) a[i].mx / a[i].mn); pos = i; &#125; &#125; //处理,输出 if (a[pos].mx % a[pos].mn == 0) printf(&quot;%d\\n&quot;, a[pos].mx / a[pos].mn); else &#123; int Gcd = gcd(a[pos].mn, a[pos].mx); printf(&quot;%d/%d\\n&quot;, a[pos].mx / Gcd, a[pos].mn / Gcd); &#125;&#125; 本文作者：CloudySky 写作时间： 2021-08-10 最后更新时间： 2021-08-10 遵循协议： BY-NC-SA","tags":"图论 题解"},{"title":"P2798 爆弹虐场","url":"/Blog/p2798/","text":"P2798 爆弹虐场 题目大意： 给定一张有向图，每条边有两个权值，保证权值 2 小于 权值 1，求至少包含 k 个权值 1 的MST 题目正解： 双边权最小生成树 + 二分查找（数据过水所以没用上） 题目思路： 写两个 cmp 函数，先按权值 1 排序，选择 k 条边。 再按权值 2 排序，选择 n-k-1 条边。 除此以外，就是 Kruskal 的模板了。 时间复杂度： O(mlogm)O(mlogm)O(mlogm) 题目代码： 123456789101112131415161718192021222324252627282930313233343536373839404142434445464748495051525354555657585960#include &lt;algorithm&gt;#include &lt;cstdio&gt;#include &lt;iostream&gt;const int Maxn = 1e4 + 10;using namespace std;int n, m, Ans = 0x3f3f3f3f;int f[Maxn];int find(int x) &#123; return x == f[x] ? x : f[x] = find(f[x]);&#125;struct edge &#123; int u, v, T, t;&#125; e[Maxn &lt;&lt; 1];bool cmp1(edge x, edge y) &#123; return x.T &lt; y.T;&#125;bool cmp2(edge x, edge y) &#123; return x.t &lt; y.t;&#125;bool work(int k) &#123; int ans = 0, tot = 0, i; for (int i = 1; i &lt;= n; ++i) &#123; f[i] = i; &#125; sort(e + 1, e + m + 1, cmp1); for (i = 1; i &lt;= m; ++i) &#123; //跑权值 1 最小生成树 int x = e[i].u, y = e[i].v; if (find(x) == find(y)) continue; f[f[y]] = f[x], ans = max(e[i].T, ans); tot++; if (tot == k) break; &#125; sort(e + 1, e + m + 1, cmp2); for (i = 1; i &lt;= m; ++i) &#123; //跑权值 2 最小生成树 int x = e[i].u, y = e[i].v; if (find(x) == find(y)) continue; f[f[y]] = f[x], ans = max(e[i].t, ans); tot++; if (tot == n - 1) break; &#125; if (ans &lt; Ans) &#123; Ans = ans; return true; &#125; return false;&#125;int main() &#123; int k; scanf(&quot;%d%d%d&quot;, &amp;n, &amp;k, &amp;m); for (int i = 1, x, y, T, t; i &lt;= m; ++i) &#123; scanf(&quot;%d%d%d%d&quot;, &amp;x, &amp;y, &amp;T, &amp;t); e[i] = (edge)&#123;x, y, T, t&#125;; &#125; work(k); //这本应该是二分/kk printf(&quot;%d&quot;, Ans); return 0;&#125; 本文作者：CloudySky 写作时间： 2021-08-10 最后更新时间： 2021-08-10 遵循协议： BY-NC-SA","tags":"图论 题解"},{"title":"最小生成树算法 (MST) 学习笔记","url":"/Blog/MST/","text":"最小生成树算法是利用一张连通图中生成树和最小生成树的一些特性来解决问题的一种算法。常见的最小生成树算法包含 PrimPrimPrim 和 KruskalKruskalKruskal 两种。 primprimprim 时间复杂度 O(mlogn)O(mlogn)O(mlogn) primprimprim 算法的实现与 dijkstradijkstradijkstra 类似，但略有不同，本质上也是贪心优化的广度优先搜索算法。 具体实现： 对于指定源点的，不做特殊处理；对于未指定节点的，建立一个超级源点，并向每个点连边。 初始化 disdisdis 数组为极大，并将源点放入优先队列，标记访问。 取出队头，遍历每一条非树边将元素放入队列，并更新 disdisdis ，更新答案，根据需求存边建树。 ps:disdisdis 数组存储的是距离树上当前子节点的距离，并非距离源点的距离。 完整的代码实现： 12345678910111213141516171819202122232425262728293031// 最小生成树算法 $(MST)$ 学习笔记// prim 算法具体实现int dis[1e5 + 10], vis[1e5 + 10], cnt;struct node &#123; int u, t; bool operator&lt;(const node y) const &#123; return t &gt; y.t; &#125;&#125;;priority_queue&lt; node &gt; q;void prim(int s) &#123; memset(dis, 0x3f, sizeof(dis)); dis[s] = 0; q.push((node)&#123;s, 0&#125;); //初始化操作 while (!q.empty() &amp;&amp; cnt &lt; n) &#123; node tmp = q.top(); q.pop(); int x = tmp.u; vis[x] = 1; cnt++; //记录已加入边数 for (int i = hd[x]; i; i = e[i].nxt) &#123; int y = e[i].v; if (!vis[y] &amp;&amp; e[i].t &lt; dis[y]) &#123; //访问非树边 dis[y] = e[i].t; q.push((node)&#123;y, dis[y]&#125;); &#125; &#125; &#125;&#125; KruskalKruskalKruskal 时间复杂度 O(mlogm)O(mlogm)O(mlogm) kruscalkruscalkruscal 算法与 PrimPrimPrim 本质不同，kruscalkruscalkruscal 算法运用了贪心思想和并查集优化。 具体实现： 用 u,v,wu,v,wu,v,w 结构体存储临时边。 按边权从小到大排序。 枚举每一条边 ei(i∈n)e_{i}(i\\in n)ei​(i∈n) ，用并查集判断 ui,viu_{i},v_{i}ui​,vi​ 是否属于同一集合。 如果不是，证明可以连边且不破坏树形结构，否则枚举下一条边。 直到边数达到 n−1n-1n−1。 代码容易理解不再赘述。 12345678910111213// 最小生成树算法 (MST) 学习笔记// Kruskal 算法具体实现void kruscal() &#123; sort(e + 1, e + 1 + m); for (int i = 1; i &lt;= n; i++) f[i] = i; for (int i = 1; i &lt;= m; i++) &#123; int x = e[i].u, y = e[i].v, t = e[i].t; if (find(u) != find(v)) &#123; f[find(u)] = find(v); ans += w; &#125; &#125;&#125; Problems: P1967 [NOIP2013 提高组] 货车运输 P2502 [HAOI2006]旅行 P2798 爆弹虐场 本文作者：CloudySky 写作时间： 2021-08-10 最后更新时间： 2021-08-10 遵循协议： BY-NC-SA","tags":"图论"},{"title":"CF507E Breaking Good","url":"/Blog/cf507e/","text":"CF507E Breaking Good 题目大意： 给定一张无向图，其中一些道路目前可以通行，另一些不能通行，找到从 111 到 nnn 的最短路，将最短路上不能通行的道路修复，不在最短路上且可以通行的道路删除，问最小改动数，和需要修改的边改后的状态 题目正解： 最短路 + 记录最短路径 + 暴力枚举 题目思路： 首先由于找最短路时不需要考虑道路能否通行，所以可以直接 SPAFSPAFSPAF 或 dijkstradijkstradijkstra 找到最短路，同时用 preprepre 数组维护最短路，跑完最短路后，标记每条路是否在最短路上。如果在最短路上且无法通行或不在最短路上且可以通行就将答案 +1+1+1。 时间复杂度： O(mlogn)O(mlogn)O(mlogn) 题目代码： 12345678910111213141516171819202122232425262728293031323334353637383940414243444546474849505152535455565758596061626364656667686970717273747576777879808182838485868788#include &lt;bits/stdc++.h&gt;const int Maxn = 1e5 + 10;using namespace std;int cd(int x) &#123; return x &amp; 1 ? x + 1 : x - 1;&#125;//由于我的 cnt 是从 1 开始的,所以要写一个函数来记录它的反向边struct edge &#123; int v, nxt, t, u;&#125; e[Maxn &lt;&lt; 1];int hd[Maxn], cnt;void add(int u, int v, int t) &#123; e[++cnt] = (edge)&#123;v, hd[u], t, u&#125;, hd[u] = cnt;&#125;int n, dis[Maxn], chd[Maxn], vis[Maxn];int pre[Maxn], tot;//chd 数组代表这条路径上修复多少条道路,作为最短路的第二关键字//pre 数组来记录最短路径queue&lt; int &gt; q;void SPAF() &#123; memset(dis, 0x3f, sizeof(dis)); memset(chd, 0x3f, sizeof(chd)); q.push(1), vis[1] = 1; dis[1] = 0, chd[1] = 0; while (!q.empty()) &#123; int x = q.front(); q.pop(); vis[x] = 0; for (int i = hd[x]; i; i = e[i].nxt) &#123; int y = e[i].v, c = e[i].t ^ 1; //当第一关键字相同时,采取第二关键字来比较路径长度。 if (dis[y] == dis[x] + 1 &amp;&amp; chd[y] &gt; chd[x] + c) &#123; //如果当前边在到达 y 点的最短路径上,就用 pre 数组记录。 chd[y] = chd[x] + c; pre[y] = i; if (!vis[y]) q.push(y), vis[y] = 1; &#125; else if (dis[y] &gt; dis[x] + 1) &#123; dis[y] = dis[x] + 1; //虽然不是因为第二关键字更新答案,但第二关键字也要更新,否则路径信息可能混乱。 chd[y] = chd[x] + c; pre[y] = i; if (!vis[y]) q.push(y), vis[y] = 1; &#125; &#125; &#125;&#125;bool g1[Maxn &lt;&lt; 1], g2[Maxn &lt;&lt; 1];//g1 标记在最短路上的边,g2 标记在最短路上且不能通行的边。int main() &#123; int m; scanf(&quot;%d%d&quot;, &amp;n, &amp;m); for (int i = 1, x, y, t; i &lt;= m; i++) &#123; scanf(&quot;%d%d%d&quot;, &amp;x, &amp;y, &amp;t); add(x, y, t), add(y, x, t); &#125; SPAF(); int x = n; while (x != 1) &#123; g1[pre[x]] = g1[cd(pre[x])] = true; if (!e[pre[x]].t) g2[pre[x]] = g2[cd(pre[x])] = true; x = e[pre[x]].u; &#125; int Ans[Maxn][4]; for (int i = 1; i - 1 &lt;= cnt; i += 2) &#123; //不在最短路上且可以通行,要炸毁 if ((!g1[i] || !g1[cd(i)]) &amp;&amp; e[i].t) &#123; Ans[++tot][1] = e[i].u; Ans[tot][2] = e[i].v; Ans[tot][3] = 0; //在最短路上且不能通行,要修复 &#125; if (g2[i] || g2[cd(i)]) &#123; Ans[++tot][1] = e[i].u; Ans[tot][2] = e[i].v; Ans[tot][3] = 1; &#125; &#125; printf(&quot;%d\\n&quot;, tot); for (int i = 1; i &lt;= tot; i++) printf(&quot;%d %d %d\\n&quot;, Ans[i][1], Ans[i][2], Ans[i][3]); return 0;&#125; 本文作者：CloudySky 写作时间： 2021-08-10 最后更新时间： 2021-08-10 遵循协议： BY-NC-SA","tags":"图论 题解"},{"title":"CF543B Destroying Roads","url":"/Blog/cf543b/","text":"CF543B Destroying Roads 题目大意： 给定一张无向图，边权均为 111，和两个约束条件，s1s_1s1​ 到 t1t_1t1​ 最短路不超过 l1l_1l1​ ，s2s_2s2​ 到 t2t_2t2​ 最短路不超过 l2l_2l2​ 。问最多删除多少条边。 题目正解： 最短路 + 暴力枚举 题目思路: 求出任意两点最短路。枚举 [(s1−&gt;t1)和(s2−&gt;t2)]或[(s1−&gt;t1)和(t2−&gt;s2)][(s1-&gt;t1) 和 (s2-&gt;t2)] 或 [(s1-&gt;t1) 和 (t2-&gt;s2)][(s1−&gt;t1)和(s2−&gt;t2)]或[(s1−&gt;t1)和(t2−&gt;s2)] 路径重合部分的端点,使得总路径长合法,求出此时保留的路径长，再与总边数作差求最大炸毁数。同时与答案取 maxmaxmax 。 时间复杂度： O(n2)O(n^2)O(n2) 题目代码： 1234567891011121314151617181920212223242526272829303132333435363738394041424344454647484950515253545556575859606162636465666768697071727374757677#include &lt;cstdio&gt;#include &lt;iostream&gt;#include &lt;queue&gt;#define inf 0x3f3f3f3fconst int Maxn = 3e3 + 10;using namespace std;int s1, t1, s2, t2, l1, l2, Ans = -1, n, m;struct edge &#123; int v, nxt, u;&#125; e[Maxn &lt;&lt; 1];int hd[Maxn], cnt;void add(int u, int v) &#123; e[++cnt] = (edge)&#123;v, hd[u], u&#125;; hd[u] = cnt;&#125;int dis[Maxn][Maxn];queue&lt; int &gt; q;//n 轮 SPAF 求任意两点最短路。void SPAF(int s) &#123; dis[s][s] = 0; q.push(s); while (!q.empty()) &#123; int x = q.front(); q.pop(); for (int i = hd[x]; i; i = e[i].nxt) &#123; int y = e[i].v; if (dis[s][y] != inf) continue; dis[s][y] = dis[s][x] + 1; q.push(y); &#125; &#125;&#125;//判定 (s1-&gt;t1) 和 (s2-&gt;t2) 重合部分端点为 x,y 是否合法bool check1(int x, int y) &#123; return (dis[s1][x] + dis[x][y] + dis[y][t1] &lt;= l1 &amp;&amp; dis[s2][x] + dis[x][y] + dis[y][t2] &lt;= l2);&#125;//判定 (s1-&gt;t1) 和 (t2-&gt;s2) 重合部分端点为 x,y 是否合法bool check2(int x, int y) &#123; return (dis[s1][x] + dis[x][y] + dis[y][t1] &lt;= l1 &amp;&amp; dis[t2][x] + dis[x][y] + dis[y][s2] &lt;= l2);&#125;//计算以 x,y 为重合部分端点最大销毁数int calm1(int x, int y) &#123; return m - (dis[s1][x] + dis[s2][x] + dis[x][y] + dis[y][t1] + dis[y][t2]);&#125;//计算以 x,y 为重合部分端点最大销毁数int calm2(int x, int y) &#123; return m - (dis[s1][x] + dis[t2][x] + dis[x][y] + dis[y][t1] + dis[y][s2]);&#125;int main() &#123; scanf(&quot;%d%d&quot;, &amp;n, &amp;m); for (int i = 1; i &lt;= n; ++i) &#123; for (int j = 1; j &lt;= n; ++j) dis[i][j] = inf; &#125; for (int i = 1, x, y; i &lt;= m; ++i) &#123; scanf(&quot;%d%d&quot;, &amp;x, &amp;y); add(x, y), add(y, x); &#125; for (int i = 1; i &lt;= n; ++i) SPAF(i); scanf(&quot;%d%d%d&quot;, &amp;s1, &amp;t1, &amp;l1); scanf(&quot;%d%d%d&quot;, &amp;s2, &amp;t2, &amp;l2); for (int i = 1; i &lt;= n; ++i) for (int j = 1; j &lt;= n; j++) &#123; //检验状态合法并统计答案 if (check1(i, j)) Ans = max(Ans, calm1(i, j)); if (check2(i, j)) Ans = max(Ans, calm2(i, j)); //同上 &#125; if (dis[s1][t1] &lt;= l1 &amp;&amp; dis[s2][t2] &lt;= l2) &#123; //判断无重合部分是否合法并取 max Ans = max(Ans, m - dis[s1][t1] - dis[s2][t2]); &#125; printf(&quot;%d&quot;, Ans); return 0;&#125; 本文作者：CloudySky 写作时间： 2022-03-05 最后更新时间： 2022-03-05 遵循协议： BY-NC-SA","tags":"图论 题解"},{"title":"CF545E Paths and Trees","url":"/Blog/cf545e/","text":"CF545E Paths and Trees 题目大意: 给定一张带正权的无向图和一个源点，求边权和最小的最短路径树。 题目正解: 最短路 + 记录最短路径 题目思路: 无了 时间复杂度： O(mlogn)O(mlogn)O(mlogn) 题目代码: 1234567891011121314151617181920212223242526272829303132333435363738394041424344454647484950515253545556575859606162636465666768697071727374//没有什么可注释的#include &lt;bits/stdc++.h&gt;#define ll long longconst int Maxn = 3e5 + 10;using namespace std;struct edge &#123; int v, nxt; ll t;&#125; e[Maxn &lt;&lt; 1];int hd[Maxn], cnt;void add(int u, int v, ll t) &#123; e[++cnt] = (edge)&#123;v, hd[u], t&#125;; hd[u] = cnt;&#125;struct node &#123; int u; ll d; bool operator&lt;(const node y) const &#123; return d &gt; y.d; &#125;&#125;;priority_queue&lt; node &gt; q;int n, m, vis[Maxn], pre[Maxn];ll dis[Maxn], ans[Maxn];void solve(int s) &#123; memset(dis, 0x3f, sizeof(dis)); dis[s] = 0; q.push((node)&#123;s, 0&#125;); while (!q.empty()) &#123; node tmp = q.top(); q.pop(); int x = tmp.u; if (vis[x]) continue; vis[x] = 1; for (int i = hd[x]; i; i = e[i].nxt) &#123; int y = e[i].v; if (dis[y] &gt; dis[x] + e[i].t) &#123; dis[y] = dis[x] + e[i].t; pre[y] = i; q.push((node)&#123;y, dis[y]&#125;); &#125; if (dis[y] == dis[x] + e[i].t &amp;&amp; e[i].t &lt; e[pre[y]].t) &#123; pre[y] = i; &#125; &#125; &#125;&#125;int main() &#123; int s; scanf(&quot;%d%d&quot;, &amp;n, &amp;m); for (int i = 1, x, y; i &lt;= m; i++) &#123; long long t; scanf(&quot;%d%d%lld&quot;, &amp;x, &amp;y, &amp;t); add(x, y, t), add(y, x, t); &#125; scanf(&quot;%d&quot;, &amp;s); solve(s); ll sum = 0; for (int i = 1; i &lt;= n; i++) &#123; if (i == s) continue; sum += e[pre[i]].t; &#125; printf(&quot;%lld\\n&quot;, sum); for (int i = 1; i &lt;= n; i++) &#123; if (i == s) continue; printf(&quot;%d &quot;, (pre[i] + 1) / 2); &#125; return 0;&#125; 本文作者：CloudySky 写作时间： 2021-08-10 最后更新时间： 2021-08-10 遵循协议： BY-NC-SA","tags":"图论 题解"},{"title":"CF666B World Tour","url":"/Blog/cf666b/","text":"CF666B World Tour 题目大意： 一张 nnn 个点 mmm 条边的有向图，每条边的权值相同。你要找 444 个点 a,b,c,da,b,c,da,b,c,d 使得 (a−&gt;b−&gt;c−&gt;d)(a-&gt;b-&gt;c-&gt;d)(a−&gt;b−&gt;c−&gt;d) 的最短路最长 ( a,b,c,d 之间要有路)，输出一组解。 题目正解： 最短路 + 暴力枚举 题目思路： 先 nnn 轮 SPAFSPAFSPAF 跑出任意两点最短路,然后处理出 每个点 iii 能到的点 jjj 和能到 iii 的点 jjj,把路径从大到小排序,枚举两个点 bbb 和 ccc ,从能到 bbb 的点中前 333 个选出 aaa ，从 ccc 能到的点中前 333 个选出 ddd ,记录当前路径长度,最后选出最优解。（至于为何是前 3 我也不太清楚…） 时间复杂度： O(n2)O(n^2)O(n2) 题目代码： 12345678910111213141516171819202122232425262728293031323334353637383940414243444546474849505152535455565758596061626364656667686970717273747576777879808182838485868788899091#include &lt;bits/stdc++.h&gt;#define inf 0x3f3f3f3f#define mkp make_pairconst int Maxn = 3e3 + 10;const int Maxm = 5e4 + 10;using namespace std;struct edge &#123; int v, nxt;&#125; e[Maxm];int hd[Maxn], cnt;void add(int u, int v) &#123; e[++cnt] = (edge)&#123;v, hd[u]&#125;; hd[u] = cnt;&#125;int n, m, dis[Maxn][Maxn], vis[Maxn];void solve(int s) &#123; //n 轮 SPAF 求任意两点最短路径 memset(vis, 0, sizeof(vis)); queue&lt; int &gt; q; q.push(s); vis[s] = 1; while (!q.empty()) &#123; int x = q.front(); q.pop(); vis[x] = 0; for (int i = hd[x]; i; i = e[i].nxt) &#123; int y = e[i].v; if (dis[s][y] &gt; dis[s][x] + 1) &#123; dis[s][y] = dis[s][x] + 1; if (!vis[y]) &#123; q.push(y), vis[y] = 1; &#125; &#125; &#125; &#125;&#125;vector&lt; pair&lt; int, int &gt; &gt; A[Maxn], B[Maxn];int main() &#123; memset(dis, 0x3f, sizeof(dis)); scanf(&quot;%d%d&quot;, &amp;n, &amp;m); for (int i = 1, x, y; i &lt;= m; i++) &#123; scanf(&quot;%d%d&quot;, &amp;x, &amp;y); add(x, y); &#125; for (int i = 1; i &lt;= n; i++) &#123; dis[i][i] = 0; solve(i); &#125; int Ans = 0, a, b, c, d; for (int i = 1; i &lt;= n; i++) &#123; for (int j = 1; j &lt;= n; j++) &#123; if (i == j) continue; if (dis[i][j] != inf) A[i].push_back(mkp(dis[i][j], j)); //求 i 能到的点 if (dis[j][i] != inf) B[i].push_back(mkp(dis[j][i], j)); //求能到 i 的点 &#125; sort(A[i].begin(), A[i].end()); //这里是从小到大排序的,后面要从后往前枚举 sort(B[i].begin(), B[i].end()); &#125; int ta, tb, tc, td, Sta, Stb, Stc, Std; for (tb = 1; tb &lt;= n; tb++) &#123; //枚举 b Stb = B[tb].size(); for (tc = 1; tc &lt;= n; tc++) &#123; //枚举 c if (tb == tc || dis[tb][tc] == inf) //判定不合法 continue; Stc = A[tc].size(); for (Sta = Stb - 1; Sta &gt;= 0 &amp;&amp; Sta &gt;= Stb - 3; Sta--) &#123; //找 a ta = B[tb][Sta].second; if (ta == tb || ta == tc || dis[ta][tb] == inf) continue; //判定不合法 for (Std = Stc - 1; Std &gt;= 0 &amp;&amp; Std &gt;= Stc - 3; Std--) &#123; //找 d td = A[tc][Std].second; if (td == tb || td == tc || td == ta || dis[tc][td] == inf) //判定不合法 continue; if (Ans &lt; dis[ta][tb] + dis[tb][tc] + dis[tc][td]) &#123; //更新答案 Ans = dis[ta][tb] + dis[tb][tc] + dis[tc][td]; a = ta, b = tb, c = tc, d = td; &#125; &#125; &#125; &#125; &#125; printf(&quot;%d %d %d %d\\n&quot;, a, b, c, d); return 0;&#125; 本文作者：CloudySky 写作时间： 2021-08-10 最后更新时间： 2021-08-10 遵循协议： BY-NC-SA","tags":"图论 题解"},{"title":"CF715B Complete The Graph","url":"/Blog/cf715b/","text":"CF715B Complete The Graph 题目大意： 给定一张无向图 ，和一个约束条件：sss 到 ttt 的最短路长度为 lll。修改所有边权为 0 的边使之权值为 [1,1e18][1,1e18][1,1e18] ,使得约束条件成立。输出 “YES” 后输出每条边权值,如不能则输出 “NO”。 题目正解： 两遍最短路，一遍统计，一遍修改 题目思路： 由于空边的边权至少是 111 ，所以输入时直接判断边权，标记后权值赋成 111 ，如果一遍最短路后权值大于 lll 说明无解。否则再跑一遍最短路，将空边权值赋成合法的最大值，来保证 (s−&gt;t)(s-&gt;t)(s−&gt;t) 最短路等于 lll, 如果所有可操作边都操作后最短路仍不为 lll 则无解。否则输出每条边。 时间复杂度： O(mlogn)O(mlogn)O(mlogn) 题目代码： 123456789101112131415161718192021222324252627282930313233343536373839404142434445464748495051525354555657585960616263646566676869707172737475767778798081828384858687888990919293949596979899100101102#include &lt;bits/stdc++.h&gt;#define ll long longconst int Maxn = 1e3 + 10;const ll inf = 1e18;using namespace std;int E[Maxn &lt;&lt; 5];ll t1[Maxn &lt;&lt; 4], t2[Maxn &lt;&lt; 4];//由于需要频繁修改边权，所以建立一个映射关系，双向边对应一个权值。struct edge &#123; int v, nxt, u;&#125; e[Maxn &lt;&lt; 5];int hd[Maxn], cnt;void add(int u, int v) &#123; e[++cnt] = (edge)&#123;v, hd[u], u&#125;; hd[u] = cnt;&#125;struct node &#123; int u, d; bool operator&lt;(const node y) const &#123; return d &gt; y.d; &#125;&#125;;priority_queue&lt; node &gt; q;long long dis1[Maxn], dis2[Maxn];int vis[Maxn];void solve1(int s) &#123; //第一遍 dijkstra 求最短路 memset(dis1, 0x3f, sizeof(dis1)); memset(vis, 0, sizeof(vis)); q.push((node)&#123;s, 0&#125;); dis1[s] = 0; while (!q.empty()) &#123; node tmp = q.top(); q.pop(); int x = tmp.u; if (vis[x]) continue; vis[x] = 1; for (int i = hd[x]; i; i = e[i].nxt) &#123; int y = e[i].v; if (dis1[y] &gt; dis1[x] + t1[E[i]]) &#123; dis1[y] = dis1[x] + t1[E[i]]; q.push((node)&#123;y, dis1[y]&#125;); &#125; &#125; &#125;&#125;void solve2(int s, int nxted) &#123; //第二遍 dijkstra 改边权 memset(dis2, 0x3f, sizeof(dis2)); memset(vis, 0, sizeof(vis)); q.push((node)&#123;s, 0&#125;); dis2[s] = 0; while (!q.empty()) &#123; node tmp = q.top(); q.pop(); int x = tmp.u; if (vis[x]) continue; vis[x] = 1; for (int i = hd[x]; i; i = e[i].nxt) &#123; int y = e[i].v; if (!t2[E[i]] //判断是否为空边 &amp;&amp; dis2[x] + t1[E[i]] &lt; dis1[y] + nxted) //判断边权是否需要修改 t1[E[i]] = dis1[y] + nxted - dis2[x]; //赋成合法最大值 if (dis2[y] &gt; dis2[x] + t1[E[i]]) &#123; //维护修改后最短路 dis2[y] = dis2[x] + t1[E[i]]; q.push((node)&#123;y, dis2[y]&#125;); &#125; &#125; &#125;&#125;int main() &#123; int n, m, s, t; ll L; scanf(&quot;%d%d%lld%d%d&quot;, &amp;n, &amp;m, &amp;L, &amp;s, &amp;t); s += 1, t += 1; for (int i = 1, x, y; i &lt;= m; ++i) &#123; long long z; scanf(&quot;%d%d%lld&quot;, &amp;x, &amp;y, &amp;z); add(x + 1, y + 1), add(y + 1, x + 1); t1[i] = t2[i] = z; if (!z) t1[i] = 1; E[cnt] = E[cnt - 1] = i; &#125; solve1(s); if (dis1[t] &gt; L) &#123; printf(&quot;NO&quot;); return 0; &#125; solve2(s, L - dis1[t]); if (dis2[t] != L) &#123; printf(&quot;NO&quot;); return 0; &#125; printf(&quot;YES\\n&quot;); for (int i = 1; i &lt;= cnt; i += 2) &#123; int u = e[i].u - 1, v = e[i].v - 1, t = t1[E[i]]; printf(&quot;%d %d %d\\n&quot;, u, v, t); &#125;&#125; 本文作者：CloudySky 写作时间： 2021-08-10 最后更新时间： 2021-08-10 遵循协议： BY-NC-SA","tags":"图论 题解"},{"title":"最短路算法 学习笔记","url":"/Blog/Shortest-Path/","text":"最短路算法分为多源最短路和单源最短路，比较常见的共有3种最短路算法，分别是 FloyedFloyedFloyed , dijkstradijkstradijkstra 和 SPAFSPAFSPAF 。 FloyedFloyedFloyed 时间复杂度 O(N3)O(N^{3})O(N3) 多源最短路算法，本质上是动态规划，由于时间复杂度较高应用并不广泛。 代码实现由三层 for 循环组成，最外层枚举状态转移的点，内层枚举起点和终点。 fk,i,j=min(fk−1,i,k+fk−1,k,j,fk−1,i,j)(i,j,k∈[1,n])f_{k,i,j}=min(f_{k-1,i,k}+f_{k-1,k,j},f_{k-1,i,j}) (i,j,k\\in [1,n]) fk,i,j​=min(fk−1,i,k​+fk−1,k,j​,fk−1,i,j​)(i,j,k∈[1,n]) 由于状态转移时只需要上一层的状态，所以可以压缩掉一维，变成: fi,j=min(fi,k+fk,j,fi,j)(i,j,k∈[1,n])f_{i,j}=min(f_{i,k}+f_{k,j},f_{i,j})(i,j,k\\in [1,n]) fi,j​=min(fi,k​+fk,j​,fi,j​)(i,j,k∈[1,n]) 完整的实现代码： 1234567891011// 最短路算法 学习笔记// Floyed 算法具体实现int f[1e3 + 10][1e3 + 10];void floyed() &#123; for (int k = 1; k &lt;= n; ++k) &#123; for (int i = 1; i &lt;= n; ++i) for (int j = 1; j &lt;= n; ++j) f[i][j] = min(f[i][j], f[i][k] + f[k][j]); &#125;&#125; DijkstraDijkstraDijkstra 时间复杂度 O(mlogn)O(mlogn)O(mlogn) 单源最短路算法，本质上是广搜变形，即通过贪心思想和优先队列优化的广度优先搜索算法。 具体实现 初始化 disdisdis 数组为极大，将起点插入队列，标记起点已访问； 选择当前已入队节点中 disdisdis 最小的点，标记已访问； 松弛操作，更新其他节点，并将未入过队的节点加入队列。 证明： 选择当前 disdisdis 最小的点来更新其他节点一定最优： 通过反证法可以证得。 在没有负环的图中，入过队的节点一定不会再次入队： 由证明1可知，后更新的点一定不如先更新的点优，所以任意一点都不会被用它更新过的点更新。 因此 dijkstradijkstradijkstra 算法是正确的。 在最短路算法中相对优秀，稠密图上应用较广。缺点是无法处理有负环的情况。 完整的代码实现： 1234567891011121314151617181920212223242526272829// 最短路算法 学习笔记// Dijkstra 算法具体实现int dis[1e5 + 10], vis[1e5 + 10];struct node &#123; int u, d; //为优先队列优化最短路做准备，也可以使用 STL pair bool operator&lt;(const node y) const &#123; return d &gt; y.d; //因为是大根堆，所以重载 &lt; 时，要建相反的符号 &#125;&#125; priority_queue&lt; node &gt; q; //建立优先队列void dijkstra(int s) &#123; memset(dis, 0x3f, sizeof(dis)); q.push((node)&#123;s, 0&#125;); //初始化 dis 数组并将起点插入队列，开始广搜 while (!q.empty()) &#123; node tmp = q.top(); q.pop(); //取出堆顶元素 int x = tmp.u; if (vis[x]) continue; //根据贪心思想剔除再次访问的元素 vis[x] = 1; //标记元素被访问过 for (int i = hd[x]; i; i = e[i].nxt) &#123; //遍历所有能够到达的点 int y = e[i].v; if (dis[y] &gt; dis[x] + e[i].t) &#123; //松弛操作 dis[y] = dis[x] + e[i].t; q.push((node)&#123;y, dis[y]&#125;); //入队 &#125; &#125; &#125;&#125; SPAF 关于 SPAFSPAFSPAF ，它死了… 时间复杂度 O(nm)O(nm)O(nm) 另一种常用的单源最短路算法，本质上也是广搜变形，通过队列优化的广度优先搜索算法。但 SPAFSPAFSPAF 并不满足广度优先搜索算法的两段性和单调性。 适合在稀疏图上使用，可以判断是否存在负环，经常与其他图论算法综合使用。 完整的代码实现： 123456789101112131415161718192021222324// 最短路算法 学习笔记// SPFA 算法具体实现int dis[1e5 + 10], vis[1e5 + 10]; //注意这里的 vis 与 dijkstra 不同，记录的是是否在队列中queue&lt; int &gt; q;void SPAF(int s) &#123; memset(dis, 0x3f, sizeof(dis)); q.push(s); vis[s] = 1; //标记起点已入队 while (!q.empty()) &#123; int x = q.front(); q.pop(); vis[x] = 0; for (int i = hd[x]; i; i = e[i].nxt) &#123; if (dis[y] &gt; dis[x] + e[i].t) &#123; dis[y] = dis[x] + e[i].t; if (!vis[y]) &#123; //这里入队操作与 dijkstra 不同 q.push(y); vis[y] = 1; &#125; &#125; &#125; &#125;&#125; Problems: CF507E Breaking Good CF543B Destroying Roads CF545E Paths and Trees CF666B World Tour CF715B Complete The Graph 本文作者：CloudySky 写作时间： 2021-08-10 最后更新时间： 2021-08-10 遵循协议： BY-NC-SA","tags":"图论"},{"title":"P6473 [NOI Online 2 入门组] 未了","url":"/Blog/p6473/","text":"早期题解 P6473 [NOI Online #2 入门组] 未了 这道题不用二分！！！ 其实不难想到，高度高的魔法比高度低的魔法要顶用，所以优先考虑用高度高的魔法。 其次，这道题不要求在线，可以将查询从小到大排序后离线扫一遍。 最终复杂度 O(nlogn)O(nlogn)O(nlogn)。 再说细节： 这道题大家应该都能想到要用前缀和。 不用魔法是，需要爬的高度就是 坡长。 用上最高的魔法时，高度即是 坡长+使用最高魔法的高度。 再用上次高的魔法时，高度即是 坡长+使用最高魔法的高度+使用次高魔法的高度。 以此类推 所以我们可以用前缀和来维护。 将 ans 数组初始化为 -1。因为排序过，所以询问数组满足单调性，前面无法做到，后面就更无法作到，所以如果扫到哪里发现做不到，就直接 break。 记着开 long long ！！！ Code for P6473 [NOI Online #2 入门组]未了： 12345678910111213141516171819202122232425262728293031323334353637383940414243444546474849505152535455#include &lt;bits/stdc++.h&gt;#define int long longconst int Maxn = 200010;using namespace std;int a[Maxn], s[Maxn], ans[Maxn];struct Ask &#123; int id, que; bool operator&lt;(const Ask x) const &#123; return que &lt; x.que; &#125;&#125; Q[Maxn];bool cmp(int a, int b) &#123; return a &gt; b;&#125;signed main() &#123; // freopen(&quot;endless.in&quot;,&quot;r&quot;,stdin); // freopen(&quot;endless.out&quot;,&quot;w&quot;,stdout); int n, L, v, q; scanf(&quot;%lld%lld%lld&quot;, &amp;n, &amp;L, &amp;v); a[0] = L, s[0] = L; for (int i = 1; i &lt;= n; i++) &#123; scanf(&quot;%lld&quot;, &amp;a[i]); &#125; scanf(&quot;%lld&quot;, &amp;q); for (int i = 1; i &lt;= q; i++) &#123; scanf(&quot;%lld&quot;, &amp;Q[i].que); Q[i].que *= v; Q[i].id = i; &#125; sort(a + 1, a + n + 1, cmp); for (int i = 1; i &lt;= n; i++) &#123; s[i] = s[i - 1] + a[i]; &#125; sort(Q + 1, Q + q + 1); int j = 0; memset(ans, -1, sizeof(ans)); for (int i = 1; i &lt;= q; i++) &#123; while (s[j] &lt;= Q[i].que &amp;&amp; j &lt;= n) j++; if (s[j] &gt; Q[i].que) ans[Q[i].id] = j; else break; &#125; for (int i = 1; i &lt;= q; i++) printf(&quot;%lld\\n&quot;, ans[i]); return 0;&#125; 本文作者：CloudySky 写作时间： 2020-04-25 最后更新时间： 2020-04-25 遵循协议： BY-NC-SA","tags":"dp 题解"},{"title":"P4552 [Poetize6] IncDec Sequence","url":"/Blog/p4552/","text":"早期题解 P4552 [Poetize6] IncDec Sequence 求出a的差分序列b,其中 b1=a1b_{1}=a_{1}b1​=a1​，bi=ai−ai−1(2≤i≤n)b_{i}=a_{i}-a_{i-1}(2≤i≤n)bi​=ai​−ai−1​(2≤i≤n)。令 bn+1=0b_{n+1}=0bn+1​=0。(一会有大用) 题目对序列a的操作，相当于每次可以选出 b1,b2,…,bn+1b_{1},b_{2},…,b_{n+1}b1​,b2​,…,bn+1​ 中的任意两个数，一个加1，另一个减1。目标是把 b2,b3,…,bnb_{2},b_{3},…,b_{n}b2​,b3​,…,bn​ 变为全零。最终得到的数列 aaa 就是由 nnn 个 b1b_{1}b1​ 构成的。 从 b1,b2,…,bn+1b_{1},b_{2},…,b_{n+1}b1​,b2​,…,bn+1​ 中任选两个数的方法可分为四类: 选 bib_{i}bi​ 和 bjb_{j}bj​，其中 2≤i,j≤n2≤i,j≤n2≤i,j≤n。这种操作会改变 b2,b3,…,bnb_{2},b_{3},…,b_{n}b2​,b3​,…,bn​ 中两个数的值。应该在保证 bib_{i}bi​ 和 bjb_{j}bj​ 一正一负的前提下，尽量多地采取这种操作，更快地接近目标。 选 b1b_{1}b1​ 和 bjb_{j}bj​，其中 2≤j≤n2≤j≤n2≤j≤n。 选 bib_{i}bi​ 和 bn+1b_{n+1}bn+1​，其中 2≤i≤n2≤i≤n2≤i≤n。 选 b1b_{1}b1​ 和 bn+1b_{n+1}bn+1​，这种情况没有意义，因为它不会改变 b2,b3,…,bnb_{2},b_{3},…,b_{n}b2​,b3​,…,bn​ 的值，相当于浪费了一次操作，一定不是最优解。 设 b2,b3,…,bnb_{2},b_{3},…,b_{n}b2​,b3​,…,bn​ 中正数总和为 ppp，负数总和的绝对值为 qqq。首先以正负数配对的方式尽量执行第1类操作，可执行 min⁡(p,q)\\min(p,q)min(p,q) 次。剩余 ∣p−q∣|p-q|∣p−q∣ 个未配对，每个可以选与 bnb_{n}bn​ 或 bn+1b_{n+1}bn+1​ 配对，即执行第2或3类操作，共需 ∣p−q∣|p-q|∣p−q∣ 次。 综上所述，最少操作次数为 min⁡(p,q)+∣p−q∣=max⁡(p,q)\\min(p,q)+|p-q|=\\max(p,q)min(p,q)+∣p−q∣=max(p,q) 次。根据 ∣p−q∣|p-q|∣p−q∣ 次第2、3类操作的选择情况，能产生 ∣p−q∣+1|p-q|+1∣p−q∣+1 种不同的 b1b_{1}b1​ 的值，即最终得到的序列a可能有 ∣p−q∣+1|p-q|+1∣p−q∣+1 种。 摘自《算法竞赛进阶指南》 知道这些之后，你就会惊奇的发现，这道题不用差分序列！ 只要在读入时维护正数的和以及负数和的绝对值就可以了，避免了不必要的空间浪费。 代码： 12345678910111213141516171819#include &lt;bits/stdc++.h&gt;using namespace std;const int Maxn = 100010;long long a[Maxn], b;int main() &#123; int n; long long p = 0, q = 0; //分别维护正数的和以及负数和的绝对值 scanf(&quot;%d&quot;, &amp;n); scanf(&quot;%lld&quot;, &amp;a[1]); //要先读入第一个数，因为第一个数没有差分 for (int i = 2; i &lt;= n; i++) &#123; scanf(&quot;%lld&quot;, &amp;a[i]); //读入 b = a[i] - a[i - 1]; //你可以理解为一个临时的差分序列 if (b &gt;= 0) p += b; if (b &lt; 0) q += -b; &#125; printf(&quot;%lld\\n&quot;, max(p, q)); //输出最少操作次数 printf(&quot;%lld\\n&quot;, p &gt; q ? p - q + 1 : q - p + 1); //输出结果数，即|p-q|+1 return 0;&#125; 本文作者：CloudySky 写作时间： 2020-03-16 最后更新时间： 2020-03-16 遵循协议： BY-NC-SA","tags":"题解 早期"},{"title":"CF620E New Year Tree","url":"/Blog/cf620e/","text":"早期题解 CF620E New Year Tree 线段树+dfs序+状态压缩搞定这道题 我们把每种颜色 kkk 设为 2k2^k2k，先dfs一遍把树变成区间，同时维护子树信息。（我用的是 pairpairpair，当然也可以用两个数组） 同时，这道题的代码比较长，要注意细节呦。（比如说要开 longlonglong longlonglong ） 具体推导过程楼下已经写得很详细了，我就是来上份详细注释、可读性较高的代码。（那里偷来的自信） 123456789101112131415161718192021222324252627282930313233343536373839404142434445464748495051525354555657585960616263646566676869707172737475767778798081828384858687888990919293949596979899100101102103104105106107108109110111112113114115116117118119120121122123124125126127#include &lt;cstdio&gt;#include &lt;iostream&gt;#define int long longtypedef unsigned long long ull;const int Maxn = 400010;using namespace std;struct edge &#123; int v, nxt;&#125; e[Maxn &lt;&lt; 2];int head[Maxn], cnt; //用链式前向星存边void adg(int u, int v) &#123; //加边操作 e[++cnt].v = v, e[cnt].nxt = head[u], head[u] = cnt;&#125;int pos[Maxn], t; //pos用来存放dfs序pair&lt; int, int &gt; tim[Maxn]; //用来维护子树信息 tim[i].second代表这棵子树的最后一个元素void dfs(int x, int f) &#123; pos[++t] = x; //存储dfs序 tim[x].first = t; //这棵子树的根 for (int i = head[x]; i; i = e[i].nxt) &#123; //遍历这个节点的边 int tmp = e[i].v; //存放下个节点 if (tmp == f) continue; //不能往回走 dfs(tmp, x); &#125; tim[x].second = t; //这棵子树的最后一个元素&#125;#define ls p &lt;&lt; 1 //偷个懒，事先设定好#define rs p &lt;&lt; 1 | 1 //和p*2+1一样ull c[Maxn]; //原序列struct Stree &#123; int l, r; ull dat, chg;#define l(x) St[x].l //同样，方便写代码，也方便理解（从哪里偷来的自信）#define r(x) St[x].r#define d(x) St[x].dat#define c(x) St[x].chg&#125; St[Maxn &lt;&lt; 2]; //因为最后一层有空节点，所以要开四倍//进入最可爱的线段树部分void build(int p, int l, int r) &#123; //建树 l(p) = l, r(p) = r; //确定子树范围 if (l == r) &#123; d(p) = 1ll * c[pos[l]]; return; &#125; //如果区间长度为一，代表到了最底层，返回 int mid = (l + r) &gt;&gt; 1; build(ls, l, mid); //建立左子树 build(rs, mid + 1, r); //建立右子树 d(p) = d(ls) | d(rs); //上传信息，由于要统计颜色个数，所以用不进位加法（或|），代表有这种颜色&#125;void spread(int p) &#123; //下传标记，注意是直接修改，不是增加。 if (c(p)) &#123; //如果有标记 d(ls) = c(p), d(rs) = c(p); //直接修改子树值 c(ls) = c(p), c(rs) = c(p); //把标记下传给字数 c(p) = 0ll; //取消标记 &#125;&#125;void change(int p, int l, int r, int d) &#123; //区间修改操作 if (l(p) &gt;= l &amp;&amp; r(p) &lt;= r) &#123; d(p) = d; c(p) = d; return; &#125; //如果覆盖区间，直接打标记，降低复杂度 spread(p); //否则先下传标记 int mid = (l(p) + r(p)) &gt;&gt; 1; if (l &lt;= mid) change(ls, l, r, d); //如果左子树有重叠，修改左子树 if (r &gt; mid) change(rs, l, r, d); //同理可证 d(p) = d(ls) | d(rs); //上传信息，线段树每部操作都要顺便上传信息&#125;ull ask(int p, int l, int r) &#123; //询问操作 if (l(p) &gt;= l &amp;&amp; r(p) &lt;= r) &#123; return d(p); &#125; //如果完全覆盖，就直接返回 spread(p); //否则先下传标记 int mid = (l(p) + r(p)) &gt;&gt; 1; ull val = 0; //一开始没有任何颜色 if (l &lt;= mid) val |= ask(ls, l, r); //如果左子树有重叠，统计左子树 if (r &gt; mid) val |= ask(rs, l, r); //如果右子树有重叠，统计右子树 d(p) = d(ls) | d(rs); //顺便上传信息 return val; //返回颜色&#125;signed main() &#123; int n, m; scanf(&quot;%lld%lld&quot;, &amp;n, &amp;m); for (int i = 1, tmp; i &lt;= n; i++) &#123; scanf(&quot;%lld&quot;, &amp;tmp); c[i] = (1ll &lt;&lt; tmp); &#125; int x, y; for (int j = 1; j &lt;= n - 1; j++) &#123; scanf(&quot;%lld%lld&quot;, &amp;x, &amp;y); adg(x, y), adg(y, x); &#125; dfs(1, 0); build(1, 1, n);#define lowbit(x) x &amp; -x int t, v, l, r; ull ch; for (int k = 1, tmp; k &lt;= m; k++) &#123; scanf(&quot;%lld&quot;, &amp;t); if (t == 2) &#123; scanf(&quot;%lld&quot;, &amp;v); l = tim[v].first, r = tim[v].second; ull temp = ask(1, l, r); int ans = 0; for (; temp; temp -= lowbit(temp)) ans++; //统计答案，lowbit是最后一位为 1 的数位 printf(&quot;%lld\\n&quot;, ans); &#125; else &#123; scanf(&quot;%lld%lld&quot;, &amp;v, &amp;tmp); l = tim[v].first, r = tim[v].second, ch = (1ll &lt;&lt; tmp); change(1, l, r, ch); &#125; &#125; return 0;&#125; 本文作者：CloudySky 写作时间： 2020-03-11 最后更新时间： 2020-03-11 遵循协议： BY-NC-SA","tags":"题解 早期"},{"title":"博客索引","url":"/Blog/BlogContent/","text":"上次更新时间：2022-03-04 我不认为我有 command-block 的实力，但仍希望可以带来更好的体验。 注：这里文章是按发布时间排序的，博客中按维护时间排序。 图论部分： 小结：多数作于初三暑假集训初期，可以算较为全面，但多数质量不高。 最短路算法 学习笔记 浅略地写了三种最短路算法，和优缺点，并附上了代码。 题单中为老师要求的题目，解法都比较神奇，由于当时能力有限，所能提供的思路很少。 最小生成树 学习笔记 简写了两种最小生成树算法的，并附上了代码。 题单中为老师要求的题目，由于当时能力有限，所能提供的思路很少。 欧拉路 学习笔记 简介了关于欧拉路和欧拉回路的定义和简单判定，较大篇幅复制的课件。 Tarjan算法 学习笔记\\color{red}{\\text{Tarjan算法 学习笔记}}Tarjan算法 学习笔记 简介了关于有向图强连通分量，无向图点双，边双的定义与等价描述，和 tarjan 算法实现方法。 在 2022 年初进行了维护，或许值得一看。 玄学建图初步 学习笔记 简介了两种常见的建图套路，并附了两道模板题，同样为老师要求的题。 二分图基础知识 学习笔记 介绍了二分图的一些简单概念与性质与匈牙利二分图匹配算法。 拓扑排序 学习笔记 介绍了拓扑排序的基础实现。 网络流及 Dinic,EK 学习笔记\\color{red}{\\text{网络流及 Dinic,EK 学习笔记}}网络流及 Dinic,EK 学习笔记 介绍了网络流的基本知识和两种常用的网络流实现算法。 或许值得一看。 字符串部分： 字符串基础 学习笔记 成篇于暑假初期，介绍了几种字符串算法，涉及回文串，字符串匹配。进行过一定维护。 后缀数组 学习笔记 对寒假进一步学习的预习。写的比较潦草，大部分借鉴 OI Wiki. 数据结构部分： 小结：可能写的比较零散，没有进行过专项。 字典树 学习笔记 成篇于暑假初期。介绍了 TrieTrieTrie 树的几种应用，涉及字符串，异或操作和平衡树。 FHQ_Treap 学习笔记\\color{red}{\\text{FHQ\\_Treap 学习笔记}}FHQ_Treap 学习笔记 介绍了 FHQ_TreapFHQ\\_TreapFHQ_Treap 并附上了代码，有一定可读性。 线段树 学习笔记\\color{red}{\\text{线段树 学习笔记}}线段树 学习笔记 较详细地介绍了线段树和常见变形，对基础要求低。 P1972 [SDOI2009]HH的项链 可持久化线段树的一道例题。 自动机 学习笔记\\color{red}{\\text{自动机 学习笔记}}自动机 学习笔记 关于自动机的综合性学习笔记。 左偏树 学习笔记 简介左偏树。 LCT 学习笔记 LCT 的写法和简单应用。 数论部分： 小结：大部分是一些零碎的算法的学习笔记。多数作于高一刚开学时。 康托展开 学习笔记 介绍了康托展开算法，附上了板子。 拓展欧几里得算法 学习笔记\\color{red}{\\text{拓展欧几里得算法 学习笔记}}拓展欧几里得算法 学习笔记 较详细地介绍了扩展欧几里得算法。 中国剩余定理 学习笔记 介绍了中国剩余定理和扩展中国剩余定理算法，并附上了板子。 矩阵 学习笔记\\color{red}{\\text{矩阵 学习笔记}}矩阵 学习笔记 较系统地介绍了矩阵基础知识和应用，进行过多次维护。 离散对数 学习笔记 介绍了离散对数和 BSGS 算法的实现。 博弈论 学习笔记 介绍了博弈论基础知识。 数论初步 学习笔记\\color{red}{\\text{数论初步 学习笔记}}数论初步 学习笔记 介绍了数论初步知识，欧拉函数和莫比乌斯函数的性质和简单应用。关于约数方面还有待完善。 多项式 学习笔记\\color{red}{\\text{多项式 学习笔记}}多项式 学习笔记 多项式基础知识，多项式半家桶。但写了的部分应该挺详细。 计数部分 小结：计数弱的一批。博客也写得很菜。 Prufer 序列 学习笔记 一个比较散的学习笔记，介绍了一下 PruferPruferPrufer 序列的构建方法和简单应用。 组合数学基础知识 学习笔记 介绍了排列组合的一些性质。仅限于理论，对代码没有什么帮助。 容斥原理 学习笔记 歪门邪道的容斥。局限的应用。 生成函数 学习笔记 片面的生成函数。学习的非常浅，仅限基础知识。 动态规划部分 小结：高中之前动态规划一直特别弱，所以写的都是一些简单题的题解，加速理解。 背包问题 学习笔记\\color{red}{\\text{背包问题 学习笔记}}背包问题 学习笔记 少有的成系统的学习笔记，介绍了常见背包模板。 P1868 饥饿的奶牛 一道简单的线性 DP P5020 [NOIP2018 提高组] 货币系统 一道简单的背包 DP P5322 [BJOI2019]排兵布阵 一道简单的线性 DP P3558 [POI2013]BAJ-Bytecomputer 一道简单的线性 DP P4302 [SCOI2003]字符串折叠 一道简单的区间 DP 分治部分： 小结：目前只有两篇，在 2021 年末成篇。 CDQ分治 学习笔记 简介了 CDQCDQCDQ 分治算法，应用方面有待完善。 整体二分 学习笔记\\color{red}{\\text{整体二分 学习笔记}}整体二分 学习笔记 简介了整体二分算法，较为全面。 树分治 学习笔记 简介点分治与点分树。较为简短。 一些综合性题解或杂项（不再标注） NOIP2021 游记及题解 浅述我的 NOIP2021 学习（划水）经历\\NOIP T1-T3 题解 2021-10-21 CSP 考前模拟赛题解 2021-12-12 模拟赛总结 2021-12-26 模拟赛总结 口胡题解-模拟赛 2022-01-17 2022寒假集训做题总结","tags":""},{"title":"分类","url":"/Blog/categories/index.html","text":"","tags":""},{"title":"标签","url":"/Blog/tags/index.html","text":"","tags":""},{"title":"垃圾箱","url":"/Blog/Bin/index.html","text":"长风破浪会有时，直挂云帆济沧海。 纵使世界万般残酷，总有温暖值得守护。 永远相信美好的事情即将发生。 人只有生活在垃圾堆里，才会努力往上爬，证明自己不是垃圾。 既然选择了远方，便只顾风雨兼程。 人们总是妄想用一些自己曾经都无法接受的说法来掩饰自己的失败。","tags":""},{"title":"友链","url":"/Blog/friends/index.html","text":"宝硕 学习，就是发现自己越来越菜的过程。[计算机带师] LawrenceSivan I was so much older then, I'm younger than that now.[不会形容了] rsdbk_husky’s blog Life is a game, and the game is life youwike 从今天起，要以谦虚的姿态去追求卓越[学姐好！] Noob_Compiler 还剩最后一年，卷不死就往死里卷[2023 队长好！] JeffZhao 我醉欲眠卿且去，明朝有意抱题来[大卷王，只会卷。] Johnsonloy 凡王之血，必以剑终[二次元人赢] Acestar A drop of tear blurs memories of the past.[人赢] xixike 人间忽晚，山河已秋[预备人赢] Shu-Kuang 我不认为我知道那些我不知道的事情。[地理课代表] Ignotus Where your treasure is, there will your heart be also.[蟹d长] sjzezsyxx “二南之化，东南之美-格格巫” ztxcsl 懒狗一条","tags":""},{"title":"关于","url":"/Blog/About/index.html","text":"关于我： 永远的空想家。。。 一个河北高一 OIer。常用 ID : CloudySky , _CloudySky_ , CloudySkyET 有够单薄的。。最后一个只是因为被抢注了，真的没有别的意思。 洛谷号：_CloudySky_ CF（菜死了）：_CloudySky_ 偶像名叫 command_block 引用班主任的一段话： 关于这个博客： 里面的大部分内容还是写给自己的，适合看的水平与我写作时的水平有关。希望对你能有帮助。 有一些是现学现写的，有些急于求成；也有一些是复习时写的，咕了好久忘差不多了… 当然也会有一些我认为写的不错的。对于前面两类会尽量去改。 里面多少会有一些从其他博客里取过来的经，但最终目的是为了自己掌握。 学习笔记一般格式为： 简介 + 具体实现 + 代码实现 题解一般格式为： 题目大意 + 题目正解 + 题目思路 + 复杂度 + 代码 大原则：简约优先懒 关于代码折叠：不想让代码占据主要篇幅而已。 主站主题：Butterfly 博客 因为个人比较善变，所以用过博客换过很多主题，在这里像曾经用过的主题和现在在用的主题作者表示感谢： landscape , Pure, Adagio, NexT, Diaspora, Butterfly, CleanBlog 目前是 landscape 的修改版本。说实话并不是喜欢简洁，只是花里胡哨的太慢了。 关于博客密码: 生活 标签的私聊找我要就行。 Test 标签密码为 ‘S2OJ id’。（如果不对说明我不想让你看）","tags":""}]}